Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "Nay, answer me. Stand and unfold yourself.", created_at:"1609-07-02T22:34:51-07:00", updated_at:"1609-07-02T22:34:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "Long live the King!", created_at:"1609-07-02T23:04:20-07:00", updated_at:"1609-07-02T23:04:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "Barnardo.", created_at:"1609-07-02T23:28:32-07:00", updated_at:"1609-07-02T23:28:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "He.", created_at:"1609-07-02T23:53:10-07:00", updated_at:"1609-07-02T23:53:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "You come most carefully upon your hour.", created_at:"1609-07-03T00:18:50-07:00", updated_at:"1609-07-03T00:18:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "’Tis now struck twelve. Get thee to bed, Francisco.", created_at:"1609-07-03T00:40:25-07:00", updated_at:"1609-07-03T00:40:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "For this relief much thanks. ’Tis bitter cold,", created_at:"1609-07-03T01:09:56-07:00", updated_at:"1609-07-03T01:09:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "And I am sick at heart.", created_at:"1609-07-03T01:12:16-07:00", updated_at:"1609-07-03T01:12:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "Have you had quiet guard?", created_at:"1609-07-03T01:45:47-07:00", updated_at:"1609-07-03T01:45:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "Not a mouse stirring.", created_at:"1609-07-03T02:12:18-07:00", updated_at:"1609-07-03T02:12:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "Well, good night.", created_at:"1609-07-03T02:33:20-07:00", updated_at:"1609-07-03T02:33:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "If you do meet Horatio and Marcellus,", created_at:"1609-07-03T02:58:53-07:00", updated_at:"1609-07-03T02:58:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_0.id, body: "The rivals of my watch, bid them make haste.", created_at:"1609-07-03T03:10:34-07:00", updated_at:"1609-07-03T03:10:34-07:00"})
