Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "I think I hear them.—Stand ho! Who is there?", created_at:"1609-07-03T03:32:44-07:00", updated_at:"1609-07-03T03:32:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "Friends to this ground.", created_at:"1609-07-03T03:32:50-07:00", updated_at:"1609-07-03T03:32:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "And liegemen to the Dane.", created_at:"1609-07-03T04:07:24-07:00", updated_at:"1609-07-03T04:07:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "Give you good night.", created_at:"1609-07-03T04:24:52-07:00", updated_at:"1609-07-03T04:24:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "O farewell, honest soldier. Who hath relieved", created_at:"1609-07-03T04:37:40-07:00", updated_at:"1609-07-03T04:37:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "you?", created_at:"1609-07-03T04:47:02-07:00", updated_at:"1609-07-03T04:47:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Francisco"}).id, parent_type: "DirectMessage", parent_id: direct_message_1.id, body: "Barnardo hath my place. Give you good night.", created_at:"1609-07-03T05:17:04-07:00", updated_at:"1609-07-03T05:17:04-07:00"})
