Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Holla, Barnardo.", created_at:"1609-07-03T05:56:54-07:00", updated_at:"1609-07-03T05:56:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Say, what, is Horatio there?", created_at:"1609-07-03T05:57:25-07:00", updated_at:"1609-07-03T05:57:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "A piece of him.", created_at:"1609-07-03T06:29:58-07:00", updated_at:"1609-07-03T06:29:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Welcome, Horatio.—Welcome, good Marcellus.", created_at:"1609-07-03T06:37:26-07:00", updated_at:"1609-07-03T06:37:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "What, has this thing appeared again tonight?", created_at:"1609-07-03T06:42:04-07:00", updated_at:"1609-07-03T06:42:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "I have seen nothing.", created_at:"1609-07-03T07:11:45-07:00", updated_at:"1609-07-03T07:11:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Horatio says ’tis but our fantasy", created_at:"1609-07-03T07:37:27-07:00", updated_at:"1609-07-03T07:37:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And will not let belief take hold of him", created_at:"1609-07-03T07:48:31-07:00", updated_at:"1609-07-03T07:48:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Touching this dreaded sight twice seen of us.", created_at:"1609-07-03T07:57:26-07:00", updated_at:"1609-07-03T07:57:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Therefore I have entreated him along", created_at:"1609-07-03T08:27:19-07:00", updated_at:"1609-07-03T08:27:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "With us to watch the minutes of this night,", created_at:"1609-07-03T08:38:16-07:00", updated_at:"1609-07-03T08:38:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "That, if again this apparition come,", created_at:"1609-07-03T08:46:23-07:00", updated_at:"1609-07-03T08:46:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "He may approve our eyes and speak to it.", created_at:"1609-07-03T09:24:34-07:00", updated_at:"1609-07-03T09:24:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Tush, tush, ’twill not appear.", created_at:"1609-07-03T09:44:07-07:00", updated_at:"1609-07-03T09:44:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Sit down awhile,", created_at:"1609-07-03T09:50:26-07:00", updated_at:"1609-07-03T09:50:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And let us once again assail your ears,", created_at:"1609-07-03T09:59:06-07:00", updated_at:"1609-07-03T09:59:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "That are so fortified against our story,", created_at:"1609-07-03T10:29:22-07:00", updated_at:"1609-07-03T10:29:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "What we have two nights seen.", created_at:"1609-07-03T11:06:16-07:00", updated_at:"1609-07-03T11:06:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Well, sit we down,", created_at:"1609-07-03T11:26:49-07:00", updated_at:"1609-07-03T11:26:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And let us hear Barnardo speak of this.", created_at:"1609-07-03T11:37:33-07:00", updated_at:"1609-07-03T11:37:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Last night of all,", created_at:"1609-07-03T11:59:15-07:00", updated_at:"1609-07-03T11:59:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "When yond same star that’s westward from the pole", created_at:"1609-07-03T12:16:46-07:00", updated_at:"1609-07-03T12:16:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Had made his course t’ illume that part of heaven", created_at:"1609-07-03T12:55:06-07:00", updated_at:"1609-07-03T12:55:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Where now it burns, Marcellus and myself,", created_at:"1609-07-03T13:03:55-07:00", updated_at:"1609-07-03T13:03:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "The bell then beating one—", created_at:"1609-07-03T13:33:07-07:00", updated_at:"1609-07-03T13:33:07-07:00"})
