DirectMessageParticipant.create!({direct_message_id: direct_message_3.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Peace, break thee off! Look where it comes again.", created_at:"1609-07-03T13:36:23-07:00", updated_at:"1609-07-03T13:36:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "In the same figure like the King that’s dead.", created_at:"1609-07-03T13:41:14-07:00", updated_at:"1609-07-03T13:41:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Thou art a scholar. Speak to it, Horatio.", created_at:"1609-07-03T14:11:00-07:00", updated_at:"1609-07-03T14:11:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Looks he not like the King? Mark it, Horatio.", created_at:"1609-07-03T14:33:35-07:00", updated_at:"1609-07-03T14:33:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Most like. It harrows me with fear and wonder.", created_at:"1609-07-03T15:10:04-07:00", updated_at:"1609-07-03T15:10:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "It would be spoke to.", created_at:"1609-07-03T15:46:07-07:00", updated_at:"1609-07-03T15:46:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Speak to it, Horatio.", created_at:"1609-07-03T16:15:16-07:00", updated_at:"1609-07-03T16:15:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "What art thou that usurp’st this time of night,", created_at:"1609-07-03T16:49:30-07:00", updated_at:"1609-07-03T16:49:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Together with that fair and warlike form", created_at:"1609-07-03T16:50:39-07:00", updated_at:"1609-07-03T16:50:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "In which the majesty of buried Denmark", created_at:"1609-07-03T17:05:03-07:00", updated_at:"1609-07-03T17:05:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Did sometimes march? By heaven, I charge thee,", created_at:"1609-07-03T17:18:42-07:00", updated_at:"1609-07-03T17:18:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "speak.", created_at:"1609-07-03T17:55:56-07:00", updated_at:"1609-07-03T17:55:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "It is offended.", created_at:"1609-07-03T18:01:03-07:00", updated_at:"1609-07-03T18:01:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "See, it stalks away.", created_at:"1609-07-03T18:21:20-07:00", updated_at:"1609-07-03T18:21:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Stay! speak! speak! I charge thee, speak!", created_at:"1609-07-03T18:53:41-07:00", updated_at:"1609-07-03T18:53:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "’Tis gone and will not answer.", created_at:"1609-07-03T19:15:35-07:00", updated_at:"1609-07-03T19:15:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "How now, Horatio, you tremble and look pale.", created_at:"1609-07-03T19:17:27-07:00", updated_at:"1609-07-03T19:17:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Is not this something more than fantasy?", created_at:"1609-07-03T19:31:37-07:00", updated_at:"1609-07-03T19:31:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "What think you on ’t?", created_at:"1609-07-03T19:43:22-07:00", updated_at:"1609-07-03T19:43:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Before my God, I might not this believe", created_at:"1609-07-03T20:22:24-07:00", updated_at:"1609-07-03T20:22:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Without the sensible and true avouch", created_at:"1609-07-03T20:39:56-07:00", updated_at:"1609-07-03T20:39:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Of mine own eyes.", created_at:"1609-07-03T21:05:06-07:00", updated_at:"1609-07-03T21:05:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Is it not like the King?", created_at:"1609-07-03T21:35:13-07:00", updated_at:"1609-07-03T21:35:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "As thou art to thyself.", created_at:"1609-07-03T22:09:37-07:00", updated_at:"1609-07-03T22:09:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Such was the very armor he had on", created_at:"1609-07-03T22:35:41-07:00", updated_at:"1609-07-03T22:35:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "When he the ambitious Norway combated.", created_at:"1609-07-03T22:37:22-07:00", updated_at:"1609-07-03T22:37:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "So frowned he once when, in an angry parle,", created_at:"1609-07-03T22:46:36-07:00", updated_at:"1609-07-03T22:46:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "He smote the sledded Polacks on the ice.", created_at:"1609-07-03T23:15:46-07:00", updated_at:"1609-07-03T23:15:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "’Tis strange.", created_at:"1609-07-03T23:32:12-07:00", updated_at:"1609-07-03T23:32:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Thus twice before, and jump at this dead hour,", created_at:"1609-07-04T00:10:24-07:00", updated_at:"1609-07-04T00:10:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "With martial stalk hath he gone by our watch.", created_at:"1609-07-04T00:23:19-07:00", updated_at:"1609-07-04T00:23:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "In what particular thought to work I know not,", created_at:"1609-07-04T00:59:57-07:00", updated_at:"1609-07-04T00:59:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "But in the gross and scope of mine opinion", created_at:"1609-07-04T01:05:38-07:00", updated_at:"1609-07-04T01:05:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "This bodes some strange eruption to our state.", created_at:"1609-07-04T01:15:51-07:00", updated_at:"1609-07-04T01:15:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Good now, sit down, and tell me, he that knows,", created_at:"1609-07-04T01:48:14-07:00", updated_at:"1609-07-04T01:48:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Why this same strict and most observant watch", created_at:"1609-07-04T02:07:23-07:00", updated_at:"1609-07-04T02:07:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "So nightly toils the subject of the land,", created_at:"1609-07-04T02:41:02-07:00", updated_at:"1609-07-04T02:41:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And why such daily cast of brazen cannon", created_at:"1609-07-04T03:04:58-07:00", updated_at:"1609-07-04T03:04:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And foreign mart for implements of war,", created_at:"1609-07-04T03:18:36-07:00", updated_at:"1609-07-04T03:18:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Why such impress of shipwrights, whose sore task", created_at:"1609-07-04T03:56:21-07:00", updated_at:"1609-07-04T03:56:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Does not divide the Sunday from the week.", created_at:"1609-07-04T04:13:07-07:00", updated_at:"1609-07-04T04:13:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "What might be toward that this sweaty haste", created_at:"1609-07-04T04:52:15-07:00", updated_at:"1609-07-04T04:52:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Doth make the night joint laborer with the day?", created_at:"1609-07-04T05:07:03-07:00", updated_at:"1609-07-04T05:07:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Who is ’t that can inform me?", created_at:"1609-07-04T05:41:29-07:00", updated_at:"1609-07-04T05:41:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "That can I.", created_at:"1609-07-04T05:57:12-07:00", updated_at:"1609-07-04T05:57:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "At least the whisper goes so: our last king,", created_at:"1609-07-04T06:00:15-07:00", updated_at:"1609-07-04T06:00:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Whose image even but now appeared to us,", created_at:"1609-07-04T06:31:27-07:00", updated_at:"1609-07-04T06:31:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Was, as you know, by Fortinbras of Norway,", created_at:"1609-07-04T06:54:55-07:00", updated_at:"1609-07-04T06:54:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Thereto pricked on by a most emulate pride,", created_at:"1609-07-04T07:04:07-07:00", updated_at:"1609-07-04T07:04:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Dared to the combat; in which our valiant Hamlet", created_at:"1609-07-04T07:32:54-07:00", updated_at:"1609-07-04T07:32:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "(For so this side of our known world esteemed him)", created_at:"1609-07-04T07:39:57-07:00", updated_at:"1609-07-04T07:39:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Did slay this Fortinbras, who by a sealed compact,", created_at:"1609-07-04T08:10:24-07:00", updated_at:"1609-07-04T08:10:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Well ratified by law and heraldry,", created_at:"1609-07-04T08:48:17-07:00", updated_at:"1609-07-04T08:48:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Did forfeit, with his life, all those his lands", created_at:"1609-07-04T09:23:42-07:00", updated_at:"1609-07-04T09:23:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Which he stood seized of, to the conqueror.", created_at:"1609-07-04T09:34:25-07:00", updated_at:"1609-07-04T09:34:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Against the which a moiety competent", created_at:"1609-07-04T10:03:23-07:00", updated_at:"1609-07-04T10:03:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Was gagèd by our king, which had returned", created_at:"1609-07-04T10:27:11-07:00", updated_at:"1609-07-04T10:27:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "To the inheritance of Fortinbras", created_at:"1609-07-04T11:02:23-07:00", updated_at:"1609-07-04T11:02:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Had he been vanquisher, as, by the same comart", created_at:"1609-07-04T11:09:07-07:00", updated_at:"1609-07-04T11:09:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And carriage of the article designed,", created_at:"1609-07-04T11:09:36-07:00", updated_at:"1609-07-04T11:09:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "His fell to Hamlet. Now, sir, young Fortinbras,", created_at:"1609-07-04T11:33:15-07:00", updated_at:"1609-07-04T11:33:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Of unimprovèd mettle hot and full,", created_at:"1609-07-04T12:03:32-07:00", updated_at:"1609-07-04T12:03:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Hath in the skirts of Norway here and there", created_at:"1609-07-04T12:38:04-07:00", updated_at:"1609-07-04T12:38:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Sharked up a list of lawless resolutes", created_at:"1609-07-04T12:52:56-07:00", updated_at:"1609-07-04T12:52:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "For food and diet to some enterprise", created_at:"1609-07-04T13:01:41-07:00", updated_at:"1609-07-04T13:01:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "That hath a stomach in ’t; which is no other", created_at:"1609-07-04T13:05:13-07:00", updated_at:"1609-07-04T13:05:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "(As it doth well appear unto our state)", created_at:"1609-07-04T13:16:51-07:00", updated_at:"1609-07-04T13:16:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "But to recover of us, by strong hand", created_at:"1609-07-04T13:37:05-07:00", updated_at:"1609-07-04T13:37:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And terms compulsatory, those foresaid lands", created_at:"1609-07-04T13:53:38-07:00", updated_at:"1609-07-04T13:53:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "So by his father lost. And this, I take it,", created_at:"1609-07-04T13:59:15-07:00", updated_at:"1609-07-04T13:59:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Is the main motive of our preparations,", created_at:"1609-07-04T14:07:33-07:00", updated_at:"1609-07-04T14:07:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "The source of this our watch, and the chief head", created_at:"1609-07-04T14:41:02-07:00", updated_at:"1609-07-04T14:41:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Of this posthaste and rummage in the land.", created_at:"1609-07-04T14:54:12-07:00", updated_at:"1609-07-04T14:54:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "I think it be no other but e’en so.", created_at:"1609-07-04T14:59:55-07:00", updated_at:"1609-07-04T14:59:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Well may it sort that this portentous figure", created_at:"1609-07-04T15:33:16-07:00", updated_at:"1609-07-04T15:33:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Comes armèd through our watch so like the king", created_at:"1609-07-04T15:35:57-07:00", updated_at:"1609-07-04T15:35:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "That was and is the question of these wars.", created_at:"1609-07-04T16:09:17-07:00", updated_at:"1609-07-04T16:09:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "A mote it is to trouble the mind’s eye.", created_at:"1609-07-04T16:44:06-07:00", updated_at:"1609-07-04T16:44:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "In the most high and palmy state of Rome,", created_at:"1609-07-04T16:51:11-07:00", updated_at:"1609-07-04T16:51:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "A little ere the mightiest Julius fell,", created_at:"1609-07-04T17:08:15-07:00", updated_at:"1609-07-04T17:08:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "The graves stood tenantless, and the sheeted dead", created_at:"1609-07-04T17:19:57-07:00", updated_at:"1609-07-04T17:19:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Did squeak and gibber in the Roman streets;", created_at:"1609-07-04T17:22:06-07:00", updated_at:"1609-07-04T17:22:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "As stars with trains of fire and dews of blood,", created_at:"1609-07-04T17:36:51-07:00", updated_at:"1609-07-04T17:36:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Disasters in the sun; and the moist star,", created_at:"1609-07-04T17:38:15-07:00", updated_at:"1609-07-04T17:38:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Upon whose influence Neptune’s empire stands,", created_at:"1609-07-04T18:05:20-07:00", updated_at:"1609-07-04T18:05:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Was sick almost to doomsday with eclipse.", created_at:"1609-07-04T18:11:41-07:00", updated_at:"1609-07-04T18:11:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And even the like precurse of feared events,", created_at:"1609-07-04T18:44:05-07:00", updated_at:"1609-07-04T18:44:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "As harbingers preceding still the fates", created_at:"1609-07-04T19:12:06-07:00", updated_at:"1609-07-04T19:12:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And prologue to the omen coming on,", created_at:"1609-07-04T19:49:14-07:00", updated_at:"1609-07-04T19:49:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Have heaven and Earth together demonstrated", created_at:"1609-07-04T19:52:47-07:00", updated_at:"1609-07-04T19:52:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Unto our climatures and countrymen.", created_at:"1609-07-04T20:01:20-07:00", updated_at:"1609-07-04T20:01:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "But soft, behold! Lo, where it comes again!", created_at:"1609-07-04T20:23:58-07:00", updated_at:"1609-07-04T20:23:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "I’ll cross it though it blast me.—Stay, illusion!", created_at:"1609-07-04T20:46:56-07:00", updated_at:"1609-07-04T20:46:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "If thou hast any sound or use of voice,", created_at:"1609-07-04T20:59:06-07:00", updated_at:"1609-07-04T20:59:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Speak to me.", created_at:"1609-07-04T21:11:59-07:00", updated_at:"1609-07-04T21:11:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "If there be any good thing to be done", created_at:"1609-07-04T21:43:23-07:00", updated_at:"1609-07-04T21:43:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "That may to thee do ease and grace to me,", created_at:"1609-07-04T21:50:45-07:00", updated_at:"1609-07-04T21:50:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Speak to me.", created_at:"1609-07-04T21:51:49-07:00", updated_at:"1609-07-04T21:51:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "If thou art privy to thy country’s fate,", created_at:"1609-07-04T22:03:41-07:00", updated_at:"1609-07-04T22:03:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Which happily foreknowing may avoid,", created_at:"1609-07-04T22:06:40-07:00", updated_at:"1609-07-04T22:06:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "O, speak!", created_at:"1609-07-04T22:21:35-07:00", updated_at:"1609-07-04T22:21:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Or if thou hast uphoarded in thy life", created_at:"1609-07-04T22:25:33-07:00", updated_at:"1609-07-04T22:25:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Extorted treasure in the womb of earth,", created_at:"1609-07-04T22:32:32-07:00", updated_at:"1609-07-04T22:32:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "For which, they say, you spirits oft walk in death,", created_at:"1609-07-04T22:37:58-07:00", updated_at:"1609-07-04T22:37:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Speak of it.", created_at:"1609-07-04T22:58:38-07:00", updated_at:"1609-07-04T22:58:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Stay and speak!—Stop it, Marcellus.", created_at:"1609-07-04T23:30:54-07:00", updated_at:"1609-07-04T23:30:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Shall I strike it with my partisan?", created_at:"1609-07-04T23:43:50-07:00", updated_at:"1609-07-04T23:43:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "Do, if it will not stand.", created_at:"1609-07-04T23:54:50-07:00", updated_at:"1609-07-04T23:54:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "’Tis here.", created_at:"1609-07-05T00:09:10-07:00", updated_at:"1609-07-05T00:09:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_3.id, body: "’Tis here.", created_at:"1609-07-05T00:12:22-07:00", updated_at:"1609-07-05T00:12:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "’Tis gone.", created_at:"1609-07-05T00:20:10-07:00", updated_at:"1609-07-05T00:20:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "We do it wrong, being so majestical,", created_at:"1609-07-05T00:35:01-07:00", updated_at:"1609-07-05T00:35:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "To offer it the show of violence,", created_at:"1609-07-05T00:58:57-07:00", updated_at:"1609-07-05T00:58:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "For it is as the air, invulnerable,", created_at:"1609-07-05T01:29:34-07:00", updated_at:"1609-07-05T01:29:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And our vain blows malicious mockery.", created_at:"1609-07-05T01:52:12-07:00", updated_at:"1609-07-05T01:52:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "It was about to speak when the cock crew.", created_at:"1609-07-05T02:27:12-07:00", updated_at:"1609-07-05T02:27:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And then it started like a guilty thing", created_at:"1609-07-05T02:31:49-07:00", updated_at:"1609-07-05T02:31:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Upon a fearful summons. I have heard", created_at:"1609-07-05T03:03:30-07:00", updated_at:"1609-07-05T03:03:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "The cock, that is the trumpet to the morn,", created_at:"1609-07-05T03:42:58-07:00", updated_at:"1609-07-05T03:42:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Doth with his lofty and shrill-sounding throat", created_at:"1609-07-05T04:20:19-07:00", updated_at:"1609-07-05T04:20:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Awake the god of day, and at his warning,", created_at:"1609-07-05T04:21:12-07:00", updated_at:"1609-07-05T04:21:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Whether in sea or fire, in earth or air,", created_at:"1609-07-05T04:39:06-07:00", updated_at:"1609-07-05T04:39:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Th’ extravagant and erring spirit hies", created_at:"1609-07-05T04:44:31-07:00", updated_at:"1609-07-05T04:44:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "To his confine, and of the truth herein", created_at:"1609-07-05T05:21:12-07:00", updated_at:"1609-07-05T05:21:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "This present object made probation.", created_at:"1609-07-05T05:39:12-07:00", updated_at:"1609-07-05T05:39:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "It faded on the crowing of the cock.", created_at:"1609-07-05T05:46:42-07:00", updated_at:"1609-07-05T05:46:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Some say that ever ’gainst that season comes", created_at:"1609-07-05T06:16:21-07:00", updated_at:"1609-07-05T06:16:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Wherein our Savior’s birth is celebrated,", created_at:"1609-07-05T06:42:10-07:00", updated_at:"1609-07-05T06:42:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "This bird of dawning singeth all night long;", created_at:"1609-07-05T07:04:06-07:00", updated_at:"1609-07-05T07:04:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "And then, they say, no spirit dare stir abroad,", created_at:"1609-07-05T07:17:26-07:00", updated_at:"1609-07-05T07:17:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "The nights are wholesome; then no planets strike,", created_at:"1609-07-05T07:47:08-07:00", updated_at:"1609-07-05T07:47:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "No fairy takes, nor witch hath power to charm,", created_at:"1609-07-05T08:23:04-07:00", updated_at:"1609-07-05T08:23:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "So hallowed and so gracious is that time.", created_at:"1609-07-05T09:01:48-07:00", updated_at:"1609-07-05T09:01:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "So have I heard and do in part believe it.", created_at:"1609-07-05T09:37:01-07:00", updated_at:"1609-07-05T09:37:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "But look, the morn in russet mantle clad", created_at:"1609-07-05T10:10:32-07:00", updated_at:"1609-07-05T10:10:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Walks o’er the dew of yon high eastward hill.", created_at:"1609-07-05T10:43:45-07:00", updated_at:"1609-07-05T10:43:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Break we our watch up, and by my advice", created_at:"1609-07-05T10:58:40-07:00", updated_at:"1609-07-05T10:58:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Let us impart what we have seen tonight", created_at:"1609-07-05T11:21:56-07:00", updated_at:"1609-07-05T11:21:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Unto young Hamlet; for, upon my life,", created_at:"1609-07-05T11:30:38-07:00", updated_at:"1609-07-05T11:30:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "This spirit, dumb to us, will speak to him.", created_at:"1609-07-05T11:56:50-07:00", updated_at:"1609-07-05T11:56:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Do you consent we shall acquaint him with it", created_at:"1609-07-05T12:11:06-07:00", updated_at:"1609-07-05T12:11:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "As needful in our loves, fitting our duty?", created_at:"1609-07-05T12:16:40-07:00", updated_at:"1609-07-05T12:16:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Let’s do ’t, I pray, and I this morning know", created_at:"1609-07-05T12:22:28-07:00", updated_at:"1609-07-05T12:22:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_2.id, body: "Where we shall find him most convenient.", created_at:"1609-07-05T12:45:41-07:00", updated_at:"1609-07-05T12:45:41-07:00"})
User.create!({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, display_name: "Claudius", email: "Claudius@hamlet.com", password: "password"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Though yet of Hamlet our dear brother’s death", created_at:"1609-07-05T12:50:36-07:00", updated_at:"1609-07-05T12:50:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "The memory be green, and that it us befitted", created_at:"1609-07-05T13:05:14-07:00", updated_at:"1609-07-05T13:05:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "To bear our hearts in grief, and our whole kingdom", created_at:"1609-07-05T13:43:59-07:00", updated_at:"1609-07-05T13:43:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "To be contracted in one brow of woe,", created_at:"1609-07-05T13:55:33-07:00", updated_at:"1609-07-05T13:55:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Yet so far hath discretion fought with nature", created_at:"1609-07-05T14:14:52-07:00", updated_at:"1609-07-05T14:14:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "That we with wisest sorrow think on him", created_at:"1609-07-05T14:17:56-07:00", updated_at:"1609-07-05T14:17:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Together with remembrance of ourselves.", created_at:"1609-07-05T14:57:34-07:00", updated_at:"1609-07-05T14:57:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Therefore our sometime sister, now our queen,", created_at:"1609-07-05T15:28:16-07:00", updated_at:"1609-07-05T15:28:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Th’ imperial jointress to this warlike state,", created_at:"1609-07-05T15:49:29-07:00", updated_at:"1609-07-05T15:49:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Have we (as ’twere with a defeated joy,", created_at:"1609-07-05T16:27:59-07:00", updated_at:"1609-07-05T16:27:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "With an auspicious and a dropping eye,", created_at:"1609-07-05T17:00:27-07:00", updated_at:"1609-07-05T17:00:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "With mirth in funeral and with dirge in marriage,", created_at:"1609-07-05T17:10:12-07:00", updated_at:"1609-07-05T17:10:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "In equal scale weighing delight and dole)", created_at:"1609-07-05T17:21:17-07:00", updated_at:"1609-07-05T17:21:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Taken to wife. Nor have we herein barred", created_at:"1609-07-05T17:55:34-07:00", updated_at:"1609-07-05T17:55:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Your better wisdoms, which have freely gone", created_at:"1609-07-05T18:15:23-07:00", updated_at:"1609-07-05T18:15:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "With this affair along. For all, our thanks.", created_at:"1609-07-05T18:18:51-07:00", updated_at:"1609-07-05T18:18:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Now follows that you know. Young Fortinbras,", created_at:"1609-07-05T18:45:11-07:00", updated_at:"1609-07-05T18:45:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Holding a weak supposal of our worth", created_at:"1609-07-05T18:45:35-07:00", updated_at:"1609-07-05T18:45:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Or thinking by our late dear brother’s death", created_at:"1609-07-05T19:02:45-07:00", updated_at:"1609-07-05T19:02:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Our state to be disjoint and out of frame,", created_at:"1609-07-05T19:41:29-07:00", updated_at:"1609-07-05T19:41:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Colleaguèd with this dream of his advantage,", created_at:"1609-07-05T20:03:20-07:00", updated_at:"1609-07-05T20:03:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "He hath not failed to pester us with message", created_at:"1609-07-05T20:18:53-07:00", updated_at:"1609-07-05T20:18:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Importing the surrender of those lands", created_at:"1609-07-05T20:48:31-07:00", updated_at:"1609-07-05T20:48:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Lost by his father, with all bonds of law,", created_at:"1609-07-05T21:04:46-07:00", updated_at:"1609-07-05T21:04:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "To our most valiant brother—so much for him.", created_at:"1609-07-05T21:36:45-07:00", updated_at:"1609-07-05T21:36:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Now for ourself and for this time of meeting.", created_at:"1609-07-05T21:44:04-07:00", updated_at:"1609-07-05T21:44:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Thus much the business is: we have here writ", created_at:"1609-07-05T21:52:57-07:00", updated_at:"1609-07-05T21:52:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "To Norway, uncle of young Fortinbras,", created_at:"1609-07-05T22:10:08-07:00", updated_at:"1609-07-05T22:10:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Who, impotent and bedrid, scarcely hears", created_at:"1609-07-05T22:16:13-07:00", updated_at:"1609-07-05T22:16:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Of this his nephew’s purpose, to suppress", created_at:"1609-07-05T22:46:14-07:00", updated_at:"1609-07-05T22:46:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "His further gait herein, in that the levies,", created_at:"1609-07-05T23:02:52-07:00", updated_at:"1609-07-05T23:02:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "The lists, and full proportions are all made", created_at:"1609-07-05T23:42:07-07:00", updated_at:"1609-07-05T23:42:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Out of his subject; and we here dispatch", created_at:"1609-07-06T00:22:02-07:00", updated_at:"1609-07-06T00:22:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "You, good Cornelius, and you, Voltemand,", created_at:"1609-07-06T00:51:55-07:00", updated_at:"1609-07-06T00:51:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "For bearers of this greeting to old Norway,", created_at:"1609-07-06T01:26:03-07:00", updated_at:"1609-07-06T01:26:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Giving to you no further personal power", created_at:"1609-07-06T01:40:17-07:00", updated_at:"1609-07-06T01:40:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "To business with the King more than the scope", created_at:"1609-07-06T02:11:17-07:00", updated_at:"1609-07-06T02:11:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Of these dilated articles allow.", created_at:"1609-07-06T02:19:27-07:00", updated_at:"1609-07-06T02:19:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Farewell, and let your haste commend your duty.", created_at:"1609-07-06T02:43:56-07:00", updated_at:"1609-07-06T02:43:56-07:00"})
User.create!({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, display_name: "Cornelius", email: "Cornelius@hamlet.com", password: "password"})
Message.create!({sender_id: User.find_by({display_name: "Cornelius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "In that and all things will we show our duty.", created_at:"1609-07-06T02:51:24-07:00", updated_at:"1609-07-06T02:51:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "We doubt it nothing. Heartily farewell.", created_at:"1609-07-06T03:20:12-07:00", updated_at:"1609-07-06T03:20:12-07:00"})
