DirectMessageParticipant.create!({direct_message_id: direct_message_5.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And now, Laertes, what’s the news with you?", created_at:"1609-07-06T03:53:37-07:00", updated_at:"1609-07-06T03:53:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "You told us of some suit. What is ’t, Laertes?", created_at:"1609-07-06T04:11:07-07:00", updated_at:"1609-07-06T04:11:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "You cannot speak of reason to the Dane", created_at:"1609-07-06T04:36:53-07:00", updated_at:"1609-07-06T04:36:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And lose your voice. What wouldst thou beg,", created_at:"1609-07-06T05:15:23-07:00", updated_at:"1609-07-06T05:15:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Laertes,", created_at:"1609-07-06T05:31:20-07:00", updated_at:"1609-07-06T05:31:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "That shall not be my offer, not thy asking?", created_at:"1609-07-06T05:48:07-07:00", updated_at:"1609-07-06T05:48:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "The head is not more native to the heart,", created_at:"1609-07-06T05:55:52-07:00", updated_at:"1609-07-06T05:55:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "The hand more instrumental to the mouth,", created_at:"1609-07-06T06:03:09-07:00", updated_at:"1609-07-06T06:03:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Than is the throne of Denmark to thy father.", created_at:"1609-07-06T06:14:08-07:00", updated_at:"1609-07-06T06:14:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "What wouldst thou have, Laertes?", created_at:"1609-07-06T06:35:36-07:00", updated_at:"1609-07-06T06:35:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "My dread lord,", created_at:"1609-07-06T07:08:32-07:00", updated_at:"1609-07-06T07:08:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Your leave and favor to return to France,", created_at:"1609-07-06T07:47:09-07:00", updated_at:"1609-07-06T07:47:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "From whence though willingly I came to Denmark", created_at:"1609-07-06T08:17:42-07:00", updated_at:"1609-07-06T08:17:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "To show my duty in your coronation,", created_at:"1609-07-06T08:29:17-07:00", updated_at:"1609-07-06T08:29:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Yet now I must confess, that duty done,", created_at:"1609-07-06T09:02:56-07:00", updated_at:"1609-07-06T09:02:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "My thoughts and wishes bend again toward France", created_at:"1609-07-06T09:19:04-07:00", updated_at:"1609-07-06T09:19:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And bow them to your gracious leave and pardon.", created_at:"1609-07-06T09:30:41-07:00", updated_at:"1609-07-06T09:30:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Have you your father’s leave? What says Polonius?", created_at:"1609-07-06T10:03:37-07:00", updated_at:"1609-07-06T10:03:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Hath, my lord, wrung from me my slow leave", created_at:"1609-07-06T10:33:56-07:00", updated_at:"1609-07-06T10:33:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "By laborsome petition, and at last", created_at:"1609-07-06T11:08:01-07:00", updated_at:"1609-07-06T11:08:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Upon his will I sealed my hard consent.", created_at:"1609-07-06T11:42:59-07:00", updated_at:"1609-07-06T11:42:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "I do beseech you give him leave to go.", created_at:"1609-07-06T11:43:55-07:00", updated_at:"1609-07-06T11:43:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Take thy fair hour, Laertes. Time be thine,", created_at:"1609-07-06T12:09:51-07:00", updated_at:"1609-07-06T12:09:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And thy best graces spend it at thy will.—", created_at:"1609-07-06T12:30:21-07:00", updated_at:"1609-07-06T12:30:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "But now, my cousin Hamlet and my son—", created_at:"1609-07-06T13:02:38-07:00", updated_at:"1609-07-06T13:02:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "A little more than kin and less than kind.", created_at:"1609-07-06T13:30:31-07:00", updated_at:"1609-07-06T13:30:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "How is it that the clouds still hang on you?", created_at:"1609-07-06T14:02:19-07:00", updated_at:"1609-07-06T14:02:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Not so, my lord; I am too much in the sun.", created_at:"1609-07-06T14:28:55-07:00", updated_at:"1609-07-06T14:28:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Good Hamlet, cast thy nighted color off,", created_at:"1609-07-06T15:01:45-07:00", updated_at:"1609-07-06T15:01:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And let thine eye look like a friend on Denmark.", created_at:"1609-07-06T15:39:46-07:00", updated_at:"1609-07-06T15:39:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Do not forever with thy vailèd lids", created_at:"1609-07-06T16:08:00-07:00", updated_at:"1609-07-06T16:08:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Seek for thy noble father in the dust.", created_at:"1609-07-06T16:43:55-07:00", updated_at:"1609-07-06T16:43:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Thou know’st ’tis common; all that lives must die,", created_at:"1609-07-06T17:22:26-07:00", updated_at:"1609-07-06T17:22:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Passing through nature to eternity.", created_at:"1609-07-06T17:28:32-07:00", updated_at:"1609-07-06T17:28:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Ay, madam, it is common.", created_at:"1609-07-06T17:40:26-07:00", updated_at:"1609-07-06T17:40:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "If it be,", created_at:"1609-07-06T18:04:52-07:00", updated_at:"1609-07-06T18:04:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Why seems it so particular with thee?", created_at:"1609-07-06T18:43:11-07:00", updated_at:"1609-07-06T18:43:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Seems, madam? Nay, it is. I know not seems.", created_at:"1609-07-06T19:03:59-07:00", updated_at:"1609-07-06T19:03:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "’Tis not alone my inky cloak, good mother,", created_at:"1609-07-06T19:38:15-07:00", updated_at:"1609-07-06T19:38:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Nor customary suits of solemn black,", created_at:"1609-07-06T19:54:11-07:00", updated_at:"1609-07-06T19:54:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Nor windy suspiration of forced breath,", created_at:"1609-07-06T20:28:48-07:00", updated_at:"1609-07-06T20:28:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "No, nor the fruitful river in the eye,", created_at:"1609-07-06T21:03:35-07:00", updated_at:"1609-07-06T21:03:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Nor the dejected havior of the visage,", created_at:"1609-07-06T21:42:35-07:00", updated_at:"1609-07-06T21:42:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Together with all forms, moods, shapes of grief,", created_at:"1609-07-06T22:01:44-07:00", updated_at:"1609-07-06T22:01:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "That can denote me truly. These indeed seem,", created_at:"1609-07-06T22:22:14-07:00", updated_at:"1609-07-06T22:22:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "For they are actions that a man might play;", created_at:"1609-07-06T22:39:27-07:00", updated_at:"1609-07-06T22:39:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "But I have that within which passes show,", created_at:"1609-07-06T22:57:03-07:00", updated_at:"1609-07-06T22:57:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "These but the trappings and the suits of woe.", created_at:"1609-07-06T23:16:51-07:00", updated_at:"1609-07-06T23:16:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "’Tis sweet and commendable in your nature,", created_at:"1609-07-06T23:27:28-07:00", updated_at:"1609-07-06T23:27:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Hamlet,", created_at:"1609-07-07T00:02:48-07:00", updated_at:"1609-07-07T00:02:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "To give these mourning duties to your father.", created_at:"1609-07-07T00:11:14-07:00", updated_at:"1609-07-07T00:11:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "But you must know your father lost a father,", created_at:"1609-07-07T00:42:16-07:00", updated_at:"1609-07-07T00:42:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "That father lost, lost his, and the survivor bound", created_at:"1609-07-07T01:20:46-07:00", updated_at:"1609-07-07T01:20:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "In filial obligation for some term", created_at:"1609-07-07T01:57:01-07:00", updated_at:"1609-07-07T01:57:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "To do obsequious sorrow. But to persever", created_at:"1609-07-07T02:34:57-07:00", updated_at:"1609-07-07T02:34:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "In obstinate condolement is a course", created_at:"1609-07-07T03:11:24-07:00", updated_at:"1609-07-07T03:11:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Of impious stubbornness. ’Tis unmanly grief.", created_at:"1609-07-07T03:39:41-07:00", updated_at:"1609-07-07T03:39:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "It shows a will most incorrect to heaven,", created_at:"1609-07-07T04:01:09-07:00", updated_at:"1609-07-07T04:01:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "A heart unfortified, a mind impatient,", created_at:"1609-07-07T04:33:22-07:00", updated_at:"1609-07-07T04:33:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "An understanding simple and unschooled.", created_at:"1609-07-07T05:07:46-07:00", updated_at:"1609-07-07T05:07:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "For what we know must be and is as common", created_at:"1609-07-07T05:36:39-07:00", updated_at:"1609-07-07T05:36:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "As any the most vulgar thing to sense,", created_at:"1609-07-07T05:50:35-07:00", updated_at:"1609-07-07T05:50:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Why should we in our peevish opposition", created_at:"1609-07-07T06:05:43-07:00", updated_at:"1609-07-07T06:05:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Take it to heart? Fie, ’tis a fault to heaven,", created_at:"1609-07-07T06:26:06-07:00", updated_at:"1609-07-07T06:26:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "A fault against the dead, a fault to nature,", created_at:"1609-07-07T06:49:17-07:00", updated_at:"1609-07-07T06:49:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "To reason most absurd, whose common theme", created_at:"1609-07-07T07:00:26-07:00", updated_at:"1609-07-07T07:00:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Is death of fathers, and who still hath cried,", created_at:"1609-07-07T07:25:27-07:00", updated_at:"1609-07-07T07:25:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "From the first corse till he that died today,", created_at:"1609-07-07T07:46:49-07:00", updated_at:"1609-07-07T07:46:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "This must be so. We pray you, throw to earth", created_at:"1609-07-07T07:49:01-07:00", updated_at:"1609-07-07T07:49:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "This unprevailing woe and think of us", created_at:"1609-07-07T08:27:38-07:00", updated_at:"1609-07-07T08:27:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "As of a father; for let the world take note,", created_at:"1609-07-07T08:36:48-07:00", updated_at:"1609-07-07T08:36:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "You are the most immediate to our throne,", created_at:"1609-07-07T09:01:43-07:00", updated_at:"1609-07-07T09:01:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And with no less nobility of love", created_at:"1609-07-07T09:22:32-07:00", updated_at:"1609-07-07T09:22:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Than that which dearest father bears his son", created_at:"1609-07-07T09:25:01-07:00", updated_at:"1609-07-07T09:25:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Do I impart toward you. For your intent", created_at:"1609-07-07T09:56:50-07:00", updated_at:"1609-07-07T09:56:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "In going back to school in Wittenberg,", created_at:"1609-07-07T10:04:31-07:00", updated_at:"1609-07-07T10:04:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "It is most retrograde to our desire,", created_at:"1609-07-07T10:25:24-07:00", updated_at:"1609-07-07T10:25:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And we beseech you, bend you to remain", created_at:"1609-07-07T10:40:08-07:00", updated_at:"1609-07-07T10:40:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Here in the cheer and comfort of our eye,", created_at:"1609-07-07T11:09:59-07:00", updated_at:"1609-07-07T11:09:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Our chiefest courtier, cousin, and our son.", created_at:"1609-07-07T11:27:09-07:00", updated_at:"1609-07-07T11:27:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Let not thy mother lose her prayers, Hamlet.", created_at:"1609-07-07T12:04:20-07:00", updated_at:"1609-07-07T12:04:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "I pray thee, stay with us. Go not to Wittenberg.", created_at:"1609-07-07T12:07:12-07:00", updated_at:"1609-07-07T12:07:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "I shall in all my best obey you, madam.", created_at:"1609-07-07T12:22:09-07:00", updated_at:"1609-07-07T12:22:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Why, ’tis a loving and a fair reply.", created_at:"1609-07-07T12:32:48-07:00", updated_at:"1609-07-07T12:32:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Be as ourself in Denmark.—Madam, come.", created_at:"1609-07-07T12:54:55-07:00", updated_at:"1609-07-07T12:54:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "This gentle and unforced accord of Hamlet", created_at:"1609-07-07T13:22:46-07:00", updated_at:"1609-07-07T13:22:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Sits smiling to my heart, in grace whereof", created_at:"1609-07-07T13:47:04-07:00", updated_at:"1609-07-07T13:47:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "No jocund health that Denmark drinks today", created_at:"1609-07-07T13:55:03-07:00", updated_at:"1609-07-07T13:55:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "But the great cannon to the clouds shall tell,", created_at:"1609-07-07T14:33:26-07:00", updated_at:"1609-07-07T14:33:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "And the King’s rouse the heaven shall bruit again,", created_at:"1609-07-07T14:46:48-07:00", updated_at:"1609-07-07T14:46:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_5.id, body: "Respeaking earthly thunder. Come away.", created_at:"1609-07-07T15:21:40-07:00", updated_at:"1609-07-07T15:21:40-07:00"})
