DirectMessageParticipant.create!({direct_message_id: direct_message_6.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "O, that this too, too sullied flesh would melt,", created_at:"1609-07-07T15:38:02-07:00", updated_at:"1609-07-07T15:38:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Thaw, and resolve itself into a dew,", created_at:"1609-07-07T16:17:05-07:00", updated_at:"1609-07-07T16:17:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Or that the Everlasting had not fixed", created_at:"1609-07-07T16:17:36-07:00", updated_at:"1609-07-07T16:17:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "His canon ’gainst self-slaughter! O God, God,", created_at:"1609-07-07T16:37:59-07:00", updated_at:"1609-07-07T16:37:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "How weary, stale, flat, and unprofitable", created_at:"1609-07-07T17:03:12-07:00", updated_at:"1609-07-07T17:03:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Seem to me all the uses of this world!", created_at:"1609-07-07T17:05:42-07:00", updated_at:"1609-07-07T17:05:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Fie on ’t, ah fie! ’Tis an unweeded garden", created_at:"1609-07-07T17:11:00-07:00", updated_at:"1609-07-07T17:11:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That grows to seed. Things rank and gross in nature", created_at:"1609-07-07T17:50:05-07:00", updated_at:"1609-07-07T17:50:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Possess it merely. That it should come to this:", created_at:"1609-07-07T18:18:51-07:00", updated_at:"1609-07-07T18:18:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "But two months dead—nay, not so much, not two.", created_at:"1609-07-07T18:46:50-07:00", updated_at:"1609-07-07T18:46:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "So excellent a king, that was to this", created_at:"1609-07-07T18:48:54-07:00", updated_at:"1609-07-07T18:48:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Hyperion to a satyr; so loving to my mother", created_at:"1609-07-07T19:11:27-07:00", updated_at:"1609-07-07T19:11:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That he might not beteem the winds of heaven", created_at:"1609-07-07T19:27:38-07:00", updated_at:"1609-07-07T19:27:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Visit her face too roughly. Heaven and Earth,", created_at:"1609-07-07T20:01:57-07:00", updated_at:"1609-07-07T20:01:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Must I remember? Why, she would hang on him", created_at:"1609-07-07T20:06:37-07:00", updated_at:"1609-07-07T20:06:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "As if increase of appetite had grown", created_at:"1609-07-07T20:32:29-07:00", updated_at:"1609-07-07T20:32:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "By what it fed on. And yet, within a month", created_at:"1609-07-07T20:47:54-07:00", updated_at:"1609-07-07T20:47:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "(Let me not think on ’t; frailty, thy name is woman!),", created_at:"1609-07-07T20:50:23-07:00", updated_at:"1609-07-07T20:50:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "A little month, or ere those shoes were old", created_at:"1609-07-07T20:56:02-07:00", updated_at:"1609-07-07T20:56:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "With which she followed my poor father’s body,", created_at:"1609-07-07T21:25:58-07:00", updated_at:"1609-07-07T21:25:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Like Niobe, all tears—why she, even she", created_at:"1609-07-07T21:53:48-07:00", updated_at:"1609-07-07T21:53:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "(O God, a beast that wants discourse of reason", created_at:"1609-07-07T22:32:05-07:00", updated_at:"1609-07-07T22:32:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Would have mourned longer!), married with my", created_at:"1609-07-07T22:35:00-07:00", updated_at:"1609-07-07T22:35:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "uncle,", created_at:"1609-07-07T23:07:54-07:00", updated_at:"1609-07-07T23:07:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "My father’s brother, but no more like my father", created_at:"1609-07-07T23:09:29-07:00", updated_at:"1609-07-07T23:09:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Than I to Hercules. Within a month,", created_at:"1609-07-07T23:13:16-07:00", updated_at:"1609-07-07T23:13:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Ere yet the salt of most unrighteous tears", created_at:"1609-07-07T23:26:53-07:00", updated_at:"1609-07-07T23:26:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Had left the flushing in her gallèd eyes,", created_at:"1609-07-07T23:32:27-07:00", updated_at:"1609-07-07T23:32:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "She married. O, most wicked speed, to post", created_at:"1609-07-07T23:47:55-07:00", updated_at:"1609-07-07T23:47:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "With such dexterity to incestuous sheets!", created_at:"1609-07-07T23:48:08-07:00", updated_at:"1609-07-07T23:48:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "It is not, nor it cannot come to good.", created_at:"1609-07-08T00:07:44-07:00", updated_at:"1609-07-08T00:07:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "But break, my heart, for I must hold my tongue.", created_at:"1609-07-08T00:10:46-07:00", updated_at:"1609-07-08T00:10:46-07:00"})
