DirectMessageParticipant.create!({direct_message_id: direct_message_7.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Marcellus@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_7.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Hail to your Lordship.", created_at:"1609-07-08T00:21:30-07:00", updated_at:"1609-07-08T00:21:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I am glad to see you well.", created_at:"1609-07-08T00:45:44-07:00", updated_at:"1609-07-08T00:45:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Horatio—or I do forget myself!", created_at:"1609-07-08T00:54:05-07:00", updated_at:"1609-07-08T00:54:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "The same, my lord, and your poor servant ever.", created_at:"1609-07-08T00:56:19-07:00", updated_at:"1609-07-08T00:56:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Sir, my good friend. I’ll change that name with you.", created_at:"1609-07-08T01:30:16-07:00", updated_at:"1609-07-08T01:30:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And what make you from Wittenberg, Horatio?—", created_at:"1609-07-08T01:52:21-07:00", updated_at:"1609-07-08T01:52:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Marcellus?", created_at:"1609-07-08T02:25:29-07:00", updated_at:"1609-07-08T02:25:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My good lord.", created_at:"1609-07-08T02:55:40-07:00", updated_at:"1609-07-08T02:55:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I am very glad to see you. Good", created_at:"1609-07-08T03:11:53-07:00", updated_at:"1609-07-08T03:11:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "even, sir.—", created_at:"1609-07-08T03:34:18-07:00", updated_at:"1609-07-08T03:34:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "But what, in faith, make you from Wittenberg?", created_at:"1609-07-08T03:54:08-07:00", updated_at:"1609-07-08T03:54:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "A truant disposition, good my lord.", created_at:"1609-07-08T04:15:32-07:00", updated_at:"1609-07-08T04:15:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I would not hear your enemy say so,", created_at:"1609-07-08T04:53:22-07:00", updated_at:"1609-07-08T04:53:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Nor shall you do my ear that violence", created_at:"1609-07-08T04:58:30-07:00", updated_at:"1609-07-08T04:58:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "To make it truster of your own report", created_at:"1609-07-08T05:06:19-07:00", updated_at:"1609-07-08T05:06:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Against yourself. I know you are no truant.", created_at:"1609-07-08T05:39:09-07:00", updated_at:"1609-07-08T05:39:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "But what is your affair in Elsinore?", created_at:"1609-07-08T05:57:07-07:00", updated_at:"1609-07-08T05:57:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "We’ll teach you to drink deep ere you depart.", created_at:"1609-07-08T06:20:40-07:00", updated_at:"1609-07-08T06:20:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My lord, I came to see your father’s funeral.", created_at:"1609-07-08T06:44:48-07:00", updated_at:"1609-07-08T06:44:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I prithee, do not mock me, fellow student.", created_at:"1609-07-08T07:04:44-07:00", updated_at:"1609-07-08T07:04:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I think it was to see my mother’s wedding.", created_at:"1609-07-08T07:39:13-07:00", updated_at:"1609-07-08T07:39:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Indeed, my lord, it followed hard upon.", created_at:"1609-07-08T07:49:03-07:00", updated_at:"1609-07-08T07:49:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Thrift, thrift, Horatio. The funeral baked meats", created_at:"1609-07-08T08:17:53-07:00", updated_at:"1609-07-08T08:17:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Did coldly furnish forth the marriage tables.", created_at:"1609-07-08T08:23:24-07:00", updated_at:"1609-07-08T08:23:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Would I had met my dearest foe in heaven", created_at:"1609-07-08T08:40:43-07:00", updated_at:"1609-07-08T08:40:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Or ever I had seen that day, Horatio!", created_at:"1609-07-08T08:53:04-07:00", updated_at:"1609-07-08T08:53:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My father—methinks I see my father.", created_at:"1609-07-08T08:59:26-07:00", updated_at:"1609-07-08T08:59:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Where, my lord?", created_at:"1609-07-08T09:21:24-07:00", updated_at:"1609-07-08T09:21:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "In my mind’s eye, Horatio.", created_at:"1609-07-08T09:54:15-07:00", updated_at:"1609-07-08T09:54:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I saw him once. He was a goodly king.", created_at:"1609-07-08T10:31:42-07:00", updated_at:"1609-07-08T10:31:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "He was a man. Take him for all in all,", created_at:"1609-07-08T10:39:25-07:00", updated_at:"1609-07-08T10:39:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I shall not look upon his like again.", created_at:"1609-07-08T11:13:51-07:00", updated_at:"1609-07-08T11:13:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My lord, I think I saw him yesternight.", created_at:"1609-07-08T11:17:29-07:00", updated_at:"1609-07-08T11:17:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Saw who?", created_at:"1609-07-08T11:23:08-07:00", updated_at:"1609-07-08T11:23:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My lord, the King your father.", created_at:"1609-07-08T11:55:39-07:00", updated_at:"1609-07-08T11:55:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "The King my father?", created_at:"1609-07-08T12:20:44-07:00", updated_at:"1609-07-08T12:20:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Season your admiration for a while", created_at:"1609-07-08T12:55:12-07:00", updated_at:"1609-07-08T12:55:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "With an attent ear, till I may deliver", created_at:"1609-07-08T12:55:28-07:00", updated_at:"1609-07-08T12:55:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Upon the witness of these gentlemen", created_at:"1609-07-08T13:35:05-07:00", updated_at:"1609-07-08T13:35:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "This marvel to you.", created_at:"1609-07-08T13:41:09-07:00", updated_at:"1609-07-08T13:41:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "For God’s love, let me hear!", created_at:"1609-07-08T13:48:03-07:00", updated_at:"1609-07-08T13:48:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Two nights together had these gentlemen,", created_at:"1609-07-08T14:02:56-07:00", updated_at:"1609-07-08T14:02:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Marcellus and Barnardo, on their watch,", created_at:"1609-07-08T14:27:26-07:00", updated_at:"1609-07-08T14:27:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "In the dead waste and middle of the night,", created_at:"1609-07-08T14:50:37-07:00", updated_at:"1609-07-08T14:50:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Been thus encountered: a figure like your father,", created_at:"1609-07-08T15:17:48-07:00", updated_at:"1609-07-08T15:17:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Armed at point exactly, cap-à-pie,", created_at:"1609-07-08T15:38:09-07:00", updated_at:"1609-07-08T15:38:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Appears before them and with solemn march", created_at:"1609-07-08T16:08:38-07:00", updated_at:"1609-07-08T16:08:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Goes slow and stately by them. Thrice he walked", created_at:"1609-07-08T16:24:18-07:00", updated_at:"1609-07-08T16:24:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "By their oppressed and fear-surprisèd eyes", created_at:"1609-07-08T16:58:18-07:00", updated_at:"1609-07-08T16:58:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Within his truncheon’s length, whilst they, distilled", created_at:"1609-07-08T17:21:09-07:00", updated_at:"1609-07-08T17:21:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Almost to jelly with the act of fear,", created_at:"1609-07-08T17:34:32-07:00", updated_at:"1609-07-08T17:34:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Stand dumb and speak not to him. This to me", created_at:"1609-07-08T17:44:19-07:00", updated_at:"1609-07-08T17:44:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "In dreadful secrecy impart they did,", created_at:"1609-07-08T18:23:24-07:00", updated_at:"1609-07-08T18:23:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And I with them the third night kept the watch,", created_at:"1609-07-08T18:36:03-07:00", updated_at:"1609-07-08T18:36:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Where, as they had delivered, both in time,", created_at:"1609-07-08T19:09:21-07:00", updated_at:"1609-07-08T19:09:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Form of the thing (each word made true and good),", created_at:"1609-07-08T19:46:34-07:00", updated_at:"1609-07-08T19:46:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "The apparition comes. I knew your father;", created_at:"1609-07-08T19:57:32-07:00", updated_at:"1609-07-08T19:57:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "These hands are not more like.", created_at:"1609-07-08T20:08:26-07:00", updated_at:"1609-07-08T20:08:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "But where was this?", created_at:"1609-07-08T20:19:28-07:00", updated_at:"1609-07-08T20:19:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My lord, upon the platform where we watch.", created_at:"1609-07-08T20:52:27-07:00", updated_at:"1609-07-08T20:52:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Did you not speak to it?", created_at:"1609-07-08T21:21:15-07:00", updated_at:"1609-07-08T21:21:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My lord, I did,", created_at:"1609-07-08T21:47:09-07:00", updated_at:"1609-07-08T21:47:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "But answer made it none. Yet once methought", created_at:"1609-07-08T22:15:25-07:00", updated_at:"1609-07-08T22:15:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "It lifted up its head and did address", created_at:"1609-07-08T22:28:46-07:00", updated_at:"1609-07-08T22:28:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Itself to motion, like as it would speak;", created_at:"1609-07-08T22:44:24-07:00", updated_at:"1609-07-08T22:44:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "But even then the morning cock crew loud,", created_at:"1609-07-08T23:24:07-07:00", updated_at:"1609-07-08T23:24:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And at the sound it shrunk in haste away", created_at:"1609-07-08T23:42:35-07:00", updated_at:"1609-07-08T23:42:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And vanished from our sight.", created_at:"1609-07-08T23:48:06-07:00", updated_at:"1609-07-08T23:48:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "’Tis very strange.", created_at:"1609-07-09T00:22:28-07:00", updated_at:"1609-07-09T00:22:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "As I do live, my honored lord, ’tis true.", created_at:"1609-07-09T00:47:21-07:00", updated_at:"1609-07-09T00:47:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And we did think it writ down in our duty", created_at:"1609-07-09T01:24:21-07:00", updated_at:"1609-07-09T01:24:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "To let you know of it.", created_at:"1609-07-09T01:53:33-07:00", updated_at:"1609-07-09T01:53:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Indeed, sirs, but this troubles me.", created_at:"1609-07-09T02:28:38-07:00", updated_at:"1609-07-09T02:28:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Hold you the watch tonight?", created_at:"1609-07-09T02:51:54-07:00", updated_at:"1609-07-09T02:51:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "We do, my lord.", created_at:"1609-07-09T03:02:52-07:00", updated_at:"1609-07-09T03:02:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Armed, say you?", created_at:"1609-07-09T03:12:54-07:00", updated_at:"1609-07-09T03:12:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Armed, my lord.", created_at:"1609-07-09T03:32:13-07:00", updated_at:"1609-07-09T03:32:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "From top to toe?", created_at:"1609-07-09T03:59:27-07:00", updated_at:"1609-07-09T03:59:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "My lord, from head to foot.", created_at:"1609-07-09T04:23:40-07:00", updated_at:"1609-07-09T04:23:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Then saw you not his face?", created_at:"1609-07-09T04:25:36-07:00", updated_at:"1609-07-09T04:25:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "O, yes, my lord, he wore his beaver up.", created_at:"1609-07-09T04:31:03-07:00", updated_at:"1609-07-09T04:31:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "What, looked he frowningly?", created_at:"1609-07-09T04:47:38-07:00", updated_at:"1609-07-09T04:47:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "A countenance more in sorrow than in anger.", created_at:"1609-07-09T04:55:28-07:00", updated_at:"1609-07-09T04:55:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Pale or red?", created_at:"1609-07-09T05:10:15-07:00", updated_at:"1609-07-09T05:10:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Nay, very pale.", created_at:"1609-07-09T05:39:12-07:00", updated_at:"1609-07-09T05:39:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And fixed his eyes upon you?", created_at:"1609-07-09T05:52:12-07:00", updated_at:"1609-07-09T05:52:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Most constantly.", created_at:"1609-07-09T06:26:37-07:00", updated_at:"1609-07-09T06:26:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I would I had been there.", created_at:"1609-07-09T06:52:23-07:00", updated_at:"1609-07-09T06:52:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "It would have much amazed you.", created_at:"1609-07-09T07:00:50-07:00", updated_at:"1609-07-09T07:00:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Very like. Stayed it long?", created_at:"1609-07-09T07:29:31-07:00", updated_at:"1609-07-09T07:29:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "While one with moderate haste might tell a", created_at:"1609-07-09T08:04:49-07:00", updated_at:"1609-07-09T08:04:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "hundred.", created_at:"1609-07-09T08:44:32-07:00", updated_at:"1609-07-09T08:44:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Barnardo"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Longer, longer.", created_at:"1609-07-09T08:59:20-07:00", updated_at:"1609-07-09T08:59:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Not when I saw ’t.", created_at:"1609-07-09T09:09:28-07:00", updated_at:"1609-07-09T09:09:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "His beard was grizzled, no?", created_at:"1609-07-09T09:30:14-07:00", updated_at:"1609-07-09T09:30:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "It was as I have seen it in his life,", created_at:"1609-07-09T10:07:27-07:00", updated_at:"1609-07-09T10:07:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "A sable silvered.", created_at:"1609-07-09T10:33:52-07:00", updated_at:"1609-07-09T10:33:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I will watch tonight.", created_at:"1609-07-09T11:01:33-07:00", updated_at:"1609-07-09T11:01:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Perchance ’twill walk again.", created_at:"1609-07-09T11:35:29-07:00", updated_at:"1609-07-09T11:35:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I warrant it will.", created_at:"1609-07-09T11:58:28-07:00", updated_at:"1609-07-09T11:58:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "If it assume my noble father’s person,", created_at:"1609-07-09T12:15:36-07:00", updated_at:"1609-07-09T12:15:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I’ll speak to it, though hell itself should gape", created_at:"1609-07-09T12:41:56-07:00", updated_at:"1609-07-09T12:41:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And bid me hold my peace. I pray you all,", created_at:"1609-07-09T13:09:51-07:00", updated_at:"1609-07-09T13:09:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "If you have hitherto concealed this sight,", created_at:"1609-07-09T13:39:11-07:00", updated_at:"1609-07-09T13:39:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Let it be tenable in your silence still;", created_at:"1609-07-09T13:55:19-07:00", updated_at:"1609-07-09T13:55:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "And whatsomever else shall hap tonight,", created_at:"1609-07-09T14:09:53-07:00", updated_at:"1609-07-09T14:09:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Give it an understanding but no tongue.", created_at:"1609-07-09T14:39:38-07:00", updated_at:"1609-07-09T14:39:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I will requite your loves. So fare you well.", created_at:"1609-07-09T14:52:41-07:00", updated_at:"1609-07-09T14:52:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Upon the platform, ’twixt eleven and twelve,", created_at:"1609-07-09T15:30:22-07:00", updated_at:"1609-07-09T15:30:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "I’ll visit you.", created_at:"1609-07-09T16:08:52-07:00", updated_at:"1609-07-09T16:08:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Our duty to your Honor.", created_at:"1609-07-09T16:34:57-07:00", updated_at:"1609-07-09T16:34:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_7.id, body: "Your loves, as mine to you. Farewell.", created_at:"1609-07-09T16:54:44-07:00", updated_at:"1609-07-09T16:54:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "My father’s spirit—in arms! All is not well.", created_at:"1609-07-09T17:00:35-07:00", updated_at:"1609-07-09T17:00:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "I doubt some foul play. Would the night were come!", created_at:"1609-07-09T17:17:47-07:00", updated_at:"1609-07-09T17:17:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Till then, sit still, my soul. Foul deeds will rise,", created_at:"1609-07-09T17:23:54-07:00", updated_at:"1609-07-09T17:23:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Though all the earth o’erwhelm them, to men’s", created_at:"1609-07-09T18:02:00-07:00", updated_at:"1609-07-09T18:02:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "eyes.", created_at:"1609-07-09T18:18:15-07:00", updated_at:"1609-07-09T18:18:15-07:00"})
