DirectMessageParticipant.create!({direct_message_id: direct_message_8.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "My necessaries are embarked. Farewell.", created_at:"1609-07-09T18:48:04-07:00", updated_at:"1609-07-09T18:48:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And, sister, as the winds give benefit", created_at:"1609-07-09T19:24:16-07:00", updated_at:"1609-07-09T19:24:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And convey is assistant, do not sleep,", created_at:"1609-07-09T19:27:53-07:00", updated_at:"1609-07-09T19:27:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "But let me hear from you.", created_at:"1609-07-09T19:42:15-07:00", updated_at:"1609-07-09T19:42:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Do you doubt that?", created_at:"1609-07-09T20:17:11-07:00", updated_at:"1609-07-09T20:17:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "For Hamlet, and the trifling of his favor,", created_at:"1609-07-09T20:44:51-07:00", updated_at:"1609-07-09T20:44:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Hold it a fashion and a toy in blood,", created_at:"1609-07-09T21:19:08-07:00", updated_at:"1609-07-09T21:19:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "A violet in the youth of primy nature,", created_at:"1609-07-09T21:55:33-07:00", updated_at:"1609-07-09T21:55:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Forward, not permanent, sweet, not lasting,", created_at:"1609-07-09T22:27:17-07:00", updated_at:"1609-07-09T22:27:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "The perfume and suppliance of a minute,", created_at:"1609-07-09T23:04:08-07:00", updated_at:"1609-07-09T23:04:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "No more.", created_at:"1609-07-09T23:22:48-07:00", updated_at:"1609-07-09T23:22:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "No more but so?", created_at:"1609-07-09T23:47:07-07:00", updated_at:"1609-07-09T23:47:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Think it no more.", created_at:"1609-07-10T00:12:36-07:00", updated_at:"1609-07-10T00:12:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "For nature, crescent, does not grow alone", created_at:"1609-07-10T00:34:29-07:00", updated_at:"1609-07-10T00:34:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "In thews and bulk, but, as this temple waxes,", created_at:"1609-07-10T01:01:09-07:00", updated_at:"1609-07-10T01:01:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "The inward service of the mind and soul", created_at:"1609-07-10T01:08:52-07:00", updated_at:"1609-07-10T01:08:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Grows wide withal. Perhaps he loves you now,", created_at:"1609-07-10T01:45:13-07:00", updated_at:"1609-07-10T01:45:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And now no soil nor cautel doth besmirch", created_at:"1609-07-10T01:59:48-07:00", updated_at:"1609-07-10T01:59:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "The virtue of his will; but you must fear,", created_at:"1609-07-10T02:33:48-07:00", updated_at:"1609-07-10T02:33:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "His greatness weighed, his will is not his own,", created_at:"1609-07-10T02:57:27-07:00", updated_at:"1609-07-10T02:57:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "For he himself is subject to his birth.", created_at:"1609-07-10T03:17:53-07:00", updated_at:"1609-07-10T03:17:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "He may not, as unvalued persons do,", created_at:"1609-07-10T03:34:05-07:00", updated_at:"1609-07-10T03:34:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Carve for himself, for on his choice depends", created_at:"1609-07-10T03:45:12-07:00", updated_at:"1609-07-10T03:45:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "The safety and the health of this whole state.", created_at:"1609-07-10T03:49:01-07:00", updated_at:"1609-07-10T03:49:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And therefore must his choice be circumscribed", created_at:"1609-07-10T04:15:22-07:00", updated_at:"1609-07-10T04:15:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Unto the voice and yielding of that body", created_at:"1609-07-10T04:46:08-07:00", updated_at:"1609-07-10T04:46:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Whereof he is the head. Then, if he says he loves", created_at:"1609-07-10T05:09:08-07:00", updated_at:"1609-07-10T05:09:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "you,", created_at:"1609-07-10T05:17:46-07:00", updated_at:"1609-07-10T05:17:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "It fits your wisdom so far to believe it", created_at:"1609-07-10T05:57:46-07:00", updated_at:"1609-07-10T05:57:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "As he in his particular act and place", created_at:"1609-07-10T06:37:43-07:00", updated_at:"1609-07-10T06:37:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "May give his saying deed, which is no further", created_at:"1609-07-10T06:59:45-07:00", updated_at:"1609-07-10T06:59:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Than the main voice of Denmark goes withal.", created_at:"1609-07-10T07:28:55-07:00", updated_at:"1609-07-10T07:28:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Then weigh what loss your honor may sustain", created_at:"1609-07-10T08:00:28-07:00", updated_at:"1609-07-10T08:00:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "If with too credent ear you list his songs", created_at:"1609-07-10T08:33:59-07:00", updated_at:"1609-07-10T08:33:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Or lose your heart or your chaste treasure open", created_at:"1609-07-10T08:48:42-07:00", updated_at:"1609-07-10T08:48:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "To his unmastered importunity.", created_at:"1609-07-10T09:05:13-07:00", updated_at:"1609-07-10T09:05:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Fear it, Ophelia; fear it, my dear sister,", created_at:"1609-07-10T09:08:21-07:00", updated_at:"1609-07-10T09:08:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And keep you in the rear of your affection,", created_at:"1609-07-10T09:09:37-07:00", updated_at:"1609-07-10T09:09:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Out of the shot and danger of desire.", created_at:"1609-07-10T09:37:48-07:00", updated_at:"1609-07-10T09:37:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "The chariest maid is prodigal enough", created_at:"1609-07-10T10:04:57-07:00", updated_at:"1609-07-10T10:04:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "If she unmask her beauty to the moon.", created_at:"1609-07-10T10:27:16-07:00", updated_at:"1609-07-10T10:27:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Virtue itself ’scapes not calumnious strokes.", created_at:"1609-07-10T10:59:50-07:00", updated_at:"1609-07-10T10:59:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "The canker galls the infants of the spring", created_at:"1609-07-10T11:09:53-07:00", updated_at:"1609-07-10T11:09:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Too oft before their buttons be disclosed,", created_at:"1609-07-10T11:28:09-07:00", updated_at:"1609-07-10T11:28:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And, in the morn and liquid dew of youth,", created_at:"1609-07-10T11:47:27-07:00", updated_at:"1609-07-10T11:47:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Contagious blastments are most imminent.", created_at:"1609-07-10T11:55:42-07:00", updated_at:"1609-07-10T11:55:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Be wary, then; best safety lies in fear.", created_at:"1609-07-10T11:56:52-07:00", updated_at:"1609-07-10T11:56:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Youth to itself rebels, though none else near.", created_at:"1609-07-10T12:11:06-07:00", updated_at:"1609-07-10T12:11:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "I shall the effect of this good lesson keep", created_at:"1609-07-10T12:39:46-07:00", updated_at:"1609-07-10T12:39:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "As watchman to my heart. But, good my brother,", created_at:"1609-07-10T13:07:36-07:00", updated_at:"1609-07-10T13:07:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Do not, as some ungracious pastors do,", created_at:"1609-07-10T13:09:21-07:00", updated_at:"1609-07-10T13:09:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Show me the steep and thorny way to heaven,", created_at:"1609-07-10T13:11:08-07:00", updated_at:"1609-07-10T13:11:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Whiles, like a puffed and reckless libertine,", created_at:"1609-07-10T13:28:52-07:00", updated_at:"1609-07-10T13:28:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "Himself the primrose path of dalliance treads", created_at:"1609-07-10T13:47:34-07:00", updated_at:"1609-07-10T13:47:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "And recks not his own rede.", created_at:"1609-07-10T14:11:35-07:00", updated_at:"1609-07-10T14:11:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_8.id, body: "O, fear me not.", created_at:"1609-07-10T14:22:09-07:00", updated_at:"1609-07-10T14:22:09-07:00"})
