DirectMessageParticipant.create!({direct_message_id: direct_message_9.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Polonius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_9.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "I stay too long. But here my father comes.", created_at:"1609-07-10T14:27:34-07:00", updated_at:"1609-07-10T14:27:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "A double blessing is a double grace.", created_at:"1609-07-10T14:47:15-07:00", updated_at:"1609-07-10T14:47:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Occasion smiles upon a second leave.", created_at:"1609-07-10T15:22:31-07:00", updated_at:"1609-07-10T15:22:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Yet here, Laertes? Aboard, aboard, for shame!", created_at:"1609-07-10T15:32:54-07:00", updated_at:"1609-07-10T15:32:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "The wind sits in the shoulder of your sail,", created_at:"1609-07-10T16:02:58-07:00", updated_at:"1609-07-10T16:02:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "And you are stayed for. There, my blessing with", created_at:"1609-07-10T16:20:41-07:00", updated_at:"1609-07-10T16:20:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "thee.", created_at:"1609-07-10T16:37:22-07:00", updated_at:"1609-07-10T16:37:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "And these few precepts in thy memory", created_at:"1609-07-10T16:39:13-07:00", updated_at:"1609-07-10T16:39:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Look thou character. Give thy thoughts no tongue,", created_at:"1609-07-10T16:48:55-07:00", updated_at:"1609-07-10T16:48:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Nor any unproportioned thought his act.", created_at:"1609-07-10T16:59:58-07:00", updated_at:"1609-07-10T16:59:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Be thou familiar, but by no means vulgar.", created_at:"1609-07-10T17:34:28-07:00", updated_at:"1609-07-10T17:34:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Those friends thou hast, and their adoption tried,", created_at:"1609-07-10T17:44:50-07:00", updated_at:"1609-07-10T17:44:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Grapple them unto thy soul with hoops of steel,", created_at:"1609-07-10T18:14:07-07:00", updated_at:"1609-07-10T18:14:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "But do not dull thy palm with entertainment", created_at:"1609-07-10T18:39:53-07:00", updated_at:"1609-07-10T18:39:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Of each new-hatched, unfledged courage. Beware", created_at:"1609-07-10T18:58:52-07:00", updated_at:"1609-07-10T18:58:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Of entrance to a quarrel, but, being in,", created_at:"1609-07-10T19:32:29-07:00", updated_at:"1609-07-10T19:32:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Bear ’t that th’ opposèd may beware of thee.", created_at:"1609-07-10T20:09:07-07:00", updated_at:"1609-07-10T20:09:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Give every man thy ear, but few thy voice.", created_at:"1609-07-10T20:35:30-07:00", updated_at:"1609-07-10T20:35:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Take each man’s censure, but reserve thy judgment.", created_at:"1609-07-10T20:37:43-07:00", updated_at:"1609-07-10T20:37:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Costly thy habit as thy purse can buy,", created_at:"1609-07-10T20:57:56-07:00", updated_at:"1609-07-10T20:57:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "But not expressed in fancy (rich, not gaudy),", created_at:"1609-07-10T21:01:10-07:00", updated_at:"1609-07-10T21:01:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "For the apparel oft proclaims the man,", created_at:"1609-07-10T21:32:03-07:00", updated_at:"1609-07-10T21:32:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "And they in France of the best rank and station", created_at:"1609-07-10T21:35:28-07:00", updated_at:"1609-07-10T21:35:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Are of a most select and generous chief in that.", created_at:"1609-07-10T21:46:57-07:00", updated_at:"1609-07-10T21:46:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Neither a borrower nor a lender be,", created_at:"1609-07-10T21:51:37-07:00", updated_at:"1609-07-10T21:51:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "For loan oft loses both itself and friend,", created_at:"1609-07-10T22:30:29-07:00", updated_at:"1609-07-10T22:30:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "And borrowing dulls the edge of husbandry.", created_at:"1609-07-10T22:59:33-07:00", updated_at:"1609-07-10T22:59:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "This above all: to thine own self be true,", created_at:"1609-07-10T23:37:14-07:00", updated_at:"1609-07-10T23:37:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "And it must follow, as the night the day,", created_at:"1609-07-10T23:48:48-07:00", updated_at:"1609-07-10T23:48:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Thou canst not then be false to any man.", created_at:"1609-07-11T00:21:39-07:00", updated_at:"1609-07-11T00:21:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Farewell. My blessing season this in thee.", created_at:"1609-07-11T00:47:29-07:00", updated_at:"1609-07-11T00:47:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Most humbly do I take my leave, my lord.", created_at:"1609-07-11T01:12:48-07:00", updated_at:"1609-07-11T01:12:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "The time invests you. Go, your servants tend.", created_at:"1609-07-11T01:28:56-07:00", updated_at:"1609-07-11T01:28:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Farewell, Ophelia, and remember well", created_at:"1609-07-11T02:03:20-07:00", updated_at:"1609-07-11T02:03:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "What I have said to you.", created_at:"1609-07-11T02:03:47-07:00", updated_at:"1609-07-11T02:03:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "’Tis in my memory locked,", created_at:"1609-07-11T02:20:18-07:00", updated_at:"1609-07-11T02:20:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "And you yourself shall keep the key of it.", created_at:"1609-07-11T02:27:29-07:00", updated_at:"1609-07-11T02:27:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_9.id, body: "Farewell.", created_at:"1609-07-11T02:54:19-07:00", updated_at:"1609-07-11T02:54:19-07:00"})
direct_message_10 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_10.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Ophelia@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_10.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Polonius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_10.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "What is ’t, Ophelia, he hath said to you?", created_at:"1609-07-11T03:26:00-07:00", updated_at:"1609-07-11T03:26:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "So please you, something touching the Lord", created_at:"1609-07-11T03:29:13-07:00", updated_at:"1609-07-11T03:29:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Hamlet.", created_at:"1609-07-11T03:55:14-07:00", updated_at:"1609-07-11T03:55:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Marry, well bethought.", created_at:"1609-07-11T04:33:14-07:00", updated_at:"1609-07-11T04:33:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "’Tis told me he hath very oft of late", created_at:"1609-07-11T04:51:30-07:00", updated_at:"1609-07-11T04:51:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Given private time to you, and you yourself", created_at:"1609-07-11T04:58:20-07:00", updated_at:"1609-07-11T04:58:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Have of your audience been most free and", created_at:"1609-07-11T05:23:21-07:00", updated_at:"1609-07-11T05:23:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "bounteous.", created_at:"1609-07-11T05:35:50-07:00", updated_at:"1609-07-11T05:35:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "If it be so (as so ’tis put on me,", created_at:"1609-07-11T06:02:24-07:00", updated_at:"1609-07-11T06:02:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And that in way of caution), I must tell you", created_at:"1609-07-11T06:31:04-07:00", updated_at:"1609-07-11T06:31:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "You do not understand yourself so clearly", created_at:"1609-07-11T06:38:32-07:00", updated_at:"1609-07-11T06:38:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As it behooves my daughter and your honor.", created_at:"1609-07-11T07:03:23-07:00", updated_at:"1609-07-11T07:03:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "What is between you? Give me up the truth.", created_at:"1609-07-11T07:32:16-07:00", updated_at:"1609-07-11T07:32:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "He hath, my lord, of late made many tenders", created_at:"1609-07-11T07:40:41-07:00", updated_at:"1609-07-11T07:40:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Of his affection to me.", created_at:"1609-07-11T07:52:51-07:00", updated_at:"1609-07-11T07:52:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Affection, puh! You speak like a green girl", created_at:"1609-07-11T08:13:53-07:00", updated_at:"1609-07-11T08:13:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Unsifted in such perilous circumstance.", created_at:"1609-07-11T08:39:58-07:00", updated_at:"1609-07-11T08:39:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Do you believe his tenders, as you call them?", created_at:"1609-07-11T09:11:54-07:00", updated_at:"1609-07-11T09:11:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "I do not know, my lord, what I should think.", created_at:"1609-07-11T09:16:53-07:00", updated_at:"1609-07-11T09:16:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Marry, I will teach you. Think yourself a baby", created_at:"1609-07-11T09:55:47-07:00", updated_at:"1609-07-11T09:55:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "That you have ta’en these tenders for true pay,", created_at:"1609-07-11T10:22:55-07:00", updated_at:"1609-07-11T10:22:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Which are not sterling. Tender yourself more dearly,", created_at:"1609-07-11T10:45:10-07:00", updated_at:"1609-07-11T10:45:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Or (not to crack the wind of the poor phrase,", created_at:"1609-07-11T11:05:17-07:00", updated_at:"1609-07-11T11:05:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Running it thus) you’ll tender me a fool.", created_at:"1609-07-11T11:14:12-07:00", updated_at:"1609-07-11T11:14:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "My lord, he hath importuned me with love", created_at:"1609-07-11T11:43:55-07:00", updated_at:"1609-07-11T11:43:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "In honorable fashion—", created_at:"1609-07-11T11:56:56-07:00", updated_at:"1609-07-11T11:56:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Ay, fashion you may call it. Go to, go to!", created_at:"1609-07-11T12:11:53-07:00", updated_at:"1609-07-11T12:11:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And hath given countenance to his speech, my lord,", created_at:"1609-07-11T12:14:02-07:00", updated_at:"1609-07-11T12:14:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "With almost all the holy vows of heaven.", created_at:"1609-07-11T12:43:05-07:00", updated_at:"1609-07-11T12:43:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Ay, springes to catch woodcocks. I do know,", created_at:"1609-07-11T13:18:23-07:00", updated_at:"1609-07-11T13:18:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "When the blood burns, how prodigal the soul", created_at:"1609-07-11T13:43:06-07:00", updated_at:"1609-07-11T13:43:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Lends the tongue vows. These blazes, daughter,", created_at:"1609-07-11T14:08:21-07:00", updated_at:"1609-07-11T14:08:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Giving more light than heat, extinct in both", created_at:"1609-07-11T14:30:19-07:00", updated_at:"1609-07-11T14:30:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Even in their promise as it is a-making,", created_at:"1609-07-11T15:06:12-07:00", updated_at:"1609-07-11T15:06:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "You must not take for fire. From this time", created_at:"1609-07-11T15:27:45-07:00", updated_at:"1609-07-11T15:27:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Be something scanter of your maiden presence.", created_at:"1609-07-11T15:32:05-07:00", updated_at:"1609-07-11T15:32:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Set your entreatments at a higher rate", created_at:"1609-07-11T15:57:21-07:00", updated_at:"1609-07-11T15:57:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Than a command to parle. For Lord Hamlet,", created_at:"1609-07-11T16:11:58-07:00", updated_at:"1609-07-11T16:11:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Believe so much in him that he is young,", created_at:"1609-07-11T16:48:27-07:00", updated_at:"1609-07-11T16:48:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And with a larger tether may he walk", created_at:"1609-07-11T17:13:59-07:00", updated_at:"1609-07-11T17:13:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Than may be given you. In few, Ophelia,", created_at:"1609-07-11T17:53:08-07:00", updated_at:"1609-07-11T17:53:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Do not believe his vows, for they are brokers,", created_at:"1609-07-11T18:22:49-07:00", updated_at:"1609-07-11T18:22:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Not of that dye which their investments show,", created_at:"1609-07-11T18:50:50-07:00", updated_at:"1609-07-11T18:50:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "But mere implorators of unholy suits,", created_at:"1609-07-11T19:01:09-07:00", updated_at:"1609-07-11T19:01:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Breathing like sanctified and pious bawds", created_at:"1609-07-11T19:20:39-07:00", updated_at:"1609-07-11T19:20:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "The better to beguile. This is for all:", created_at:"1609-07-11T20:00:22-07:00", updated_at:"1609-07-11T20:00:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "I would not, in plain terms, from this time forth", created_at:"1609-07-11T20:01:43-07:00", updated_at:"1609-07-11T20:01:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Have you so slander any moment leisure", created_at:"1609-07-11T20:06:24-07:00", updated_at:"1609-07-11T20:06:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As to give words or talk with the Lord Hamlet.", created_at:"1609-07-11T20:12:47-07:00", updated_at:"1609-07-11T20:12:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Look to ’t, I charge you. Come your ways.", created_at:"1609-07-11T20:21:09-07:00", updated_at:"1609-07-11T20:21:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "I shall obey, my lord.", created_at:"1609-07-11T20:24:51-07:00", updated_at:"1609-07-11T20:24:51-07:00"})
