DirectMessageParticipant.create!({direct_message_id: direct_message_11.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Horatio@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_11.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Marcellus@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_11.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The air bites shrewdly; it is very cold.", created_at:"1609-07-11T20:33:12-07:00", updated_at:"1609-07-11T20:33:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "It is a nipping and an eager air.", created_at:"1609-07-11T20:35:58-07:00", updated_at:"1609-07-11T20:35:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "What hour now?", created_at:"1609-07-11T20:53:27-07:00", updated_at:"1609-07-11T20:53:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "I think it lacks of twelve.", created_at:"1609-07-11T21:27:26-07:00", updated_at:"1609-07-11T21:27:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "No, it is struck.", created_at:"1609-07-11T21:47:38-07:00", updated_at:"1609-07-11T21:47:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Indeed, I heard it not. It then draws near the season", created_at:"1609-07-11T22:11:51-07:00", updated_at:"1609-07-11T22:11:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Wherein the spirit held his wont to walk.", created_at:"1609-07-11T22:18:53-07:00", updated_at:"1609-07-11T22:18:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "What does this mean, my lord?", created_at:"1609-07-11T22:53:33-07:00", updated_at:"1609-07-11T22:53:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The King doth wake tonight and takes his rouse,", created_at:"1609-07-11T23:19:13-07:00", updated_at:"1609-07-11T23:19:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Keeps wassail, and the swagg’ring upspring reels;", created_at:"1609-07-11T23:20:57-07:00", updated_at:"1609-07-11T23:20:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And, as he drains his draughts of Rhenish down,", created_at:"1609-07-11T23:26:54-07:00", updated_at:"1609-07-11T23:26:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The kettledrum and trumpet thus bray out", created_at:"1609-07-11T23:32:42-07:00", updated_at:"1609-07-11T23:32:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The triumph of his pledge.", created_at:"1609-07-12T00:10:55-07:00", updated_at:"1609-07-12T00:10:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Is it a custom?", created_at:"1609-07-12T00:33:34-07:00", updated_at:"1609-07-12T00:33:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Ay, marry, is ’t,", created_at:"1609-07-12T00:36:57-07:00", updated_at:"1609-07-12T00:36:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "But, to my mind, though I am native here", created_at:"1609-07-12T01:08:31-07:00", updated_at:"1609-07-12T01:08:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And to the manner born, it is a custom", created_at:"1609-07-12T01:17:48-07:00", updated_at:"1609-07-12T01:17:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "More honored in the breach than the observance.", created_at:"1609-07-12T01:27:11-07:00", updated_at:"1609-07-12T01:27:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "This heavy-headed revel east and west", created_at:"1609-07-12T02:04:59-07:00", updated_at:"1609-07-12T02:04:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Makes us traduced and taxed of other nations.", created_at:"1609-07-12T02:11:42-07:00", updated_at:"1609-07-12T02:11:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "They clepe us drunkards and with swinish phrase", created_at:"1609-07-12T02:23:34-07:00", updated_at:"1609-07-12T02:23:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Soil our addition. And, indeed, it takes", created_at:"1609-07-12T02:46:35-07:00", updated_at:"1609-07-12T02:46:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "From our achievements, though performed at", created_at:"1609-07-12T03:17:45-07:00", updated_at:"1609-07-12T03:17:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "height,", created_at:"1609-07-12T03:54:51-07:00", updated_at:"1609-07-12T03:54:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The pith and marrow of our attribute.", created_at:"1609-07-12T04:24:06-07:00", updated_at:"1609-07-12T04:24:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "So oft it chances in particular men", created_at:"1609-07-12T04:43:11-07:00", updated_at:"1609-07-12T04:43:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "That for some vicious mole of nature in them,", created_at:"1609-07-12T05:04:59-07:00", updated_at:"1609-07-12T05:04:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "As in their birth (wherein they are not guilty,", created_at:"1609-07-12T05:30:46-07:00", updated_at:"1609-07-12T05:30:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Since nature cannot choose his origin),", created_at:"1609-07-12T05:37:58-07:00", updated_at:"1609-07-12T05:37:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "By the o’ergrowth of some complexion", created_at:"1609-07-12T05:40:16-07:00", updated_at:"1609-07-12T05:40:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "(Oft breaking down the pales and forts of reason),", created_at:"1609-07-12T06:01:26-07:00", updated_at:"1609-07-12T06:01:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Or by some habit that too much o’erleavens", created_at:"1609-07-12T06:31:43-07:00", updated_at:"1609-07-12T06:31:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The form of plausive manners—that these men,", created_at:"1609-07-12T06:44:55-07:00", updated_at:"1609-07-12T06:44:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Carrying, I say, the stamp of one defect,", created_at:"1609-07-12T07:02:30-07:00", updated_at:"1609-07-12T07:02:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Being nature’s livery or fortune’s star,", created_at:"1609-07-12T07:38:57-07:00", updated_at:"1609-07-12T07:38:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "His virtues else, be they as pure as grace,", created_at:"1609-07-12T07:56:02-07:00", updated_at:"1609-07-12T07:56:02-07:00"})
