Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Shall in the general censure take corruption", created_at:"1609-07-12T08:24:13-07:00", updated_at:"1609-07-12T08:24:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "From that particular fault. The dram of evil", created_at:"1609-07-12T08:55:15-07:00", updated_at:"1609-07-12T08:55:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Doth all the noble substance of a doubt", created_at:"1609-07-12T08:57:47-07:00", updated_at:"1609-07-12T08:57:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "To his own scandal.", created_at:"1609-07-12T09:18:17-07:00", updated_at:"1609-07-12T09:18:17-07:00"})
