Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Look, my lord, it comes.", created_at:"1609-07-12T09:50:42-07:00", updated_at:"1609-07-12T09:50:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Angels and ministers of grace, defend us!", created_at:"1609-07-12T09:53:51-07:00", updated_at:"1609-07-12T09:53:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Be thou a spirit of health or goblin damned,", created_at:"1609-07-12T10:15:41-07:00", updated_at:"1609-07-12T10:15:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Bring with thee airs from heaven or blasts from", created_at:"1609-07-12T10:35:32-07:00", updated_at:"1609-07-12T10:35:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "hell,", created_at:"1609-07-12T11:04:46-07:00", updated_at:"1609-07-12T11:04:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Be thy intents wicked or charitable,", created_at:"1609-07-12T11:25:50-07:00", updated_at:"1609-07-12T11:25:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Thou com’st in such a questionable shape", created_at:"1609-07-12T12:02:27-07:00", updated_at:"1609-07-12T12:02:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "That I will speak to thee. I’ll call thee Hamlet,", created_at:"1609-07-12T12:25:32-07:00", updated_at:"1609-07-12T12:25:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "King, Father, Royal Dane. O, answer me!", created_at:"1609-07-12T12:43:45-07:00", updated_at:"1609-07-12T12:43:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Let me not burst in ignorance, but tell", created_at:"1609-07-12T13:17:43-07:00", updated_at:"1609-07-12T13:17:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Why thy canonized bones, hearsèd in death,", created_at:"1609-07-12T13:48:41-07:00", updated_at:"1609-07-12T13:48:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Have burst their cerements; why the sepulcher,", created_at:"1609-07-12T13:49:38-07:00", updated_at:"1609-07-12T13:49:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Wherein we saw thee quietly interred,", created_at:"1609-07-12T14:14:09-07:00", updated_at:"1609-07-12T14:14:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Hath oped his ponderous and marble jaws", created_at:"1609-07-12T14:52:55-07:00", updated_at:"1609-07-12T14:52:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "To cast thee up again. What may this mean", created_at:"1609-07-12T15:19:14-07:00", updated_at:"1609-07-12T15:19:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "That thou, dead corse, again in complete steel,", created_at:"1609-07-12T15:21:33-07:00", updated_at:"1609-07-12T15:21:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Revisits thus the glimpses of the moon,", created_at:"1609-07-12T15:58:11-07:00", updated_at:"1609-07-12T15:58:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Making night hideous, and we fools of nature", created_at:"1609-07-12T16:37:28-07:00", updated_at:"1609-07-12T16:37:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "So horridly to shake our disposition", created_at:"1609-07-12T17:09:59-07:00", updated_at:"1609-07-12T17:09:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "With thoughts beyond the reaches of our souls?", created_at:"1609-07-12T17:48:20-07:00", updated_at:"1609-07-12T17:48:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Say, why is this? Wherefore? What should we do?", created_at:"1609-07-12T18:26:45-07:00", updated_at:"1609-07-12T18:26:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "It beckons you to go away with it", created_at:"1609-07-12T19:06:34-07:00", updated_at:"1609-07-12T19:06:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "As if it some impartment did desire", created_at:"1609-07-12T19:26:05-07:00", updated_at:"1609-07-12T19:26:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "To you alone.", created_at:"1609-07-12T19:32:25-07:00", updated_at:"1609-07-12T19:32:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Look with what courteous action", created_at:"1609-07-12T19:52:06-07:00", updated_at:"1609-07-12T19:52:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "It waves you to a more removèd ground.", created_at:"1609-07-12T20:25:39-07:00", updated_at:"1609-07-12T20:25:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "But do not go with it.", created_at:"1609-07-12T21:03:34-07:00", updated_at:"1609-07-12T21:03:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "No, by no means.", created_at:"1609-07-12T21:05:10-07:00", updated_at:"1609-07-12T21:05:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "It will not speak. Then I will follow it.", created_at:"1609-07-12T21:26:12-07:00", updated_at:"1609-07-12T21:26:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Do not, my lord.", created_at:"1609-07-12T21:59:03-07:00", updated_at:"1609-07-12T21:59:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Why, what should be the fear?", created_at:"1609-07-12T22:20:27-07:00", updated_at:"1609-07-12T22:20:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "I do not set my life at a pin’s fee.", created_at:"1609-07-12T22:29:45-07:00", updated_at:"1609-07-12T22:29:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "And for my soul, what can it do to that,", created_at:"1609-07-12T23:07:43-07:00", updated_at:"1609-07-12T23:07:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Being a thing immortal as itself?", created_at:"1609-07-12T23:44:19-07:00", updated_at:"1609-07-12T23:44:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "It waves me forth again. I’ll follow it.", created_at:"1609-07-12T23:54:52-07:00", updated_at:"1609-07-12T23:54:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "What if it tempt you toward the flood, my lord?", created_at:"1609-07-13T00:11:31-07:00", updated_at:"1609-07-13T00:11:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Or to the dreadful summit of the cliff", created_at:"1609-07-13T00:16:01-07:00", updated_at:"1609-07-13T00:16:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "That beetles o’er his base into the sea,", created_at:"1609-07-13T00:52:09-07:00", updated_at:"1609-07-13T00:52:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "And there assume some other horrible form", created_at:"1609-07-13T01:00:32-07:00", updated_at:"1609-07-13T01:00:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Which might deprive your sovereignty of reason", created_at:"1609-07-13T01:39:09-07:00", updated_at:"1609-07-13T01:39:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "And draw you into madness? Think of it.", created_at:"1609-07-13T01:52:01-07:00", updated_at:"1609-07-13T01:52:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "The very place puts toys of desperation,", created_at:"1609-07-13T02:14:25-07:00", updated_at:"1609-07-13T02:14:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Without more motive, into every brain", created_at:"1609-07-13T02:46:03-07:00", updated_at:"1609-07-13T02:46:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "That looks so many fathoms to the sea", created_at:"1609-07-13T03:09:46-07:00", updated_at:"1609-07-13T03:09:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "And hears it roar beneath.", created_at:"1609-07-13T03:13:23-07:00", updated_at:"1609-07-13T03:13:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "It waves me still.—Go on, I’ll follow thee.", created_at:"1609-07-13T03:24:47-07:00", updated_at:"1609-07-13T03:24:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "You shall not go, my lord.", created_at:"1609-07-13T03:51:25-07:00", updated_at:"1609-07-13T03:51:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Hold off your hands.", created_at:"1609-07-13T03:57:46-07:00", updated_at:"1609-07-13T03:57:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Be ruled. You shall not go.", created_at:"1609-07-13T04:19:48-07:00", updated_at:"1609-07-13T04:19:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "My fate cries out", created_at:"1609-07-13T04:34:51-07:00", updated_at:"1609-07-13T04:34:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "And makes each petty arture in this body", created_at:"1609-07-13T04:45:28-07:00", updated_at:"1609-07-13T04:45:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "As hardy as the Nemean lion’s nerve.", created_at:"1609-07-13T05:18:32-07:00", updated_at:"1609-07-13T05:18:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "Still am I called. Unhand me, gentlemen.", created_at:"1609-07-13T05:40:11-07:00", updated_at:"1609-07-13T05:40:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "By heaven, I’ll make a ghost of him that lets me!", created_at:"1609-07-13T06:08:51-07:00", updated_at:"1609-07-13T06:08:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_12.id, body: "I say, away!—Go on. I’ll follow thee.", created_at:"1609-07-13T06:40:19-07:00", updated_at:"1609-07-13T06:40:19-07:00"})
