Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_13.id, body: "He waxes desperate with imagination.", created_at:"1609-07-13T06:47:31-07:00", updated_at:"1609-07-13T06:47:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_13.id, body: "Let’s follow. ’Tis not fit thus to obey him.", created_at:"1609-07-13T06:59:08-07:00", updated_at:"1609-07-13T06:59:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_13.id, body: "Have after. To what issue will this come?", created_at:"1609-07-13T07:24:47-07:00", updated_at:"1609-07-13T07:24:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_13.id, body: "Something is rotten in the state of Denmark.", created_at:"1609-07-13T07:33:10-07:00", updated_at:"1609-07-13T07:33:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_13.id, body: "Heaven will direct it.", created_at:"1609-07-13T07:43:25-07:00", updated_at:"1609-07-13T07:43:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_13.id, body: "Nay, let’s follow him.", created_at:"1609-07-13T07:51:23-07:00", updated_at:"1609-07-13T07:51:23-07:00"})
