Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Mark me.", created_at:"1609-07-13T08:36:45-07:00", updated_at:"1609-07-13T08:36:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "I will.", created_at:"1609-07-13T09:14:28-07:00", updated_at:"1609-07-13T09:14:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "My hour is almost come", created_at:"1609-07-13T09:30:59-07:00", updated_at:"1609-07-13T09:30:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "When I to sulf’rous and tormenting flames", created_at:"1609-07-13T10:01:50-07:00", updated_at:"1609-07-13T10:01:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Must render up myself.", created_at:"1609-07-13T10:34:13-07:00", updated_at:"1609-07-13T10:34:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Alas, poor ghost!", created_at:"1609-07-13T11:12:01-07:00", updated_at:"1609-07-13T11:12:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Pity me not, but lend thy serious hearing", created_at:"1609-07-13T11:41:43-07:00", updated_at:"1609-07-13T11:41:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "To what I shall unfold.", created_at:"1609-07-13T12:21:07-07:00", updated_at:"1609-07-13T12:21:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Speak. I am bound to hear.", created_at:"1609-07-13T13:00:15-07:00", updated_at:"1609-07-13T13:00:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "So art thou to revenge, when thou shalt hear.", created_at:"1609-07-13T13:04:32-07:00", updated_at:"1609-07-13T13:04:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "What?", created_at:"1609-07-13T13:21:08-07:00", updated_at:"1609-07-13T13:21:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "I am thy father’s spirit,", created_at:"1609-07-13T13:24:26-07:00", updated_at:"1609-07-13T13:24:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Doomed for a certain term to walk the night", created_at:"1609-07-13T13:49:17-07:00", updated_at:"1609-07-13T13:49:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And for the day confined to fast in fires", created_at:"1609-07-13T14:09:39-07:00", updated_at:"1609-07-13T14:09:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Till the foul crimes done in my days of nature", created_at:"1609-07-13T14:18:01-07:00", updated_at:"1609-07-13T14:18:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Are burnt and purged away. But that I am forbid", created_at:"1609-07-13T14:33:25-07:00", updated_at:"1609-07-13T14:33:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "To tell the secrets of my prison house,", created_at:"1609-07-13T15:02:35-07:00", updated_at:"1609-07-13T15:02:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "I could a tale unfold whose lightest word", created_at:"1609-07-13T15:40:27-07:00", updated_at:"1609-07-13T15:40:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Would harrow up thy soul, freeze thy young blood,", created_at:"1609-07-13T16:08:36-07:00", updated_at:"1609-07-13T16:08:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Make thy two eyes, like stars, start from their", created_at:"1609-07-13T16:46:20-07:00", updated_at:"1609-07-13T16:46:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "spheres,", created_at:"1609-07-13T16:48:10-07:00", updated_at:"1609-07-13T16:48:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Thy knotted and combinèd locks to part,", created_at:"1609-07-13T17:16:10-07:00", updated_at:"1609-07-13T17:16:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And each particular hair to stand an end,", created_at:"1609-07-13T17:43:19-07:00", updated_at:"1609-07-13T17:43:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Like quills upon the fearful porpentine.", created_at:"1609-07-13T18:06:49-07:00", updated_at:"1609-07-13T18:06:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "But this eternal blazon must not be", created_at:"1609-07-13T18:36:45-07:00", updated_at:"1609-07-13T18:36:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "To ears of flesh and blood. List, list, O list!", created_at:"1609-07-13T18:54:51-07:00", updated_at:"1609-07-13T18:54:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "If thou didst ever thy dear father love—", created_at:"1609-07-13T19:31:21-07:00", updated_at:"1609-07-13T19:31:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "O God!", created_at:"1609-07-13T19:56:23-07:00", updated_at:"1609-07-13T19:56:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Revenge his foul and most unnatural murder.", created_at:"1609-07-13T20:32:54-07:00", updated_at:"1609-07-13T20:32:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Murder?", created_at:"1609-07-13T21:12:36-07:00", updated_at:"1609-07-13T21:12:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Murder most foul, as in the best it is,", created_at:"1609-07-13T21:50:09-07:00", updated_at:"1609-07-13T21:50:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "But this most foul, strange, and unnatural.", created_at:"1609-07-13T22:11:09-07:00", updated_at:"1609-07-13T22:11:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Haste me to know ’t, that I, with wings as swift", created_at:"1609-07-13T22:14:11-07:00", updated_at:"1609-07-13T22:14:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "As meditation or the thoughts of love,", created_at:"1609-07-13T22:16:44-07:00", updated_at:"1609-07-13T22:16:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "May sweep to my revenge.", created_at:"1609-07-13T22:55:37-07:00", updated_at:"1609-07-13T22:55:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "I find thee apt;", created_at:"1609-07-13T23:17:55-07:00", updated_at:"1609-07-13T23:17:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And duller shouldst thou be than the fat weed", created_at:"1609-07-13T23:54:41-07:00", updated_at:"1609-07-13T23:54:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "That roots itself in ease on Lethe wharf,", created_at:"1609-07-14T00:03:18-07:00", updated_at:"1609-07-14T00:03:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Wouldst thou not stir in this. Now, Hamlet, hear.", created_at:"1609-07-14T00:16:00-07:00", updated_at:"1609-07-14T00:16:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "’Tis given out that, sleeping in my orchard,", created_at:"1609-07-14T00:30:10-07:00", updated_at:"1609-07-14T00:30:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "A serpent stung me. So the whole ear of Denmark", created_at:"1609-07-14T00:42:09-07:00", updated_at:"1609-07-14T00:42:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Is by a forgèd process of my death", created_at:"1609-07-14T00:46:21-07:00", updated_at:"1609-07-14T00:46:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Rankly abused. But know, thou noble youth,", created_at:"1609-07-14T01:18:45-07:00", updated_at:"1609-07-14T01:18:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "The serpent that did sting thy father’s life", created_at:"1609-07-14T01:43:58-07:00", updated_at:"1609-07-14T01:43:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Now wears his crown.", created_at:"1609-07-14T02:19:43-07:00", updated_at:"1609-07-14T02:19:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "O, my prophetic soul! My uncle!", created_at:"1609-07-14T02:51:08-07:00", updated_at:"1609-07-14T02:51:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Ay, that incestuous, that adulterate beast,", created_at:"1609-07-14T02:53:06-07:00", updated_at:"1609-07-14T02:53:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "With witchcraft of his wits, with traitorous gifts—", created_at:"1609-07-14T03:20:41-07:00", updated_at:"1609-07-14T03:20:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "O wicked wit and gifts, that have the power", created_at:"1609-07-14T03:33:09-07:00", updated_at:"1609-07-14T03:33:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "So to seduce!—won to his shameful lust", created_at:"1609-07-14T03:34:34-07:00", updated_at:"1609-07-14T03:34:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "The will of my most seeming-virtuous queen.", created_at:"1609-07-14T03:37:32-07:00", updated_at:"1609-07-14T03:37:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "O Hamlet, what a falling off was there!", created_at:"1609-07-14T04:02:45-07:00", updated_at:"1609-07-14T04:02:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "From me, whose love was of that dignity", created_at:"1609-07-14T04:31:55-07:00", updated_at:"1609-07-14T04:31:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "That it went hand in hand even with the vow", created_at:"1609-07-14T04:54:48-07:00", updated_at:"1609-07-14T04:54:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "I made to her in marriage, and to decline", created_at:"1609-07-14T05:33:08-07:00", updated_at:"1609-07-14T05:33:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Upon a wretch whose natural gifts were poor", created_at:"1609-07-14T06:07:06-07:00", updated_at:"1609-07-14T06:07:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "To those of mine.", created_at:"1609-07-14T06:29:39-07:00", updated_at:"1609-07-14T06:29:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "But virtue, as it never will be moved,", created_at:"1609-07-14T06:32:43-07:00", updated_at:"1609-07-14T06:32:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Though lewdness court it in a shape of heaven,", created_at:"1609-07-14T07:12:36-07:00", updated_at:"1609-07-14T07:12:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "So, lust, though to a radiant angel linked,", created_at:"1609-07-14T07:31:20-07:00", updated_at:"1609-07-14T07:31:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Will sate itself in a celestial bed", created_at:"1609-07-14T07:37:55-07:00", updated_at:"1609-07-14T07:37:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And prey on garbage.", created_at:"1609-07-14T08:11:57-07:00", updated_at:"1609-07-14T08:11:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "But soft, methinks I scent the morning air.", created_at:"1609-07-14T08:19:38-07:00", updated_at:"1609-07-14T08:19:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Brief let me be. Sleeping within my orchard,", created_at:"1609-07-14T08:36:41-07:00", updated_at:"1609-07-14T08:36:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "My custom always of the afternoon,", created_at:"1609-07-14T08:42:42-07:00", updated_at:"1609-07-14T08:42:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Upon my secure hour thy uncle stole,", created_at:"1609-07-14T09:05:05-07:00", updated_at:"1609-07-14T09:05:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "With juice of cursèd hebona in a vial", created_at:"1609-07-14T09:26:33-07:00", updated_at:"1609-07-14T09:26:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And in the porches of my ears did pour", created_at:"1609-07-14T10:02:24-07:00", updated_at:"1609-07-14T10:02:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "The leprous distilment, whose effect", created_at:"1609-07-14T10:11:18-07:00", updated_at:"1609-07-14T10:11:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Holds such an enmity with blood of man", created_at:"1609-07-14T10:40:23-07:00", updated_at:"1609-07-14T10:40:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "That swift as quicksilver it courses through", created_at:"1609-07-14T10:57:35-07:00", updated_at:"1609-07-14T10:57:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "The natural gates and alleys of the body,", created_at:"1609-07-14T11:24:19-07:00", updated_at:"1609-07-14T11:24:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And with a sudden vigor it doth posset", created_at:"1609-07-14T11:50:34-07:00", updated_at:"1609-07-14T11:50:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And curd, like eager droppings into milk,", created_at:"1609-07-14T12:05:23-07:00", updated_at:"1609-07-14T12:05:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "The thin and wholesome blood. So did it mine,", created_at:"1609-07-14T12:05:35-07:00", updated_at:"1609-07-14T12:05:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And a most instant tetter barked about,", created_at:"1609-07-14T12:32:14-07:00", updated_at:"1609-07-14T12:32:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Most lazar-like, with vile and loathsome crust", created_at:"1609-07-14T12:37:22-07:00", updated_at:"1609-07-14T12:37:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "All my smooth body.", created_at:"1609-07-14T13:14:03-07:00", updated_at:"1609-07-14T13:14:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Thus was I, sleeping, by a brother’s hand", created_at:"1609-07-14T13:36:40-07:00", updated_at:"1609-07-14T13:36:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Of life, of crown, of queen at once dispatched,", created_at:"1609-07-14T13:46:19-07:00", updated_at:"1609-07-14T13:46:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Cut off, even in the blossoms of my sin,", created_at:"1609-07-14T13:57:21-07:00", updated_at:"1609-07-14T13:57:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Unhouseled, disappointed, unaneled,", created_at:"1609-07-14T13:58:51-07:00", updated_at:"1609-07-14T13:58:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "No reck’ning made, but sent to my account", created_at:"1609-07-14T14:03:19-07:00", updated_at:"1609-07-14T14:03:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "With all my imperfections on my head.", created_at:"1609-07-14T14:38:16-07:00", updated_at:"1609-07-14T14:38:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "O horrible, O horrible, most horrible!", created_at:"1609-07-14T14:49:47-07:00", updated_at:"1609-07-14T14:49:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "If thou hast nature in thee, bear it not.", created_at:"1609-07-14T15:11:54-07:00", updated_at:"1609-07-14T15:11:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Let not the royal bed of Denmark be", created_at:"1609-07-14T15:38:16-07:00", updated_at:"1609-07-14T15:38:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "A couch for luxury and damnèd incest.", created_at:"1609-07-14T15:43:02-07:00", updated_at:"1609-07-14T15:43:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "But, howsomever thou pursues this act,", created_at:"1609-07-14T16:06:01-07:00", updated_at:"1609-07-14T16:06:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Taint not thy mind, nor let thy soul contrive", created_at:"1609-07-14T16:18:31-07:00", updated_at:"1609-07-14T16:18:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Against thy mother aught. Leave her to heaven", created_at:"1609-07-14T16:54:07-07:00", updated_at:"1609-07-14T16:54:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And to those thorns that in her bosom lodge", created_at:"1609-07-14T17:29:27-07:00", updated_at:"1609-07-14T17:29:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "To prick and sting her. Fare thee well at once.", created_at:"1609-07-14T18:07:16-07:00", updated_at:"1609-07-14T18:07:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "The glowworm shows the matin to be near", created_at:"1609-07-14T18:36:44-07:00", updated_at:"1609-07-14T18:36:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "And ’gins to pale his uneffectual fire.", created_at:"1609-07-14T19:00:45-07:00", updated_at:"1609-07-14T19:00:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_14.id, body: "Adieu, adieu, adieu. Remember me.", created_at:"1609-07-14T19:34:57-07:00", updated_at:"1609-07-14T19:34:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "O all you host of heaven! O Earth! What else?", created_at:"1609-07-14T20:03:20-07:00", updated_at:"1609-07-14T20:03:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "And shall I couple hell? O fie! Hold, hold, my heart,", created_at:"1609-07-14T20:14:30-07:00", updated_at:"1609-07-14T20:14:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "And you, my sinews, grow not instant old,", created_at:"1609-07-14T20:47:29-07:00", updated_at:"1609-07-14T20:47:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "But bear me stiffly up. Remember thee?", created_at:"1609-07-14T21:12:21-07:00", updated_at:"1609-07-14T21:12:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Ay, thou poor ghost, whiles memory holds a seat", created_at:"1609-07-14T21:44:05-07:00", updated_at:"1609-07-14T21:44:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "In this distracted globe. Remember thee?", created_at:"1609-07-14T21:53:38-07:00", updated_at:"1609-07-14T21:53:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Yea, from the table of my memory", created_at:"1609-07-14T22:29:44-07:00", updated_at:"1609-07-14T22:29:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "I’ll wipe away all trivial, fond records,", created_at:"1609-07-14T23:09:41-07:00", updated_at:"1609-07-14T23:09:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "All saws of books, all forms, all pressures past,", created_at:"1609-07-14T23:39:11-07:00", updated_at:"1609-07-14T23:39:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That youth and observation copied there,", created_at:"1609-07-15T00:09:11-07:00", updated_at:"1609-07-15T00:09:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "And thy commandment all alone shall live", created_at:"1609-07-15T00:34:30-07:00", updated_at:"1609-07-15T00:34:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Within the book and volume of my brain,", created_at:"1609-07-15T00:45:24-07:00", updated_at:"1609-07-15T00:45:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Unmixed with baser matter. Yes, by heaven!", created_at:"1609-07-15T01:02:18-07:00", updated_at:"1609-07-15T01:02:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "O most pernicious woman!", created_at:"1609-07-15T01:15:34-07:00", updated_at:"1609-07-15T01:15:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "O villain, villain, smiling, damnèd villain!", created_at:"1609-07-15T01:45:01-07:00", updated_at:"1609-07-15T01:45:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "My tables—meet it is I set it down", created_at:"1609-07-15T02:23:20-07:00", updated_at:"1609-07-15T02:23:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That one may smile and smile and be a villain.", created_at:"1609-07-15T02:56:28-07:00", updated_at:"1609-07-15T02:56:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "At least I am sure it may be so in Denmark.", created_at:"1609-07-15T03:33:53-07:00", updated_at:"1609-07-15T03:33:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "So, uncle, there you are. Now to my word.", created_at:"1609-07-15T03:49:13-07:00", updated_at:"1609-07-15T03:49:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "It is adieu, adieu, remember me.", created_at:"1609-07-15T04:14:54-07:00", updated_at:"1609-07-15T04:14:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "I have sworn ’t.", created_at:"1609-07-15T04:22:11-07:00", updated_at:"1609-07-15T04:22:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "My lord, my lord!", created_at:"1609-07-15T04:51:26-07:00", updated_at:"1609-07-15T04:51:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Lord Hamlet.", created_at:"1609-07-15T05:15:08-07:00", updated_at:"1609-07-15T05:15:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Heavens secure him!", created_at:"1609-07-15T05:46:02-07:00", updated_at:"1609-07-15T05:46:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "So be it.", created_at:"1609-07-15T05:50:45-07:00", updated_at:"1609-07-15T05:50:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Illo, ho, ho, my lord!", created_at:"1609-07-15T05:56:15-07:00", updated_at:"1609-07-15T05:56:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Hillo, ho, ho, boy! Come, bird, come!", created_at:"1609-07-15T06:14:07-07:00", updated_at:"1609-07-15T06:14:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "How is ’t, my noble lord?", created_at:"1609-07-15T06:24:34-07:00", updated_at:"1609-07-15T06:24:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "What news, my lord?", created_at:"1609-07-15T06:40:39-07:00", updated_at:"1609-07-15T06:40:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "O, wonderful!", created_at:"1609-07-15T06:55:33-07:00", updated_at:"1609-07-15T06:55:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Good my lord, tell it.", created_at:"1609-07-15T07:29:50-07:00", updated_at:"1609-07-15T07:29:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "No, you will reveal it.", created_at:"1609-07-15T07:41:26-07:00", updated_at:"1609-07-15T07:41:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Not I, my lord, by heaven.", created_at:"1609-07-15T08:02:30-07:00", updated_at:"1609-07-15T08:02:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Nor I, my lord.", created_at:"1609-07-15T08:38:26-07:00", updated_at:"1609-07-15T08:38:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "How say you, then? Would heart of man once think", created_at:"1609-07-15T09:01:28-07:00", updated_at:"1609-07-15T09:01:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "it?", created_at:"1609-07-15T09:36:16-07:00", updated_at:"1609-07-15T09:36:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "But you’ll be secret?", created_at:"1609-07-15T09:47:36-07:00", updated_at:"1609-07-15T09:47:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: " Ay, by heaven, my lord.", created_at:"1609-07-15T10:07:54-07:00", updated_at:"1609-07-15T10:07:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "There’s never a villain dwelling in all Denmark", created_at:"1609-07-15T10:46:18-07:00", updated_at:"1609-07-15T10:46:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "But he’s an arrant knave.", created_at:"1609-07-15T11:11:45-07:00", updated_at:"1609-07-15T11:11:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "There needs no ghost, my lord, come from the grave", created_at:"1609-07-15T11:44:04-07:00", updated_at:"1609-07-15T11:44:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "To tell us this.", created_at:"1609-07-15T12:08:40-07:00", updated_at:"1609-07-15T12:08:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Why, right, you are in the right.", created_at:"1609-07-15T12:29:51-07:00", updated_at:"1609-07-15T12:29:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And so, without more circumstance at all,", created_at:"1609-07-15T13:05:18-07:00", updated_at:"1609-07-15T13:05:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "I hold it fit that we shake hands and part,", created_at:"1609-07-15T13:34:50-07:00", updated_at:"1609-07-15T13:34:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "You, as your business and desire shall point you", created_at:"1609-07-15T14:08:39-07:00", updated_at:"1609-07-15T14:08:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "(For every man hath business and desire,", created_at:"1609-07-15T14:27:18-07:00", updated_at:"1609-07-15T14:27:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Such as it is), and for my own poor part,", created_at:"1609-07-15T14:32:16-07:00", updated_at:"1609-07-15T14:32:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "I will go pray.", created_at:"1609-07-15T14:49:31-07:00", updated_at:"1609-07-15T14:49:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "These are but wild and whirling words, my lord.", created_at:"1609-07-15T15:06:14-07:00", updated_at:"1609-07-15T15:06:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "I am sorry they offend you, heartily;", created_at:"1609-07-15T15:26:36-07:00", updated_at:"1609-07-15T15:26:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Yes, faith, heartily.", created_at:"1609-07-15T15:45:22-07:00", updated_at:"1609-07-15T15:45:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "There’s no offense, my lord.", created_at:"1609-07-15T15:45:41-07:00", updated_at:"1609-07-15T15:45:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Yes, by Saint Patrick, but there is, Horatio,", created_at:"1609-07-15T15:59:54-07:00", updated_at:"1609-07-15T15:59:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And much offense, too. Touching this vision here,", created_at:"1609-07-15T16:02:14-07:00", updated_at:"1609-07-15T16:02:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "It is an honest ghost—that let me tell you.", created_at:"1609-07-15T16:15:50-07:00", updated_at:"1609-07-15T16:15:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "For your desire to know what is between us,", created_at:"1609-07-15T16:27:35-07:00", updated_at:"1609-07-15T16:27:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "O’ermaster ’t as you may. And now, good friends,", created_at:"1609-07-15T16:49:24-07:00", updated_at:"1609-07-15T16:49:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "As you are friends, scholars, and soldiers,", created_at:"1609-07-15T17:15:25-07:00", updated_at:"1609-07-15T17:15:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Give me one poor request.", created_at:"1609-07-15T17:39:57-07:00", updated_at:"1609-07-15T17:39:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "What is ’t, my lord? We will.", created_at:"1609-07-15T18:03:10-07:00", updated_at:"1609-07-15T18:03:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Never make known what you have seen tonight.", created_at:"1609-07-15T18:27:58-07:00", updated_at:"1609-07-15T18:27:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: " My lord, we will not.", created_at:"1609-07-15T18:58:07-07:00", updated_at:"1609-07-15T18:58:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Nay, but swear ’t.", created_at:"1609-07-15T19:24:50-07:00", updated_at:"1609-07-15T19:24:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "In faith, my lord, not I.", created_at:"1609-07-15T19:52:48-07:00", updated_at:"1609-07-15T19:52:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Nor I, my lord, in faith.", created_at:"1609-07-15T20:13:03-07:00", updated_at:"1609-07-15T20:13:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Upon my sword.", created_at:"1609-07-15T20:40:47-07:00", updated_at:"1609-07-15T20:40:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Marcellus"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "We have sworn, my lord, already.", created_at:"1609-07-15T21:01:26-07:00", updated_at:"1609-07-15T21:01:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Indeed, upon my sword, indeed.", created_at:"1609-07-15T21:35:30-07:00", updated_at:"1609-07-15T21:35:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Ha, ha, boy, sayst thou so? Art thou there,", created_at:"1609-07-15T22:02:29-07:00", updated_at:"1609-07-15T22:02:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "truepenny?", created_at:"1609-07-15T22:05:34-07:00", updated_at:"1609-07-15T22:05:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Come on, you hear this fellow in the cellarage.", created_at:"1609-07-15T22:40:55-07:00", updated_at:"1609-07-15T22:40:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Consent to swear.", created_at:"1609-07-15T23:05:02-07:00", updated_at:"1609-07-15T23:05:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Propose the oath, my lord.", created_at:"1609-07-15T23:23:30-07:00", updated_at:"1609-07-15T23:23:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Never to speak of this that you have seen,", created_at:"1609-07-15T23:45:16-07:00", updated_at:"1609-07-15T23:45:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Swear by my sword.", created_at:"1609-07-15T23:47:14-07:00", updated_at:"1609-07-15T23:47:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Hic et ubique? Then we’ll shift our ground.", created_at:"1609-07-15T23:51:32-07:00", updated_at:"1609-07-15T23:51:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Come hither, gentlemen,", created_at:"1609-07-16T00:09:34-07:00", updated_at:"1609-07-16T00:09:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And lay your hands again upon my sword.", created_at:"1609-07-16T00:28:53-07:00", updated_at:"1609-07-16T00:28:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Swear by my sword", created_at:"1609-07-16T00:36:06-07:00", updated_at:"1609-07-16T00:36:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Never to speak of this that you have heard.", created_at:"1609-07-16T00:45:41-07:00", updated_at:"1609-07-16T00:45:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Well said, old mole. Canst work i’ th’ earth so fast?—", created_at:"1609-07-16T01:15:05-07:00", updated_at:"1609-07-16T01:15:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "A worthy pioner! Once more remove, good friends.", created_at:"1609-07-16T01:19:42-07:00", updated_at:"1609-07-16T01:19:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "O day and night, but this is wondrous strange.", created_at:"1609-07-16T01:30:20-07:00", updated_at:"1609-07-16T01:30:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And therefore as a stranger give it welcome.", created_at:"1609-07-16T01:43:37-07:00", updated_at:"1609-07-16T01:43:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "There are more things in heaven and earth, Horatio,", created_at:"1609-07-16T02:00:50-07:00", updated_at:"1609-07-16T02:00:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Than are dreamt of in your philosophy. But come.", created_at:"1609-07-16T02:25:47-07:00", updated_at:"1609-07-16T02:25:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Here, as before, never, so help you mercy,", created_at:"1609-07-16T02:43:38-07:00", updated_at:"1609-07-16T02:43:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "How strange or odd some’er I bear myself", created_at:"1609-07-16T03:18:08-07:00", updated_at:"1609-07-16T03:18:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "(As I perchance hereafter shall think meet", created_at:"1609-07-16T03:23:52-07:00", updated_at:"1609-07-16T03:23:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "To put an antic disposition on)", created_at:"1609-07-16T03:41:20-07:00", updated_at:"1609-07-16T03:41:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "That you, at such times seeing me, never shall,", created_at:"1609-07-16T04:20:47-07:00", updated_at:"1609-07-16T04:20:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "With arms encumbered thus, or this headshake,", created_at:"1609-07-16T04:28:19-07:00", updated_at:"1609-07-16T04:28:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Or by pronouncing of some doubtful phrase,", created_at:"1609-07-16T04:58:21-07:00", updated_at:"1609-07-16T04:58:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "As Well, well, we know, or We could an if we", created_at:"1609-07-16T05:18:01-07:00", updated_at:"1609-07-16T05:18:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "would,", created_at:"1609-07-16T05:24:23-07:00", updated_at:"1609-07-16T05:24:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Or If we list to speak, or There be an if they", created_at:"1609-07-16T05:32:48-07:00", updated_at:"1609-07-16T05:32:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "might,", created_at:"1609-07-16T05:42:49-07:00", updated_at:"1609-07-16T05:42:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Or such ambiguous giving-out, to note", created_at:"1609-07-16T05:45:17-07:00", updated_at:"1609-07-16T05:45:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "That you know aught of me—this do swear,", created_at:"1609-07-16T06:13:32-07:00", updated_at:"1609-07-16T06:13:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "So grace and mercy at your most need help you.", created_at:"1609-07-16T06:53:20-07:00", updated_at:"1609-07-16T06:53:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Rest, rest, perturbèd spirit.—So, gentlemen,", created_at:"1609-07-16T07:16:05-07:00", updated_at:"1609-07-16T07:16:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "With all my love I do commend me to you,", created_at:"1609-07-16T07:50:44-07:00", updated_at:"1609-07-16T07:50:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And what so poor a man as Hamlet is", created_at:"1609-07-16T08:05:54-07:00", updated_at:"1609-07-16T08:05:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "May do t’ express his love and friending to you,", created_at:"1609-07-16T08:22:13-07:00", updated_at:"1609-07-16T08:22:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "God willing, shall not lack. Let us go in together,", created_at:"1609-07-16T08:57:40-07:00", updated_at:"1609-07-16T08:57:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "And still your fingers on your lips, I pray.", created_at:"1609-07-16T09:15:35-07:00", updated_at:"1609-07-16T09:15:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "The time is out of joint. O cursèd spite", created_at:"1609-07-16T09:28:01-07:00", updated_at:"1609-07-16T09:28:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "That ever I was born to set it right!", created_at:"1609-07-16T09:45:24-07:00", updated_at:"1609-07-16T09:45:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_11.id, body: "Nay, come, let’s go together.", created_at:"1609-07-16T10:16:20-07:00", updated_at:"1609-07-16T10:16:20-07:00"})
