User.create!({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, display_name: "Reynaldo", email: "Reynaldo@hamlet.com", password: "password"})
DirectMessageParticipant.create!({direct_message_id: direct_message_15.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Reynaldo@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_15.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Give him this money and these notes, Reynaldo.", created_at:"1609-07-16T10:41:22-07:00", updated_at:"1609-07-16T10:41:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "I will, my lord.", created_at:"1609-07-16T11:13:44-07:00", updated_at:"1609-07-16T11:13:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "You shall do marvelous wisely, good Reynaldo,", created_at:"1609-07-16T11:20:46-07:00", updated_at:"1609-07-16T11:20:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Before you visit him, to make inquire", created_at:"1609-07-16T12:00:13-07:00", updated_at:"1609-07-16T12:00:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Of his behavior.", created_at:"1609-07-16T12:22:17-07:00", updated_at:"1609-07-16T12:22:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "My lord, I did intend it.", created_at:"1609-07-16T12:38:00-07:00", updated_at:"1609-07-16T12:38:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Marry, well said, very well said. Look you, sir,", created_at:"1609-07-16T13:08:56-07:00", updated_at:"1609-07-16T13:08:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Inquire me first what Danskers are in Paris;", created_at:"1609-07-16T13:20:04-07:00", updated_at:"1609-07-16T13:20:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "And how, and who, what means, and where they", created_at:"1609-07-16T13:39:06-07:00", updated_at:"1609-07-16T13:39:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "keep,", created_at:"1609-07-16T13:39:09-07:00", updated_at:"1609-07-16T13:39:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "What company, at what expense; and finding", created_at:"1609-07-16T14:03:25-07:00", updated_at:"1609-07-16T14:03:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "By this encompassment and drift of question", created_at:"1609-07-16T14:25:08-07:00", updated_at:"1609-07-16T14:25:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "That they do know my son, come you more nearer", created_at:"1609-07-16T15:03:52-07:00", updated_at:"1609-07-16T15:03:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Than your particular demands will touch it.", created_at:"1609-07-16T15:43:32-07:00", updated_at:"1609-07-16T15:43:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Take you, as ’twere, some distant knowledge of him,", created_at:"1609-07-16T16:02:40-07:00", updated_at:"1609-07-16T16:02:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "As thus: I know his father and his friends", created_at:"1609-07-16T16:34:59-07:00", updated_at:"1609-07-16T16:34:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "And, in part, him. Do you mark this, Reynaldo?", created_at:"1609-07-16T16:52:13-07:00", updated_at:"1609-07-16T16:52:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Ay, very well, my lord.", created_at:"1609-07-16T17:04:55-07:00", updated_at:"1609-07-16T17:04:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "And, in part, him, but, you may say, not well.", created_at:"1609-07-16T17:31:54-07:00", updated_at:"1609-07-16T17:31:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "But if ’t be he I mean, he’s very wild,", created_at:"1609-07-16T18:11:32-07:00", updated_at:"1609-07-16T18:11:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Addicted so and so. And there put on him", created_at:"1609-07-16T18:48:29-07:00", updated_at:"1609-07-16T18:48:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "What forgeries you please—marry, none so rank", created_at:"1609-07-16T19:24:29-07:00", updated_at:"1609-07-16T19:24:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "As may dishonor him, take heed of that,", created_at:"1609-07-16T19:49:46-07:00", updated_at:"1609-07-16T19:49:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "But, sir, such wanton, wild, and usual slips", created_at:"1609-07-16T20:20:18-07:00", updated_at:"1609-07-16T20:20:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "As are companions noted and most known", created_at:"1609-07-16T20:44:43-07:00", updated_at:"1609-07-16T20:44:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "To youth and liberty.", created_at:"1609-07-16T21:02:27-07:00", updated_at:"1609-07-16T21:02:27-07:00"})
