Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "But, my good lord—", created_at:"1609-07-17T00:48:08-07:00", updated_at:"1609-07-17T00:48:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Wherefore should you do this?", created_at:"1609-07-17T00:56:11-07:00", updated_at:"1609-07-17T00:56:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Ay, my lord, I would know that.", created_at:"1609-07-17T01:18:28-07:00", updated_at:"1609-07-17T01:18:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Marry, sir, here’s my drift,", created_at:"1609-07-17T01:28:22-07:00", updated_at:"1609-07-17T01:28:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "And I believe it is a fetch of wit.", created_at:"1609-07-17T02:05:04-07:00", updated_at:"1609-07-17T02:05:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "You, laying these slight sullies on my son,", created_at:"1609-07-17T02:13:03-07:00", updated_at:"1609-07-17T02:13:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "As ’twere a thing a little soiled i’ th’ working,", created_at:"1609-07-17T02:32:37-07:00", updated_at:"1609-07-17T02:32:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Mark you, your party in converse, him you would", created_at:"1609-07-17T02:44:46-07:00", updated_at:"1609-07-17T02:44:46-07:00"})
