Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Having ever seen in the prenominate crimes", created_at:"1609-07-17T03:31:40-07:00", updated_at:"1609-07-17T03:31:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "The youth you breathe of guilty, be assured", created_at:"1609-07-17T04:07:23-07:00", updated_at:"1609-07-17T04:07:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "He closes with you in this consequence:", created_at:"1609-07-17T04:29:31-07:00", updated_at:"1609-07-17T04:29:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Good sir, or so, or friend, or gentleman,", created_at:"1609-07-17T04:50:40-07:00", updated_at:"1609-07-17T04:50:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "According to the phrase or the addition", created_at:"1609-07-17T04:52:20-07:00", updated_at:"1609-07-17T04:52:20-07:00"})
