Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "At closes in the consequence—ay, marry—", created_at:"1609-07-17T06:51:39-07:00", updated_at:"1609-07-17T06:51:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "He closes thus: I know the gentleman.", created_at:"1609-07-17T07:05:53-07:00", updated_at:"1609-07-17T07:05:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "I saw him yesterday, or th’ other day", created_at:"1609-07-17T07:10:23-07:00", updated_at:"1609-07-17T07:10:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "(Or then, or then, with such or such), and as you", created_at:"1609-07-17T07:47:39-07:00", updated_at:"1609-07-17T07:47:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "say,", created_at:"1609-07-17T08:20:52-07:00", updated_at:"1609-07-17T08:20:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "There was he gaming, there o’ertook in ’s rouse,", created_at:"1609-07-17T08:41:23-07:00", updated_at:"1609-07-17T08:41:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "There falling out at tennis; or perchance", created_at:"1609-07-17T09:01:31-07:00", updated_at:"1609-07-17T09:01:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "I saw him enter such a house of sale—", created_at:"1609-07-17T09:20:08-07:00", updated_at:"1609-07-17T09:20:08-07:00"})
