Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Your bait of falsehood take this carp of truth;", created_at:"1609-07-17T10:18:31-07:00", updated_at:"1609-07-17T10:18:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "And thus do we of wisdom and of reach,", created_at:"1609-07-17T10:30:02-07:00", updated_at:"1609-07-17T10:30:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "With windlasses and with assays of bias,", created_at:"1609-07-17T10:41:15-07:00", updated_at:"1609-07-17T10:41:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "By indirections find directions out.", created_at:"1609-07-17T10:53:51-07:00", updated_at:"1609-07-17T10:53:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "So by my former lecture and advice", created_at:"1609-07-17T11:27:41-07:00", updated_at:"1609-07-17T11:27:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Shall you my son. You have me, have you not?", created_at:"1609-07-17T11:37:19-07:00", updated_at:"1609-07-17T11:37:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "My lord, I have.", created_at:"1609-07-17T11:43:12-07:00", updated_at:"1609-07-17T11:43:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "God be wi’ you. Fare you well.", created_at:"1609-07-17T12:11:28-07:00", updated_at:"1609-07-17T12:11:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Good my lord.", created_at:"1609-07-17T12:19:44-07:00", updated_at:"1609-07-17T12:19:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Observe his inclination in yourself.", created_at:"1609-07-17T12:33:24-07:00", updated_at:"1609-07-17T12:33:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "I shall, my lord.", created_at:"1609-07-17T12:47:48-07:00", updated_at:"1609-07-17T12:47:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "And let him ply his music.", created_at:"1609-07-17T13:13:52-07:00", updated_at:"1609-07-17T13:13:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Reynaldo"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Well, my lord.", created_at:"1609-07-17T13:48:16-07:00", updated_at:"1609-07-17T13:48:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_15.id, body: "Farewell.", created_at:"1609-07-17T14:28:12-07:00", updated_at:"1609-07-17T14:28:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "How now, Ophelia, what’s the matter?", created_at:"1609-07-17T14:45:12-07:00", updated_at:"1609-07-17T14:45:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "O, my lord, my lord, I have been so affrighted!", created_at:"1609-07-17T15:18:57-07:00", updated_at:"1609-07-17T15:18:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "With what, i’ th’ name of God?", created_at:"1609-07-17T15:53:02-07:00", updated_at:"1609-07-17T15:53:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "My lord, as I was sewing in my closet,", created_at:"1609-07-17T16:13:03-07:00", updated_at:"1609-07-17T16:13:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Lord Hamlet, with his doublet all unbraced,", created_at:"1609-07-17T16:18:43-07:00", updated_at:"1609-07-17T16:18:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "No hat upon his head, his stockings fouled,", created_at:"1609-07-17T16:36:51-07:00", updated_at:"1609-07-17T16:36:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Ungartered, and down-gyvèd to his ankle,", created_at:"1609-07-17T16:39:42-07:00", updated_at:"1609-07-17T16:39:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Pale as his shirt, his knees knocking each other,", created_at:"1609-07-17T16:49:52-07:00", updated_at:"1609-07-17T16:49:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And with a look so piteous in purport", created_at:"1609-07-17T17:00:09-07:00", updated_at:"1609-07-17T17:00:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As if he had been loosèd out of hell", created_at:"1609-07-17T17:33:21-07:00", updated_at:"1609-07-17T17:33:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "To speak of horrors—he comes before me.", created_at:"1609-07-17T17:53:19-07:00", updated_at:"1609-07-17T17:53:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Mad for thy love?", created_at:"1609-07-17T18:09:21-07:00", updated_at:"1609-07-17T18:09:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "My lord, I do not know,", created_at:"1609-07-17T18:38:10-07:00", updated_at:"1609-07-17T18:38:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "But truly I do fear it.", created_at:"1609-07-17T19:02:09-07:00", updated_at:"1609-07-17T19:02:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "What said he?", created_at:"1609-07-17T19:31:24-07:00", updated_at:"1609-07-17T19:31:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "He took me by the wrist and held me hard.", created_at:"1609-07-17T19:43:14-07:00", updated_at:"1609-07-17T19:43:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Then goes he to the length of all his arm,", created_at:"1609-07-17T20:06:41-07:00", updated_at:"1609-07-17T20:06:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And, with his other hand thus o’er his brow,", created_at:"1609-07-17T20:22:47-07:00", updated_at:"1609-07-17T20:22:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "He falls to such perusal of my face", created_at:"1609-07-17T20:47:02-07:00", updated_at:"1609-07-17T20:47:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As he would draw it. Long stayed he so.", created_at:"1609-07-17T21:16:49-07:00", updated_at:"1609-07-17T21:16:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "At last, a little shaking of mine arm,", created_at:"1609-07-17T21:39:23-07:00", updated_at:"1609-07-17T21:39:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And thrice his head thus waving up and down,", created_at:"1609-07-17T22:01:23-07:00", updated_at:"1609-07-17T22:01:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "He raised a sigh so piteous and profound", created_at:"1609-07-17T22:12:37-07:00", updated_at:"1609-07-17T22:12:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As it did seem to shatter all his bulk", created_at:"1609-07-17T22:32:33-07:00", updated_at:"1609-07-17T22:32:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And end his being. That done, he lets me go,", created_at:"1609-07-17T23:10:00-07:00", updated_at:"1609-07-17T23:10:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And, with his head over his shoulder turned,", created_at:"1609-07-17T23:30:41-07:00", updated_at:"1609-07-17T23:30:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "He seemed to find his way without his eyes,", created_at:"1609-07-17T23:46:57-07:00", updated_at:"1609-07-17T23:46:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "For out o’ doors he went without their helps", created_at:"1609-07-18T00:14:10-07:00", updated_at:"1609-07-18T00:14:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And to the last bended their light on me.", created_at:"1609-07-18T00:43:07-07:00", updated_at:"1609-07-18T00:43:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Come, go with me. I will go seek the King.", created_at:"1609-07-18T00:58:36-07:00", updated_at:"1609-07-18T00:58:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "This is the very ecstasy of love,", created_at:"1609-07-18T01:00:30-07:00", updated_at:"1609-07-18T01:00:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Whose violent property fordoes itself", created_at:"1609-07-18T01:30:08-07:00", updated_at:"1609-07-18T01:30:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And leads the will to desperate undertakings", created_at:"1609-07-18T01:45:14-07:00", updated_at:"1609-07-18T01:45:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As oft as any passions under heaven", created_at:"1609-07-18T02:10:31-07:00", updated_at:"1609-07-18T02:10:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "That does afflict our natures. I am sorry.", created_at:"1609-07-18T02:35:18-07:00", updated_at:"1609-07-18T02:35:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "What, have you given him any hard words of late?", created_at:"1609-07-18T02:41:06-07:00", updated_at:"1609-07-18T02:41:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "No, my good lord, but as you did command", created_at:"1609-07-18T03:10:02-07:00", updated_at:"1609-07-18T03:10:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "I did repel his letters and denied", created_at:"1609-07-18T03:15:11-07:00", updated_at:"1609-07-18T03:15:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "His access to me.", created_at:"1609-07-18T03:31:21-07:00", updated_at:"1609-07-18T03:31:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "That hath made him mad.", created_at:"1609-07-18T04:05:20-07:00", updated_at:"1609-07-18T04:05:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "I am sorry that with better heed and judgment", created_at:"1609-07-18T04:26:58-07:00", updated_at:"1609-07-18T04:26:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "I had not coted him. I feared he did but trifle", created_at:"1609-07-18T04:52:01-07:00", updated_at:"1609-07-18T04:52:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "And meant to wrack thee. But beshrew my jealousy!", created_at:"1609-07-18T05:27:39-07:00", updated_at:"1609-07-18T05:27:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "By heaven, it is as proper to our age", created_at:"1609-07-18T06:03:46-07:00", updated_at:"1609-07-18T06:03:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "To cast beyond ourselves in our opinions", created_at:"1609-07-18T06:19:06-07:00", updated_at:"1609-07-18T06:19:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "As it is common for the younger sort", created_at:"1609-07-18T06:29:23-07:00", updated_at:"1609-07-18T06:29:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "To lack discretion. Come, go we to the King.", created_at:"1609-07-18T06:52:56-07:00", updated_at:"1609-07-18T06:52:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "This must be known, which, being kept close, might", created_at:"1609-07-18T07:05:49-07:00", updated_at:"1609-07-18T07:05:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "move", created_at:"1609-07-18T07:34:56-07:00", updated_at:"1609-07-18T07:34:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "More grief to hide than hate to utter love.", created_at:"1609-07-18T08:03:46-07:00", updated_at:"1609-07-18T08:03:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_10.id, body: "Come.", created_at:"1609-07-18T08:04:14-07:00", updated_at:"1609-07-18T08:04:14-07:00"})
