DirectMessageParticipant.create!({direct_message_id: direct_message_16.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Rosencrantz@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_16.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Welcome, dear Rosencrantz and Guildenstern.", created_at:"1609-07-18T08:04:17-07:00", updated_at:"1609-07-18T08:04:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Moreover that we much did long to see you,", created_at:"1609-07-18T08:35:08-07:00", updated_at:"1609-07-18T08:35:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "The need we have to use you did provoke", created_at:"1609-07-18T08:45:22-07:00", updated_at:"1609-07-18T08:45:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Our hasty sending. Something have you heard", created_at:"1609-07-18T08:53:44-07:00", updated_at:"1609-07-18T08:53:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Of Hamlet’s transformation, so call it,", created_at:"1609-07-18T08:53:51-07:00", updated_at:"1609-07-18T08:53:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Sith nor th’ exterior nor the inward man", created_at:"1609-07-18T09:27:55-07:00", updated_at:"1609-07-18T09:27:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Resembles that it was. What it should be,", created_at:"1609-07-18T09:30:09-07:00", updated_at:"1609-07-18T09:30:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "More than his father’s death, that thus hath put him", created_at:"1609-07-18T09:36:28-07:00", updated_at:"1609-07-18T09:36:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "So much from th’ understanding of himself", created_at:"1609-07-18T09:37:06-07:00", updated_at:"1609-07-18T09:37:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "I cannot dream of. I entreat you both", created_at:"1609-07-18T10:09:31-07:00", updated_at:"1609-07-18T10:09:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "That, being of so young days brought up with him", created_at:"1609-07-18T10:23:55-07:00", updated_at:"1609-07-18T10:23:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "And sith so neighbored to his youth and havior,", created_at:"1609-07-18T10:55:29-07:00", updated_at:"1609-07-18T10:55:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "That you vouchsafe your rest here in our court", created_at:"1609-07-18T11:18:26-07:00", updated_at:"1609-07-18T11:18:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Some little time, so by your companies", created_at:"1609-07-18T11:43:47-07:00", updated_at:"1609-07-18T11:43:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "To draw him on to pleasures, and to gather", created_at:"1609-07-18T11:52:35-07:00", updated_at:"1609-07-18T11:52:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "So much as from occasion you may glean,", created_at:"1609-07-18T12:16:43-07:00", updated_at:"1609-07-18T12:16:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Whether aught to us unknown afflicts him thus", created_at:"1609-07-18T12:21:24-07:00", updated_at:"1609-07-18T12:21:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "That, opened, lies within our remedy.", created_at:"1609-07-18T12:42:57-07:00", updated_at:"1609-07-18T12:42:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Good gentlemen, he hath much talked of you,", created_at:"1609-07-18T13:22:54-07:00", updated_at:"1609-07-18T13:22:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "And sure I am two men there is not living", created_at:"1609-07-18T13:47:18-07:00", updated_at:"1609-07-18T13:47:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "To whom he more adheres. If it will please you", created_at:"1609-07-18T14:22:09-07:00", updated_at:"1609-07-18T14:22:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "To show us so much gentry and goodwill", created_at:"1609-07-18T14:31:31-07:00", updated_at:"1609-07-18T14:31:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "As to expend your time with us awhile", created_at:"1609-07-18T15:08:45-07:00", updated_at:"1609-07-18T15:08:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "For the supply and profit of our hope,", created_at:"1609-07-18T15:39:22-07:00", updated_at:"1609-07-18T15:39:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Your visitation shall receive such thanks", created_at:"1609-07-18T16:05:19-07:00", updated_at:"1609-07-18T16:05:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "As fits a king’s remembrance.", created_at:"1609-07-18T16:38:37-07:00", updated_at:"1609-07-18T16:38:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Both your Majesties", created_at:"1609-07-18T17:18:15-07:00", updated_at:"1609-07-18T17:18:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Might, by the sovereign power you have of us,", created_at:"1609-07-18T17:32:13-07:00", updated_at:"1609-07-18T17:32:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Put your dread pleasures more into command", created_at:"1609-07-18T17:49:38-07:00", updated_at:"1609-07-18T17:49:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Than to entreaty.", created_at:"1609-07-18T18:14:09-07:00", updated_at:"1609-07-18T18:14:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "But we both obey,", created_at:"1609-07-18T18:18:14-07:00", updated_at:"1609-07-18T18:18:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "And here give up ourselves in the full bent", created_at:"1609-07-18T18:36:20-07:00", updated_at:"1609-07-18T18:36:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "To lay our service freely at your feet,", created_at:"1609-07-18T19:01:12-07:00", updated_at:"1609-07-18T19:01:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "To be commanded.", created_at:"1609-07-18T19:19:53-07:00", updated_at:"1609-07-18T19:19:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Thanks, Rosencrantz and gentle Guildenstern.", created_at:"1609-07-18T19:54:44-07:00", updated_at:"1609-07-18T19:54:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Thanks, Guildenstern and gentle Rosencrantz.", created_at:"1609-07-18T19:55:33-07:00", updated_at:"1609-07-18T19:55:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "And I beseech you instantly to visit", created_at:"1609-07-18T20:33:18-07:00", updated_at:"1609-07-18T20:33:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "My too much changèd son.—Go, some of you,", created_at:"1609-07-18T21:08:55-07:00", updated_at:"1609-07-18T21:08:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "And bring these gentlemen where Hamlet is.", created_at:"1609-07-18T21:41:56-07:00", updated_at:"1609-07-18T21:41:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Heavens make our presence and our practices", created_at:"1609-07-18T21:56:47-07:00", updated_at:"1609-07-18T21:56:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Pleasant and helpful to him!", created_at:"1609-07-18T22:28:22-07:00", updated_at:"1609-07-18T22:28:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_16.id, body: "Ay, amen!", created_at:"1609-07-18T22:35:41-07:00", updated_at:"1609-07-18T22:35:41-07:00"})
direct_message_17 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_17.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "ATTENDANTS@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_17.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_17.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Gertrude@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_17.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Polonius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_17.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Th’ ambassadors from Norway, my good lord,", created_at:"1609-07-18T23:00:52-07:00", updated_at:"1609-07-18T23:00:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Are joyfully returned.", created_at:"1609-07-18T23:39:24-07:00", updated_at:"1609-07-18T23:39:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Thou still hast been the father of good news.", created_at:"1609-07-18T23:46:11-07:00", updated_at:"1609-07-18T23:46:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Have I, my lord? I assure my good liege", created_at:"1609-07-19T00:23:26-07:00", updated_at:"1609-07-19T00:23:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "I hold my duty as I hold my soul,", created_at:"1609-07-19T00:33:19-07:00", updated_at:"1609-07-19T00:33:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Both to my God and to my gracious king,", created_at:"1609-07-19T00:42:29-07:00", updated_at:"1609-07-19T00:42:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And I do think, or else this brain of mine", created_at:"1609-07-19T00:45:33-07:00", updated_at:"1609-07-19T00:45:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Hunts not the trail of policy so sure", created_at:"1609-07-19T01:14:30-07:00", updated_at:"1609-07-19T01:14:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "As it hath used to do, that I have found", created_at:"1609-07-19T01:28:27-07:00", updated_at:"1609-07-19T01:28:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "The very cause of Hamlet’s lunacy.", created_at:"1609-07-19T01:29:11-07:00", updated_at:"1609-07-19T01:29:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "O, speak of that! That do I long to hear.", created_at:"1609-07-19T02:08:12-07:00", updated_at:"1609-07-19T02:08:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Give first admittance to th’ ambassadors.", created_at:"1609-07-19T02:44:10-07:00", updated_at:"1609-07-19T02:44:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "My news shall be the fruit to that great feast.", created_at:"1609-07-19T03:16:54-07:00", updated_at:"1609-07-19T03:16:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Thyself do grace to them and bring them in.", created_at:"1609-07-19T03:43:12-07:00", updated_at:"1609-07-19T03:43:12-07:00"})
direct_message_18 = DirectMessage.create!({})
