DirectMessageParticipant.create!({direct_message_id: direct_message_18.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_18.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Gertrude@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_18.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_18.id, body: "He tells me, my dear Gertrude, he hath found", created_at:"1609-07-19T04:12:03-07:00", updated_at:"1609-07-19T04:12:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_18.id, body: "The head and source of all your son’s distemper.", created_at:"1609-07-19T04:43:05-07:00", updated_at:"1609-07-19T04:43:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_18.id, body: "I doubt it is no other but the main—", created_at:"1609-07-19T05:17:22-07:00", updated_at:"1609-07-19T05:17:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_18.id, body: "His father’s death and our o’erhasty marriage.", created_at:"1609-07-19T05:17:51-07:00", updated_at:"1609-07-19T05:17:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_18.id, body: "Well, we shall sift him.", created_at:"1609-07-19T05:27:20-07:00", updated_at:"1609-07-19T05:27:20-07:00"})
direct_message_19 = DirectMessage.create!({})
