DirectMessageParticipant.create!({direct_message_id: direct_message_19.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Voltemand@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_19.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Welcome, my good friends.", created_at:"1609-07-19T05:48:53-07:00", updated_at:"1609-07-19T05:48:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Say, Voltemand, what from our brother Norway?", created_at:"1609-07-19T06:12:00-07:00", updated_at:"1609-07-19T06:12:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Most fair return of greetings and desires.", created_at:"1609-07-19T06:21:30-07:00", updated_at:"1609-07-19T06:21:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Upon our first, he sent out to suppress", created_at:"1609-07-19T06:24:57-07:00", updated_at:"1609-07-19T06:24:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "His nephew’s levies, which to him appeared", created_at:"1609-07-19T06:53:18-07:00", updated_at:"1609-07-19T06:53:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "To be a preparation ’gainst the Polack,", created_at:"1609-07-19T07:00:48-07:00", updated_at:"1609-07-19T07:00:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "But, better looked into, he truly found", created_at:"1609-07-19T07:37:04-07:00", updated_at:"1609-07-19T07:37:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "It was against your Highness. Whereat, grieved", created_at:"1609-07-19T07:47:01-07:00", updated_at:"1609-07-19T07:47:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "That so his sickness, age, and impotence", created_at:"1609-07-19T08:25:14-07:00", updated_at:"1609-07-19T08:25:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Was falsely borne in hand, sends out arrests", created_at:"1609-07-19T08:57:41-07:00", updated_at:"1609-07-19T08:57:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "On Fortinbras, which he, in brief, obeys,", created_at:"1609-07-19T09:25:28-07:00", updated_at:"1609-07-19T09:25:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Receives rebuke from Norway, and, in fine,", created_at:"1609-07-19T09:34:49-07:00", updated_at:"1609-07-19T09:34:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Makes vow before his uncle never more", created_at:"1609-07-19T09:40:04-07:00", updated_at:"1609-07-19T09:40:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "To give th’ assay of arms against your Majesty.", created_at:"1609-07-19T09:44:30-07:00", updated_at:"1609-07-19T09:44:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Whereon old Norway, overcome with joy,", created_at:"1609-07-19T10:08:45-07:00", updated_at:"1609-07-19T10:08:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Gives him three-score thousand crowns in annual", created_at:"1609-07-19T10:09:50-07:00", updated_at:"1609-07-19T10:09:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "fee", created_at:"1609-07-19T10:37:59-07:00", updated_at:"1609-07-19T10:37:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "And his commission to employ those soldiers,", created_at:"1609-07-19T10:53:33-07:00", updated_at:"1609-07-19T10:53:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "So levied as before, against the Polack,", created_at:"1609-07-19T11:10:31-07:00", updated_at:"1609-07-19T11:10:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "With an entreaty, herein further shown,", created_at:"1609-07-19T11:12:36-07:00", updated_at:"1609-07-19T11:12:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "That it might please you to give quiet pass", created_at:"1609-07-19T11:16:19-07:00", updated_at:"1609-07-19T11:16:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Through your dominions for this enterprise,", created_at:"1609-07-19T11:40:19-07:00", updated_at:"1609-07-19T11:40:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "On such regards of safety and allowance", created_at:"1609-07-19T11:46:22-07:00", updated_at:"1609-07-19T11:46:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Voltemand"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "As therein are set down.", created_at:"1609-07-19T11:56:30-07:00", updated_at:"1609-07-19T11:56:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "It likes us well,", created_at:"1609-07-19T12:03:47-07:00", updated_at:"1609-07-19T12:03:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "And, at our more considered time, we’ll read,", created_at:"1609-07-19T12:24:47-07:00", updated_at:"1609-07-19T12:24:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Answer, and think upon this business.", created_at:"1609-07-19T13:00:03-07:00", updated_at:"1609-07-19T13:00:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Meantime, we thank you for your well-took labor.", created_at:"1609-07-19T13:36:29-07:00", updated_at:"1609-07-19T13:36:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Go to your rest. At night we’ll feast together.", created_at:"1609-07-19T13:55:49-07:00", updated_at:"1609-07-19T13:55:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_19.id, body: "Most welcome home!", created_at:"1609-07-19T13:58:03-07:00", updated_at:"1609-07-19T13:58:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "This business is well ended.", created_at:"1609-07-19T14:05:06-07:00", updated_at:"1609-07-19T14:05:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "My liege, and madam, to expostulate", created_at:"1609-07-19T14:11:42-07:00", updated_at:"1609-07-19T14:11:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "What majesty should be, what duty is,", created_at:"1609-07-19T14:14:09-07:00", updated_at:"1609-07-19T14:14:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Why day is day, night night, and time is time", created_at:"1609-07-19T14:16:48-07:00", updated_at:"1609-07-19T14:16:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Were nothing but to waste night, day, and time.", created_at:"1609-07-19T14:43:02-07:00", updated_at:"1609-07-19T14:43:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Therefore, since brevity is the soul of wit,", created_at:"1609-07-19T15:17:05-07:00", updated_at:"1609-07-19T15:17:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And tediousness the limbs and outward flourishes,", created_at:"1609-07-19T15:22:04-07:00", updated_at:"1609-07-19T15:22:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "I will be brief. Your noble son is mad.", created_at:"1609-07-19T15:44:00-07:00", updated_at:"1609-07-19T15:44:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Mad call I it, for, to define true madness,", created_at:"1609-07-19T16:02:25-07:00", updated_at:"1609-07-19T16:02:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "What is ’t but to be nothing else but mad?", created_at:"1609-07-19T16:17:07-07:00", updated_at:"1609-07-19T16:17:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "But let that go.", created_at:"1609-07-19T16:31:55-07:00", updated_at:"1609-07-19T16:31:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "More matter with less art.", created_at:"1609-07-19T17:02:21-07:00", updated_at:"1609-07-19T17:02:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Madam, I swear I use no art at all.", created_at:"1609-07-19T17:14:20-07:00", updated_at:"1609-07-19T17:14:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "That he’s mad, ’tis true; ’tis true ’tis pity,", created_at:"1609-07-19T17:35:16-07:00", updated_at:"1609-07-19T17:35:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And pity ’tis ’tis true—a foolish figure,", created_at:"1609-07-19T18:11:43-07:00", updated_at:"1609-07-19T18:11:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "But farewell it, for I will use no art.", created_at:"1609-07-19T18:35:07-07:00", updated_at:"1609-07-19T18:35:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Mad let us grant him then, and now remains", created_at:"1609-07-19T18:56:23-07:00", updated_at:"1609-07-19T18:56:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "That we find out the cause of this effect,", created_at:"1609-07-19T19:03:48-07:00", updated_at:"1609-07-19T19:03:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Or, rather say, the cause of this defect,", created_at:"1609-07-19T19:15:03-07:00", updated_at:"1609-07-19T19:15:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "For this effect defective comes by cause.", created_at:"1609-07-19T19:54:56-07:00", updated_at:"1609-07-19T19:54:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Thus it remains, and the remainder thus.", created_at:"1609-07-19T20:34:00-07:00", updated_at:"1609-07-19T20:34:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Perpend.", created_at:"1609-07-19T20:38:42-07:00", updated_at:"1609-07-19T20:38:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "I have a daughter (have while she is mine)", created_at:"1609-07-19T20:45:07-07:00", updated_at:"1609-07-19T20:45:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Who, in her duty and obedience, mark,", created_at:"1609-07-19T20:49:07-07:00", updated_at:"1609-07-19T20:49:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Hath given me this. Now gather and surmise.", created_at:"1609-07-19T21:05:32-07:00", updated_at:"1609-07-19T21:05:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "To the celestial, and my soul’s idol, the", created_at:"1609-07-19T21:34:11-07:00", updated_at:"1609-07-19T21:34:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "most beautified Ophelia—", created_at:"1609-07-19T21:39:56-07:00", updated_at:"1609-07-19T21:39:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "That’s an ill phrase, a vile phrase; beautified is a", created_at:"1609-07-19T22:04:03-07:00", updated_at:"1609-07-19T22:04:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "vile phrase. But you shall hear. Thus:", created_at:"1609-07-19T22:06:42-07:00", updated_at:"1609-07-19T22:06:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "In her excellent white bosom, these, etc.—", created_at:"1609-07-19T22:39:38-07:00", updated_at:"1609-07-19T22:39:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Came this from Hamlet to her?", created_at:"1609-07-19T23:02:48-07:00", updated_at:"1609-07-19T23:02:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Good madam, stay awhile. I will be faithful.", created_at:"1609-07-19T23:03:45-07:00", updated_at:"1609-07-19T23:03:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Doubt thou the stars are fire,", created_at:"1609-07-19T23:20:33-07:00", updated_at:"1609-07-19T23:20:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Doubt that the sun doth move,", created_at:"1609-07-19T23:55:11-07:00", updated_at:"1609-07-19T23:55:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Doubt truth to be a liar,", created_at:"1609-07-20T00:29:14-07:00", updated_at:"1609-07-20T00:29:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "But never doubt I love.", created_at:"1609-07-20T00:49:06-07:00", updated_at:"1609-07-20T00:49:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "O dear Ophelia, I am ill at these numbers. I have not", created_at:"1609-07-20T01:16:11-07:00", updated_at:"1609-07-20T01:16:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "art to reckon my groans, but that I love thee best, O", created_at:"1609-07-20T01:52:23-07:00", updated_at:"1609-07-20T01:52:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "most best, believe it. Adieu.", created_at:"1609-07-20T02:12:57-07:00", updated_at:"1609-07-20T02:12:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Thine evermore, most dear lady, whilst", created_at:"1609-07-20T02:23:13-07:00", updated_at:"1609-07-20T02:23:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "this machine is to him, Hamlet.", created_at:"1609-07-20T02:56:36-07:00", updated_at:"1609-07-20T02:56:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "This, in obedience, hath my daughter shown me,", created_at:"1609-07-20T02:58:47-07:00", updated_at:"1609-07-20T02:58:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And more above, hath his solicitings,", created_at:"1609-07-20T03:25:46-07:00", updated_at:"1609-07-20T03:25:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "As they fell out by time, by means, and place,", created_at:"1609-07-20T03:44:51-07:00", updated_at:"1609-07-20T03:44:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "All given to mine ear.", created_at:"1609-07-20T04:21:33-07:00", updated_at:"1609-07-20T04:21:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "But how hath she received his love?", created_at:"1609-07-20T04:56:27-07:00", updated_at:"1609-07-20T04:56:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "What do you think of me?", created_at:"1609-07-20T04:57:36-07:00", updated_at:"1609-07-20T04:57:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "As of a man faithful and honorable.", created_at:"1609-07-20T05:33:04-07:00", updated_at:"1609-07-20T05:33:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "I would fain prove so. But what might you think,", created_at:"1609-07-20T06:00:48-07:00", updated_at:"1609-07-20T06:00:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "When I had seen this hot love on the wing", created_at:"1609-07-20T06:34:52-07:00", updated_at:"1609-07-20T06:34:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "(As I perceived it, I must tell you that,", created_at:"1609-07-20T06:41:44-07:00", updated_at:"1609-07-20T06:41:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Before my daughter told me), what might you,", created_at:"1609-07-20T06:42:59-07:00", updated_at:"1609-07-20T06:42:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Or my dear Majesty your queen here, think,", created_at:"1609-07-20T07:15:46-07:00", updated_at:"1609-07-20T07:15:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "If I had played the desk or table-book", created_at:"1609-07-20T07:39:06-07:00", updated_at:"1609-07-20T07:39:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Or given my heart a winking, mute and dumb,", created_at:"1609-07-20T08:04:09-07:00", updated_at:"1609-07-20T08:04:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Or looked upon this love with idle sight?", created_at:"1609-07-20T08:05:37-07:00", updated_at:"1609-07-20T08:05:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "What might you think? No, I went round to work,", created_at:"1609-07-20T08:36:21-07:00", updated_at:"1609-07-20T08:36:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And my young mistress thus I did bespeak:", created_at:"1609-07-20T09:12:04-07:00", updated_at:"1609-07-20T09:12:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Lord Hamlet is a prince, out of thy star.", created_at:"1609-07-20T09:48:59-07:00", updated_at:"1609-07-20T09:48:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "This must not be. And then I prescripts gave her,", created_at:"1609-07-20T10:18:11-07:00", updated_at:"1609-07-20T10:18:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "That she should lock herself from his resort,", created_at:"1609-07-20T10:18:23-07:00", updated_at:"1609-07-20T10:18:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Admit no messengers, receive no tokens;", created_at:"1609-07-20T10:48:12-07:00", updated_at:"1609-07-20T10:48:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Which done, she took the fruits of my advice,", created_at:"1609-07-20T11:00:26-07:00", updated_at:"1609-07-20T11:00:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And he, repelled (a short tale to make),", created_at:"1609-07-20T11:28:32-07:00", updated_at:"1609-07-20T11:28:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Fell into a sadness, then into a fast,", created_at:"1609-07-20T11:50:30-07:00", updated_at:"1609-07-20T11:50:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Thence to a watch, thence into a weakness,", created_at:"1609-07-20T12:24:52-07:00", updated_at:"1609-07-20T12:24:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Thence to a lightness, and, by this declension,", created_at:"1609-07-20T13:00:47-07:00", updated_at:"1609-07-20T13:00:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Into the madness wherein now he raves", created_at:"1609-07-20T13:25:02-07:00", updated_at:"1609-07-20T13:25:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And all we mourn for.", created_at:"1609-07-20T13:45:25-07:00", updated_at:"1609-07-20T13:45:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Do you think ’tis this?", created_at:"1609-07-20T14:24:30-07:00", updated_at:"1609-07-20T14:24:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "It may be, very like.", created_at:"1609-07-20T15:04:00-07:00", updated_at:"1609-07-20T15:04:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Hath there been such a time (I would fain know", created_at:"1609-07-20T15:22:34-07:00", updated_at:"1609-07-20T15:22:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "that)", created_at:"1609-07-20T16:02:10-07:00", updated_at:"1609-07-20T16:02:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "That I have positively said ’Tis so,", created_at:"1609-07-20T16:11:30-07:00", updated_at:"1609-07-20T16:11:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "When it proved otherwise?", created_at:"1609-07-20T16:29:40-07:00", updated_at:"1609-07-20T16:29:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Not that I know.", created_at:"1609-07-20T16:55:09-07:00", updated_at:"1609-07-20T16:55:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Take this from this, if this be otherwise.", created_at:"1609-07-20T17:26:35-07:00", updated_at:"1609-07-20T17:26:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "If circumstances lead me, I will find", created_at:"1609-07-20T17:45:31-07:00", updated_at:"1609-07-20T17:45:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Where truth is hid, though it were hid, indeed,", created_at:"1609-07-20T17:50:50-07:00", updated_at:"1609-07-20T17:50:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Within the center.", created_at:"1609-07-20T17:54:06-07:00", updated_at:"1609-07-20T17:54:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "How may we try it further?", created_at:"1609-07-20T18:13:28-07:00", updated_at:"1609-07-20T18:13:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "You know sometimes he walks four hours together", created_at:"1609-07-20T18:26:43-07:00", updated_at:"1609-07-20T18:26:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Here in the lobby.", created_at:"1609-07-20T18:26:52-07:00", updated_at:"1609-07-20T18:26:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "So he does indeed.", created_at:"1609-07-20T18:52:49-07:00", updated_at:"1609-07-20T18:52:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "At such a time I’ll loose my daughter to him.", created_at:"1609-07-20T18:59:36-07:00", updated_at:"1609-07-20T18:59:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Be you and I behind an arras then.", created_at:"1609-07-20T19:09:16-07:00", updated_at:"1609-07-20T19:09:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Mark the encounter. If he love her not,", created_at:"1609-07-20T19:27:58-07:00", updated_at:"1609-07-20T19:27:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "And be not from his reason fall’n thereon,", created_at:"1609-07-20T20:03:54-07:00", updated_at:"1609-07-20T20:03:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "Let me be no assistant for a state,", created_at:"1609-07-20T20:18:23-07:00", updated_at:"1609-07-20T20:18:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "But keep a farm and carters.", created_at:"1609-07-20T20:35:58-07:00", updated_at:"1609-07-20T20:35:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_17.id, body: "We will try it.", created_at:"1609-07-20T20:56:58-07:00", updated_at:"1609-07-20T20:56:58-07:00"})
