Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_20.id, body: "But look where sadly the poor wretch comes", created_at:"1609-07-20T21:10:18-07:00", updated_at:"1609-07-20T21:10:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_20.id, body: "reading.", created_at:"1609-07-20T21:11:57-07:00", updated_at:"1609-07-20T21:11:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_20.id, body: "Away, I do beseech you both, away.", created_at:"1609-07-20T21:18:56-07:00", updated_at:"1609-07-20T21:18:56-07:00"})
