Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "How does my good Lord Hamlet?", created_at:"1609-07-20T21:58:53-07:00", updated_at:"1609-07-20T21:58:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Well, God-a-mercy.", created_at:"1609-07-20T22:19:29-07:00", updated_at:"1609-07-20T22:19:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Do you know me, my lord?", created_at:"1609-07-20T22:57:43-07:00", updated_at:"1609-07-20T22:57:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Excellent well. You are a fishmonger.", created_at:"1609-07-20T23:08:57-07:00", updated_at:"1609-07-20T23:08:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Not I, my lord.", created_at:"1609-07-20T23:38:50-07:00", updated_at:"1609-07-20T23:38:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Then I would you were so honest a man.", created_at:"1609-07-21T00:02:00-07:00", updated_at:"1609-07-21T00:02:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Honest, my lord?", created_at:"1609-07-21T00:28:20-07:00", updated_at:"1609-07-21T00:28:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Ay, sir. To be honest, as this world goes, is to", created_at:"1609-07-21T01:03:54-07:00", updated_at:"1609-07-21T01:03:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "be one man picked out of ten thousand.", created_at:"1609-07-21T01:28:06-07:00", updated_at:"1609-07-21T01:28:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "That’s very true, my lord.", created_at:"1609-07-21T01:46:41-07:00", updated_at:"1609-07-21T01:46:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "For if the sun breed maggots in a dead", created_at:"1609-07-21T02:01:17-07:00", updated_at:"1609-07-21T02:01:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "dog, being a good kissing carrion—Have you a", created_at:"1609-07-21T02:16:15-07:00", updated_at:"1609-07-21T02:16:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "daughter?", created_at:"1609-07-21T02:34:18-07:00", updated_at:"1609-07-21T02:34:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "I have, my lord.", created_at:"1609-07-21T03:00:54-07:00", updated_at:"1609-07-21T03:00:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Let her not walk i’ th’ sun. Conception is a", created_at:"1609-07-21T03:12:58-07:00", updated_at:"1609-07-21T03:12:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "blessing, but, as your daughter may conceive,", created_at:"1609-07-21T03:51:03-07:00", updated_at:"1609-07-21T03:51:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "friend, look to ’t.", created_at:"1609-07-21T04:07:28-07:00", updated_at:"1609-07-21T04:07:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "How say you by that? Still harping on", created_at:"1609-07-21T04:23:14-07:00", updated_at:"1609-07-21T04:23:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "my daughter. Yet he knew me not at first; he said I", created_at:"1609-07-21T04:50:56-07:00", updated_at:"1609-07-21T04:50:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "was a fishmonger. He is far gone. And truly, in my", created_at:"1609-07-21T04:53:28-07:00", updated_at:"1609-07-21T04:53:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "youth, I suffered much extremity for love, very near", created_at:"1609-07-21T05:23:23-07:00", updated_at:"1609-07-21T05:23:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "this. I’ll speak to him again.—What do you read, my", created_at:"1609-07-21T05:49:26-07:00", updated_at:"1609-07-21T05:49:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "lord?", created_at:"1609-07-21T06:02:06-07:00", updated_at:"1609-07-21T06:02:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Words, words, words.", created_at:"1609-07-21T06:39:07-07:00", updated_at:"1609-07-21T06:39:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "What is the matter, my lord?", created_at:"1609-07-21T06:58:34-07:00", updated_at:"1609-07-21T06:58:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Between who?", created_at:"1609-07-21T07:21:26-07:00", updated_at:"1609-07-21T07:21:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "I mean the matter that you read, my lord.", created_at:"1609-07-21T07:48:53-07:00", updated_at:"1609-07-21T07:48:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Slanders, sir; for the satirical rogue says here", created_at:"1609-07-21T08:05:08-07:00", updated_at:"1609-07-21T08:05:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "that old men have gray beards, that their faces are", created_at:"1609-07-21T08:32:04-07:00", updated_at:"1609-07-21T08:32:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "wrinkled, their eyes purging thick amber and", created_at:"1609-07-21T08:32:43-07:00", updated_at:"1609-07-21T08:32:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "plum-tree gum, and that they have a plentiful lack of", created_at:"1609-07-21T09:04:16-07:00", updated_at:"1609-07-21T09:04:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "wit, together with most weak hams; all which, sir,", created_at:"1609-07-21T09:12:09-07:00", updated_at:"1609-07-21T09:12:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "though I most powerfully and potently believe, yet I", created_at:"1609-07-21T09:44:43-07:00", updated_at:"1609-07-21T09:44:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "hold it not honesty to have it thus set down; for", created_at:"1609-07-21T10:13:10-07:00", updated_at:"1609-07-21T10:13:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "yourself, sir, shall grow old as I am, if, like a crab,", created_at:"1609-07-21T10:50:47-07:00", updated_at:"1609-07-21T10:50:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "you could go backward.", created_at:"1609-07-21T11:07:21-07:00", updated_at:"1609-07-21T11:07:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Though this be madness, yet there is", created_at:"1609-07-21T11:27:00-07:00", updated_at:"1609-07-21T11:27:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "method in ’t.—Will you walk out of the air, my lord?", created_at:"1609-07-21T11:47:50-07:00", updated_at:"1609-07-21T11:47:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Into my grave?", created_at:"1609-07-21T12:24:29-07:00", updated_at:"1609-07-21T12:24:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Indeed, that’s out of the air. How", created_at:"1609-07-21T12:46:06-07:00", updated_at:"1609-07-21T12:46:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "pregnant sometimes his replies are! A happiness", created_at:"1609-07-21T13:15:02-07:00", updated_at:"1609-07-21T13:15:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "that often madness hits on, which reason and", created_at:"1609-07-21T13:44:47-07:00", updated_at:"1609-07-21T13:44:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "sanity could not so prosperously be delivered of. I", created_at:"1609-07-21T14:04:20-07:00", updated_at:"1609-07-21T14:04:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "will leave him and suddenly contrive the means of", created_at:"1609-07-21T14:06:10-07:00", updated_at:"1609-07-21T14:06:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "meeting between him and my daughter.—My lord,", created_at:"1609-07-21T14:23:52-07:00", updated_at:"1609-07-21T14:23:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "I will take my leave of you.", created_at:"1609-07-21T14:24:02-07:00", updated_at:"1609-07-21T14:24:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "You cannot, sir, take from me anything that I", created_at:"1609-07-21T14:56:29-07:00", updated_at:"1609-07-21T14:56:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "will more willingly part withal—except my life,", created_at:"1609-07-21T15:02:39-07:00", updated_at:"1609-07-21T15:02:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "except my life, except my life.", created_at:"1609-07-21T15:30:18-07:00", updated_at:"1609-07-21T15:30:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "Fare you well, my lord.", created_at:"1609-07-21T16:01:33-07:00", updated_at:"1609-07-21T16:01:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_21.id, body: "These tedious old fools.", created_at:"1609-07-21T16:23:02-07:00", updated_at:"1609-07-21T16:23:02-07:00"})
