Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_23.id, body: "My honored lord.", created_at:"1609-07-21T17:27:33-07:00", updated_at:"1609-07-21T17:27:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_23.id, body: "My most dear lord.", created_at:"1609-07-21T17:42:26-07:00", updated_at:"1609-07-21T17:42:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_23.id, body: "My excellent good friends! How dost thou,", created_at:"1609-07-21T18:20:34-07:00", updated_at:"1609-07-21T18:20:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_23.id, body: "Guildenstern? Ah, Rosencrantz! Good lads, how do", created_at:"1609-07-21T18:37:36-07:00", updated_at:"1609-07-21T18:37:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_23.id, body: "you both?", created_at:"1609-07-21T19:04:57-07:00", updated_at:"1609-07-21T19:04:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_23.id, body: "As the indifferent children of the earth.", created_at:"1609-07-21T19:06:47-07:00", updated_at:"1609-07-21T19:06:47-07:00"})
