Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "more handsome than fine. One speech in ’t I", created_at:"1609-07-24T22:18:27-07:00", updated_at:"1609-07-24T22:18:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "chiefly loved. ’Twas Aeneas’ tale to Dido, and", created_at:"1609-07-24T22:28:24-07:00", updated_at:"1609-07-24T22:28:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "thereabout of it especially when he speaks of", created_at:"1609-07-24T22:31:10-07:00", updated_at:"1609-07-24T22:31:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Priam’s slaughter. If it live in your memory, begin at", created_at:"1609-07-24T22:38:31-07:00", updated_at:"1609-07-24T22:38:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "this line—let me see, let me see:", created_at:"1609-07-24T23:10:37-07:00", updated_at:"1609-07-24T23:10:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "The rugged Pyrrhus, like th’ Hyrcanian beast—", created_at:"1609-07-24T23:46:46-07:00", updated_at:"1609-07-24T23:46:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "’tis not so; it begins with Pyrrhus:", created_at:"1609-07-25T00:18:45-07:00", updated_at:"1609-07-25T00:18:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "The rugged Pyrrhus, he whose sable arms,", created_at:"1609-07-25T00:48:20-07:00", updated_at:"1609-07-25T00:48:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Black as his purpose, did the night resemble", created_at:"1609-07-25T01:03:22-07:00", updated_at:"1609-07-25T01:03:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "When he lay couchèd in th’ ominous horse,", created_at:"1609-07-25T01:19:17-07:00", updated_at:"1609-07-25T01:19:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Hath now this dread and black complexion smeared", created_at:"1609-07-25T01:49:21-07:00", updated_at:"1609-07-25T01:49:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "With heraldry more dismal. Head to foot,", created_at:"1609-07-25T02:10:36-07:00", updated_at:"1609-07-25T02:10:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Now is he total gules, horridly tricked", created_at:"1609-07-25T02:19:39-07:00", updated_at:"1609-07-25T02:19:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "With blood of fathers, mothers, daughters, sons,", created_at:"1609-07-25T02:52:58-07:00", updated_at:"1609-07-25T02:52:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Baked and impasted with the parching streets,", created_at:"1609-07-25T02:54:16-07:00", updated_at:"1609-07-25T02:54:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "That lend a tyrannous and a damnèd light", created_at:"1609-07-25T03:16:16-07:00", updated_at:"1609-07-25T03:16:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "To their lord’s murder. Roasted in wrath and fire,", created_at:"1609-07-25T03:29:10-07:00", updated_at:"1609-07-25T03:29:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "And thus o’ersizèd with coagulate gore,", created_at:"1609-07-25T04:02:33-07:00", updated_at:"1609-07-25T04:02:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "With eyes like carbuncles, the hellish Pyrrhus", created_at:"1609-07-25T04:05:47-07:00", updated_at:"1609-07-25T04:05:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Old grandsire Priam seeks.", created_at:"1609-07-25T04:11:18-07:00", updated_at:"1609-07-25T04:11:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "So, proceed you.", created_at:"1609-07-25T04:50:53-07:00", updated_at:"1609-07-25T04:50:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "’Fore God, my lord, well spoken, with good", created_at:"1609-07-25T04:55:37-07:00", updated_at:"1609-07-25T04:55:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "accent and good discretion.", created_at:"1609-07-25T05:20:30-07:00", updated_at:"1609-07-25T05:20:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Anon he finds him", created_at:"1609-07-25T05:27:53-07:00", updated_at:"1609-07-25T05:27:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Striking too short at Greeks. His antique sword,", created_at:"1609-07-25T06:05:30-07:00", updated_at:"1609-07-25T06:05:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Rebellious to his arm, lies where it falls,", created_at:"1609-07-25T06:19:49-07:00", updated_at:"1609-07-25T06:19:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Repugnant to command. Unequal matched,", created_at:"1609-07-25T06:42:06-07:00", updated_at:"1609-07-25T06:42:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Pyrrhus at Priam drives, in rage strikes wide;", created_at:"1609-07-25T06:47:27-07:00", updated_at:"1609-07-25T06:47:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "But with the whiff and wind of his fell sword", created_at:"1609-07-25T07:25:22-07:00", updated_at:"1609-07-25T07:25:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Th’ unnervèd father falls. Then senseless Ilium,", created_at:"1609-07-25T08:03:30-07:00", updated_at:"1609-07-25T08:03:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Seeming to feel this blow, with flaming top", created_at:"1609-07-25T08:18:24-07:00", updated_at:"1609-07-25T08:18:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Stoops to his base, and with a hideous crash", created_at:"1609-07-25T08:34:17-07:00", updated_at:"1609-07-25T08:34:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Takes prisoner Pyrrhus’ ear. For lo, his sword,", created_at:"1609-07-25T08:40:26-07:00", updated_at:"1609-07-25T08:40:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Which was declining on the milky head", created_at:"1609-07-25T09:05:33-07:00", updated_at:"1609-07-25T09:05:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Of reverend Priam, seemed i’ th’ air to stick.", created_at:"1609-07-25T09:39:48-07:00", updated_at:"1609-07-25T09:39:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "So as a painted tyrant Pyrrhus stood", created_at:"1609-07-25T10:11:27-07:00", updated_at:"1609-07-25T10:11:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "And, like a neutral to his will and matter,", created_at:"1609-07-25T10:40:57-07:00", updated_at:"1609-07-25T10:40:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Did nothing.", created_at:"1609-07-25T11:00:59-07:00", updated_at:"1609-07-25T11:00:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "But as we often see against some storm", created_at:"1609-07-25T11:25:05-07:00", updated_at:"1609-07-25T11:25:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "A silence in the heavens, the rack stand still,", created_at:"1609-07-25T11:56:29-07:00", updated_at:"1609-07-25T11:56:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "The bold winds speechless, and the orb below", created_at:"1609-07-25T12:33:50-07:00", updated_at:"1609-07-25T12:33:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "As hush as death, anon the dreadful thunder", created_at:"1609-07-25T13:00:50-07:00", updated_at:"1609-07-25T13:00:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Doth rend the region; so, after Pyrrhus’ pause,", created_at:"1609-07-25T13:12:26-07:00", updated_at:"1609-07-25T13:12:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Arousèd vengeance sets him new a-work,", created_at:"1609-07-25T13:36:15-07:00", updated_at:"1609-07-25T13:36:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "And never did the Cyclops’ hammers fall", created_at:"1609-07-25T13:54:48-07:00", updated_at:"1609-07-25T13:54:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "On Mars’s armor, forged for proof eterne,", created_at:"1609-07-25T14:13:11-07:00", updated_at:"1609-07-25T14:13:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "With less remorse than Pyrrhus’ bleeding sword", created_at:"1609-07-25T14:49:31-07:00", updated_at:"1609-07-25T14:49:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Now falls on Priam.", created_at:"1609-07-25T14:53:29-07:00", updated_at:"1609-07-25T14:53:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Out, out, thou strumpet Fortune! All you gods", created_at:"1609-07-25T15:08:36-07:00", updated_at:"1609-07-25T15:08:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "In general synod take away her power,", created_at:"1609-07-25T15:31:54-07:00", updated_at:"1609-07-25T15:31:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Break all the spokes and fellies from her wheel,", created_at:"1609-07-25T15:35:21-07:00", updated_at:"1609-07-25T15:35:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "And bowl the round nave down the hill of heaven", created_at:"1609-07-25T16:10:09-07:00", updated_at:"1609-07-25T16:10:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "As low as to the fiends!", created_at:"1609-07-25T16:44:20-07:00", updated_at:"1609-07-25T16:44:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "This is too long.", created_at:"1609-07-25T16:44:32-07:00", updated_at:"1609-07-25T16:44:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "It shall to the barber’s with your beard.—", created_at:"1609-07-25T16:56:36-07:00", updated_at:"1609-07-25T16:56:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Prithee say on. He’s for a jig or a tale of bawdry, or", created_at:"1609-07-25T17:29:32-07:00", updated_at:"1609-07-25T17:29:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "he sleeps. Say on; come to Hecuba.", created_at:"1609-07-25T17:49:51-07:00", updated_at:"1609-07-25T17:49:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "But who, ah woe, had seen the moblèd queen—", created_at:"1609-07-25T18:20:36-07:00", updated_at:"1609-07-25T18:20:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "The moblèd queen?", created_at:"1609-07-25T18:39:29-07:00", updated_at:"1609-07-25T18:39:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "That’s good. Moblèd queen is good.", created_at:"1609-07-25T19:07:48-07:00", updated_at:"1609-07-25T19:07:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Run barefoot up and down, threat’ning the flames", created_at:"1609-07-25T19:13:11-07:00", updated_at:"1609-07-25T19:13:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "With bisson rheum, a clout upon that head", created_at:"1609-07-25T19:27:32-07:00", updated_at:"1609-07-25T19:27:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Where late the diadem stood, and for a robe,", created_at:"1609-07-25T19:39:53-07:00", updated_at:"1609-07-25T19:39:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "About her lank and all o’erteemèd loins", created_at:"1609-07-25T19:54:49-07:00", updated_at:"1609-07-25T19:54:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "A blanket, in the alarm of fear caught up—", created_at:"1609-07-25T20:12:13-07:00", updated_at:"1609-07-25T20:12:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Who this had seen, with tongue in venom steeped,", created_at:"1609-07-25T20:23:05-07:00", updated_at:"1609-07-25T20:23:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "’Gainst Fortune’s state would treason have", created_at:"1609-07-25T20:41:18-07:00", updated_at:"1609-07-25T20:41:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "pronounced.", created_at:"1609-07-25T21:00:50-07:00", updated_at:"1609-07-25T21:00:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "But if the gods themselves did see her then", created_at:"1609-07-25T21:08:16-07:00", updated_at:"1609-07-25T21:08:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "When she saw Pyrrhus make malicious sport", created_at:"1609-07-25T21:11:01-07:00", updated_at:"1609-07-25T21:11:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "In mincing with his sword her husband’s limbs,", created_at:"1609-07-25T21:19:35-07:00", updated_at:"1609-07-25T21:19:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "The instant burst of clamor that she made", created_at:"1609-07-25T21:46:38-07:00", updated_at:"1609-07-25T21:46:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "(Unless things mortal move them not at all)", created_at:"1609-07-25T22:13:05-07:00", updated_at:"1609-07-25T22:13:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Would have made milch the burning eyes of heaven", created_at:"1609-07-25T22:36:00-07:00", updated_at:"1609-07-25T22:36:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "PLAYERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "And passion in the gods.", created_at:"1609-07-25T22:50:32-07:00", updated_at:"1609-07-25T22:50:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "Look whe’er he has not turned his color and", created_at:"1609-07-25T23:20:43-07:00", updated_at:"1609-07-25T23:20:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_24.id, body: "has tears in ’s eyes. Prithee, no more.", created_at:"1609-07-25T23:42:15-07:00", updated_at:"1609-07-25T23:42:15-07:00"})
