Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That guilty creatures sitting at a play", created_at:"1609-07-26T23:51:34-07:00", updated_at:"1609-07-26T23:51:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Have, by the very cunning of the scene,", created_at:"1609-07-27T00:14:47-07:00", updated_at:"1609-07-27T00:14:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Been struck so to the soul that presently", created_at:"1609-07-27T00:51:48-07:00", updated_at:"1609-07-27T00:51:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "They have proclaimed their malefactions;", created_at:"1609-07-27T01:18:27-07:00", updated_at:"1609-07-27T01:18:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "For murder, though it have no tongue, will speak", created_at:"1609-07-27T01:51:19-07:00", updated_at:"1609-07-27T01:51:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "With most miraculous organ. I’ll have these players", created_at:"1609-07-27T02:15:21-07:00", updated_at:"1609-07-27T02:15:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Play something like the murder of my father", created_at:"1609-07-27T02:48:14-07:00", updated_at:"1609-07-27T02:48:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Before mine uncle. I’ll observe his looks;", created_at:"1609-07-27T02:49:21-07:00", updated_at:"1609-07-27T02:49:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "I’ll tent him to the quick. If he do blench,", created_at:"1609-07-27T02:55:43-07:00", updated_at:"1609-07-27T02:55:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "I know my course. The spirit that I have seen", created_at:"1609-07-27T02:59:38-07:00", updated_at:"1609-07-27T02:59:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "May be a devil, and the devil hath power", created_at:"1609-07-27T03:33:01-07:00", updated_at:"1609-07-27T03:33:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "T’ assume a pleasing shape; yea, and perhaps,", created_at:"1609-07-27T04:06:34-07:00", updated_at:"1609-07-27T04:06:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Out of my weakness and my melancholy,", created_at:"1609-07-27T04:26:11-07:00", updated_at:"1609-07-27T04:26:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "As he is very potent with such spirits,", created_at:"1609-07-27T04:55:40-07:00", updated_at:"1609-07-27T04:55:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Abuses me to damn me. I’ll have grounds", created_at:"1609-07-27T05:18:08-07:00", updated_at:"1609-07-27T05:18:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "More relative than this. The play’s the thing", created_at:"1609-07-27T05:19:46-07:00", updated_at:"1609-07-27T05:19:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Wherein I’ll catch the conscience of the King.", created_at:"1609-07-27T05:54:39-07:00", updated_at:"1609-07-27T05:54:39-07:00"})
