DirectMessageParticipant.create!({direct_message_id: direct_message_26.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Rosencrantz@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_26.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "And can you by no drift of conference", created_at:"1609-07-27T06:07:25-07:00", updated_at:"1609-07-27T06:07:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Get from him why he puts on this confusion,", created_at:"1609-07-27T06:14:50-07:00", updated_at:"1609-07-27T06:14:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Grating so harshly all his days of quiet", created_at:"1609-07-27T06:46:21-07:00", updated_at:"1609-07-27T06:46:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "With turbulent and dangerous lunacy?", created_at:"1609-07-27T07:13:52-07:00", updated_at:"1609-07-27T07:13:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "He does confess he feels himself distracted,", created_at:"1609-07-27T07:30:13-07:00", updated_at:"1609-07-27T07:30:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "But from what cause he will by no means speak.", created_at:"1609-07-27T08:08:06-07:00", updated_at:"1609-07-27T08:08:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Nor do we find him forward to be sounded,", created_at:"1609-07-27T08:34:19-07:00", updated_at:"1609-07-27T08:34:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "But with a crafty madness keeps aloof", created_at:"1609-07-27T08:39:17-07:00", updated_at:"1609-07-27T08:39:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "When we would bring him on to some confession", created_at:"1609-07-27T08:56:19-07:00", updated_at:"1609-07-27T08:56:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Of his true state.", created_at:"1609-07-27T08:59:39-07:00", updated_at:"1609-07-27T08:59:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Did he receive you well?", created_at:"1609-07-27T09:39:24-07:00", updated_at:"1609-07-27T09:39:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Most like a gentleman.", created_at:"1609-07-27T09:43:00-07:00", updated_at:"1609-07-27T09:43:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "But with much forcing of his disposition.", created_at:"1609-07-27T10:10:34-07:00", updated_at:"1609-07-27T10:10:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Niggard of question, but of our demands", created_at:"1609-07-27T10:14:05-07:00", updated_at:"1609-07-27T10:14:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Most free in his reply.", created_at:"1609-07-27T10:37:59-07:00", updated_at:"1609-07-27T10:37:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Did you assay him to any pastime?", created_at:"1609-07-27T10:56:59-07:00", updated_at:"1609-07-27T10:56:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Madam, it so fell out that certain players", created_at:"1609-07-27T11:00:46-07:00", updated_at:"1609-07-27T11:00:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "We o’erraught on the way. Of these we told him,", created_at:"1609-07-27T11:37:18-07:00", updated_at:"1609-07-27T11:37:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "And there did seem in him a kind of joy", created_at:"1609-07-27T11:57:54-07:00", updated_at:"1609-07-27T11:57:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "To hear of it. They are here about the court,", created_at:"1609-07-27T12:25:41-07:00", updated_at:"1609-07-27T12:25:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "And, as I think, they have already order", created_at:"1609-07-27T12:26:29-07:00", updated_at:"1609-07-27T12:26:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "This night to play before him.", created_at:"1609-07-27T12:54:28-07:00", updated_at:"1609-07-27T12:54:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "’Tis most true,", created_at:"1609-07-27T13:04:41-07:00", updated_at:"1609-07-27T13:04:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "And he beseeched me to entreat your Majesties", created_at:"1609-07-27T13:25:00-07:00", updated_at:"1609-07-27T13:25:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "To hear and see the matter.", created_at:"1609-07-27T13:48:32-07:00", updated_at:"1609-07-27T13:48:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "With all my heart, and it doth much content me", created_at:"1609-07-27T13:49:36-07:00", updated_at:"1609-07-27T13:49:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "To hear him so inclined.", created_at:"1609-07-27T14:05:44-07:00", updated_at:"1609-07-27T14:05:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "Good gentlemen, give him a further edge", created_at:"1609-07-27T14:26:01-07:00", updated_at:"1609-07-27T14:26:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "And drive his purpose into these delights.", created_at:"1609-07-27T15:05:20-07:00", updated_at:"1609-07-27T15:05:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_26.id, body: "We shall, my lord.", created_at:"1609-07-27T15:27:08-07:00", updated_at:"1609-07-27T15:27:08-07:00"})
