DirectMessageParticipant.create!({direct_message_id: direct_message_27.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Sweet Gertrude, leave us too,", created_at:"1609-07-27T15:29:14-07:00", updated_at:"1609-07-27T15:29:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "For we have closely sent for Hamlet hither,", created_at:"1609-07-27T15:29:30-07:00", updated_at:"1609-07-27T15:29:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "That he, as ’twere by accident, may here", created_at:"1609-07-27T16:02:35-07:00", updated_at:"1609-07-27T16:02:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Affront Ophelia.", created_at:"1609-07-27T16:16:50-07:00", updated_at:"1609-07-27T16:16:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Her father and myself, lawful espials,", created_at:"1609-07-27T16:29:33-07:00", updated_at:"1609-07-27T16:29:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Will so bestow ourselves that, seeing unseen,", created_at:"1609-07-27T16:30:19-07:00", updated_at:"1609-07-27T16:30:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "We may of their encounter frankly judge", created_at:"1609-07-27T16:52:17-07:00", updated_at:"1609-07-27T16:52:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "And gather by him, as he is behaved,", created_at:"1609-07-27T17:07:11-07:00", updated_at:"1609-07-27T17:07:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "If ’t be th’ affliction of his love or no", created_at:"1609-07-27T17:08:53-07:00", updated_at:"1609-07-27T17:08:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "That thus he suffers for.", created_at:"1609-07-27T17:48:34-07:00", updated_at:"1609-07-27T17:48:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "I shall obey you.", created_at:"1609-07-27T18:21:19-07:00", updated_at:"1609-07-27T18:21:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "And for your part, Ophelia, I do wish", created_at:"1609-07-27T18:51:55-07:00", updated_at:"1609-07-27T18:51:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "That your good beauties be the happy cause", created_at:"1609-07-27T19:02:41-07:00", updated_at:"1609-07-27T19:02:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Of Hamlet’s wildness. So shall I hope your virtues", created_at:"1609-07-27T19:26:04-07:00", updated_at:"1609-07-27T19:26:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Will bring him to his wonted way again,", created_at:"1609-07-27T19:32:52-07:00", updated_at:"1609-07-27T19:32:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "To both your honors.", created_at:"1609-07-27T19:40:01-07:00", updated_at:"1609-07-27T19:40:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_27.id, body: "Madam, I wish it may.", created_at:"1609-07-27T19:41:01-07:00", updated_at:"1609-07-27T19:41:01-07:00"})
