Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Ophelia, walk you here.—Gracious, so please you,", created_at:"1609-07-27T19:53:47-07:00", updated_at:"1609-07-27T19:53:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "We will bestow ourselves. Read on this", created_at:"1609-07-27T19:58:45-07:00", updated_at:"1609-07-27T19:58:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "book,", created_at:"1609-07-27T19:59:52-07:00", updated_at:"1609-07-27T19:59:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "That show of such an exercise may color", created_at:"1609-07-27T20:17:24-07:00", updated_at:"1609-07-27T20:17:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Your loneliness.—We are oft to blame in this", created_at:"1609-07-27T20:42:16-07:00", updated_at:"1609-07-27T20:42:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "(’Tis too much proved), that with devotion’s visage", created_at:"1609-07-27T21:03:22-07:00", updated_at:"1609-07-27T21:03:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "And pious action we do sugar o’er", created_at:"1609-07-27T21:23:33-07:00", updated_at:"1609-07-27T21:23:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "The devil himself.", created_at:"1609-07-27T21:56:13-07:00", updated_at:"1609-07-27T21:56:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "O, ’tis too true!", created_at:"1609-07-27T22:27:32-07:00", updated_at:"1609-07-27T22:27:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "How smart a lash that speech doth give my", created_at:"1609-07-27T23:04:50-07:00", updated_at:"1609-07-27T23:04:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "conscience.", created_at:"1609-07-27T23:12:19-07:00", updated_at:"1609-07-27T23:12:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "The harlot’s cheek beautied with plast’ring art", created_at:"1609-07-27T23:26:14-07:00", updated_at:"1609-07-27T23:26:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Is not more ugly to the thing that helps it", created_at:"1609-07-27T23:48:53-07:00", updated_at:"1609-07-27T23:48:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Than is my deed to my most painted word.", created_at:"1609-07-28T00:02:29-07:00", updated_at:"1609-07-28T00:02:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "O heavy burden!", created_at:"1609-07-28T00:10:05-07:00", updated_at:"1609-07-28T00:10:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "I hear him coming. Let’s withdraw, my lord.", created_at:"1609-07-28T00:23:30-07:00", updated_at:"1609-07-28T00:23:30-07:00"})
