Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "To be or not to be—that is the question:", created_at:"1609-07-28T00:35:51-07:00", updated_at:"1609-07-28T00:35:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Whether ’tis nobler in the mind to suffer", created_at:"1609-07-28T01:11:36-07:00", updated_at:"1609-07-28T01:11:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "The slings and arrows of outrageous fortune,", created_at:"1609-07-28T01:49:25-07:00", updated_at:"1609-07-28T01:49:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Or to take arms against a sea of troubles", created_at:"1609-07-28T02:01:41-07:00", updated_at:"1609-07-28T02:01:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "And, by opposing, end them. To die, to sleep—", created_at:"1609-07-28T02:29:06-07:00", updated_at:"1609-07-28T02:29:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "No more—and by a sleep to say we end", created_at:"1609-07-28T02:52:20-07:00", updated_at:"1609-07-28T02:52:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "The heartache and the thousand natural shocks", created_at:"1609-07-28T03:05:04-07:00", updated_at:"1609-07-28T03:05:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "That flesh is heir to—’tis a consummation", created_at:"1609-07-28T03:37:00-07:00", updated_at:"1609-07-28T03:37:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Devoutly to be wished. To die, to sleep—", created_at:"1609-07-28T03:55:07-07:00", updated_at:"1609-07-28T03:55:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "To sleep, perchance to dream. Ay, there’s the rub,", created_at:"1609-07-28T04:22:45-07:00", updated_at:"1609-07-28T04:22:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "For in that sleep of death what dreams may come,", created_at:"1609-07-28T04:31:29-07:00", updated_at:"1609-07-28T04:31:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "When we have shuffled off this mortal coil,", created_at:"1609-07-28T04:51:24-07:00", updated_at:"1609-07-28T04:51:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Must give us pause. There’s the respect", created_at:"1609-07-28T05:23:55-07:00", updated_at:"1609-07-28T05:23:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "That makes calamity of so long life.", created_at:"1609-07-28T05:36:53-07:00", updated_at:"1609-07-28T05:36:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "For who would bear the whips and scorns of time,", created_at:"1609-07-28T05:38:56-07:00", updated_at:"1609-07-28T05:38:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Th’ oppressor’s wrong, the proud man’s contumely,", created_at:"1609-07-28T05:40:54-07:00", updated_at:"1609-07-28T05:40:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "The pangs of despised love, the law’s delay,", created_at:"1609-07-28T05:53:17-07:00", updated_at:"1609-07-28T05:53:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "The insolence of office, and the spurns", created_at:"1609-07-28T05:55:21-07:00", updated_at:"1609-07-28T05:55:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "That patient merit of th’ unworthy takes,", created_at:"1609-07-28T06:33:05-07:00", updated_at:"1609-07-28T06:33:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "When he himself might his quietus make", created_at:"1609-07-28T07:10:26-07:00", updated_at:"1609-07-28T07:10:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "With a bare bodkin? Who would fardels bear,", created_at:"1609-07-28T07:42:02-07:00", updated_at:"1609-07-28T07:42:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "To grunt and sweat under a weary life,", created_at:"1609-07-28T08:13:04-07:00", updated_at:"1609-07-28T08:13:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "But that the dread of something after death,", created_at:"1609-07-28T08:18:47-07:00", updated_at:"1609-07-28T08:18:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "The undiscovered country from whose bourn", created_at:"1609-07-28T08:28:33-07:00", updated_at:"1609-07-28T08:28:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "No traveler returns, puzzles the will", created_at:"1609-07-28T09:05:21-07:00", updated_at:"1609-07-28T09:05:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "And makes us rather bear those ills we have", created_at:"1609-07-28T09:35:21-07:00", updated_at:"1609-07-28T09:35:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Than fly to others that we know not of?", created_at:"1609-07-28T09:47:41-07:00", updated_at:"1609-07-28T09:47:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Thus conscience does make cowards of us all,", created_at:"1609-07-28T10:06:20-07:00", updated_at:"1609-07-28T10:06:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "And thus the native hue of resolution", created_at:"1609-07-28T10:35:26-07:00", updated_at:"1609-07-28T10:35:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Is sicklied o’er with the pale cast of thought,", created_at:"1609-07-28T11:12:05-07:00", updated_at:"1609-07-28T11:12:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "And enterprises of great pitch and moment", created_at:"1609-07-28T11:45:29-07:00", updated_at:"1609-07-28T11:45:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "With this regard their currents turn awry", created_at:"1609-07-28T11:49:35-07:00", updated_at:"1609-07-28T11:49:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "And lose the name of action.—Soft you now,", created_at:"1609-07-28T12:12:53-07:00", updated_at:"1609-07-28T12:12:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "The fair Ophelia.—Nymph, in thy orisons", created_at:"1609-07-28T12:15:09-07:00", updated_at:"1609-07-28T12:15:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Be all my sins remembered.", created_at:"1609-07-28T12:54:55-07:00", updated_at:"1609-07-28T12:54:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Good my lord,", created_at:"1609-07-28T13:15:38-07:00", updated_at:"1609-07-28T13:15:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "How does your Honor for this many a day?", created_at:"1609-07-28T13:17:30-07:00", updated_at:"1609-07-28T13:17:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "I humbly thank you, well.", created_at:"1609-07-28T13:47:00-07:00", updated_at:"1609-07-28T13:47:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "My lord, I have remembrances of yours", created_at:"1609-07-28T14:15:43-07:00", updated_at:"1609-07-28T14:15:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "That I have longèd long to redeliver.", created_at:"1609-07-28T14:49:06-07:00", updated_at:"1609-07-28T14:49:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "I pray you now receive them.", created_at:"1609-07-28T15:01:55-07:00", updated_at:"1609-07-28T15:01:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "No, not I. I never gave you aught.", created_at:"1609-07-28T15:06:39-07:00", updated_at:"1609-07-28T15:06:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "My honored lord, you know right well you did,", created_at:"1609-07-28T15:25:41-07:00", updated_at:"1609-07-28T15:25:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "And with them words of so sweet breath composed", created_at:"1609-07-28T15:28:49-07:00", updated_at:"1609-07-28T15:28:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "As made the things more rich. Their perfume", created_at:"1609-07-28T15:52:19-07:00", updated_at:"1609-07-28T15:52:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "lost,", created_at:"1609-07-28T16:30:06-07:00", updated_at:"1609-07-28T16:30:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Take these again, for to the noble mind", created_at:"1609-07-28T16:40:12-07:00", updated_at:"1609-07-28T16:40:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Rich gifts wax poor when givers prove unkind.", created_at:"1609-07-28T17:05:10-07:00", updated_at:"1609-07-28T17:05:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "There, my lord.", created_at:"1609-07-28T17:06:18-07:00", updated_at:"1609-07-28T17:06:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Ha, ha, are you honest?", created_at:"1609-07-28T17:29:35-07:00", updated_at:"1609-07-28T17:29:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "My lord?", created_at:"1609-07-28T17:35:31-07:00", updated_at:"1609-07-28T17:35:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Are you fair?", created_at:"1609-07-28T18:06:46-07:00", updated_at:"1609-07-28T18:06:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "What means your Lordship?", created_at:"1609-07-28T18:21:10-07:00", updated_at:"1609-07-28T18:21:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "That if you be honest and fair, your honesty", created_at:"1609-07-28T18:27:16-07:00", updated_at:"1609-07-28T18:27:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "should admit no discourse to your beauty.", created_at:"1609-07-28T18:42:01-07:00", updated_at:"1609-07-28T18:42:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Could beauty, my lord, have better commerce", created_at:"1609-07-28T19:09:53-07:00", updated_at:"1609-07-28T19:09:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "than with honesty?", created_at:"1609-07-28T19:31:45-07:00", updated_at:"1609-07-28T19:31:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Ay, truly, for the power of beauty will sooner", created_at:"1609-07-28T19:54:58-07:00", updated_at:"1609-07-28T19:54:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "transform honesty from what it is to a bawd than", created_at:"1609-07-28T20:27:30-07:00", updated_at:"1609-07-28T20:27:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "the force of honesty can translate beauty into his", created_at:"1609-07-28T20:48:30-07:00", updated_at:"1609-07-28T20:48:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "likeness. This was sometime a paradox, but now", created_at:"1609-07-28T21:10:23-07:00", updated_at:"1609-07-28T21:10:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "the time gives it proof. I did love you once.", created_at:"1609-07-28T21:38:47-07:00", updated_at:"1609-07-28T21:38:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Indeed, my lord, you made me believe so.", created_at:"1609-07-28T21:40:47-07:00", updated_at:"1609-07-28T21:40:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "You should not have believed me, for virtue", created_at:"1609-07-28T22:05:14-07:00", updated_at:"1609-07-28T22:05:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "cannot so inoculate our old stock but we shall", created_at:"1609-07-28T22:37:31-07:00", updated_at:"1609-07-28T22:37:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "relish of it. I loved you not.", created_at:"1609-07-28T23:10:01-07:00", updated_at:"1609-07-28T23:10:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "I was the more deceived.", created_at:"1609-07-28T23:13:58-07:00", updated_at:"1609-07-28T23:13:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Get thee to a nunnery. Why wouldst thou be", created_at:"1609-07-28T23:33:11-07:00", updated_at:"1609-07-28T23:33:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "a breeder of sinners? I am myself indifferent honest,", created_at:"1609-07-29T00:12:59-07:00", updated_at:"1609-07-29T00:12:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "but yet I could accuse me of such things that it", created_at:"1609-07-29T00:25:02-07:00", updated_at:"1609-07-29T00:25:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "were better my mother had not borne me: I am", created_at:"1609-07-29T00:35:38-07:00", updated_at:"1609-07-29T00:35:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "very proud, revengeful, ambitious, with more offenses", created_at:"1609-07-29T00:51:49-07:00", updated_at:"1609-07-29T00:51:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "at my beck than I have thoughts to put them", created_at:"1609-07-29T01:05:34-07:00", updated_at:"1609-07-29T01:05:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "in, imagination to give them shape, or time to act", created_at:"1609-07-29T01:09:43-07:00", updated_at:"1609-07-29T01:09:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "them in. What should such fellows as I do crawling", created_at:"1609-07-29T01:32:18-07:00", updated_at:"1609-07-29T01:32:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "between earth and heaven? We are arrant knaves", created_at:"1609-07-29T01:55:30-07:00", updated_at:"1609-07-29T01:55:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "all; believe none of us. Go thy ways to a nunnery.", created_at:"1609-07-29T02:31:29-07:00", updated_at:"1609-07-29T02:31:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Where’s your father?", created_at:"1609-07-29T02:57:23-07:00", updated_at:"1609-07-29T02:57:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "At home, my lord.", created_at:"1609-07-29T03:12:24-07:00", updated_at:"1609-07-29T03:12:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Let the doors be shut upon him that he may", created_at:"1609-07-29T03:38:04-07:00", updated_at:"1609-07-29T03:38:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "play the fool nowhere but in ’s own house. Farewell.", created_at:"1609-07-29T03:40:40-07:00", updated_at:"1609-07-29T03:40:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "O, help him, you sweet heavens!", created_at:"1609-07-29T04:04:13-07:00", updated_at:"1609-07-29T04:04:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "If thou dost marry, I’ll give thee this plague", created_at:"1609-07-29T04:19:55-07:00", updated_at:"1609-07-29T04:19:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "for thy dowry: be thou as chaste as ice, as pure as", created_at:"1609-07-29T04:58:14-07:00", updated_at:"1609-07-29T04:58:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "snow, thou shalt not escape calumny. Get thee to a", created_at:"1609-07-29T05:26:58-07:00", updated_at:"1609-07-29T05:26:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "nunnery, farewell. Or if thou wilt needs marry,", created_at:"1609-07-29T05:52:24-07:00", updated_at:"1609-07-29T05:52:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "marry a fool, for wise men know well enough what", created_at:"1609-07-29T05:56:38-07:00", updated_at:"1609-07-29T05:56:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "monsters you make of them. To a nunnery, go, and", created_at:"1609-07-29T05:57:48-07:00", updated_at:"1609-07-29T05:57:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "quickly too. Farewell.", created_at:"1609-07-29T06:37:09-07:00", updated_at:"1609-07-29T06:37:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "Heavenly powers, restore him!", created_at:"1609-07-29T07:15:16-07:00", updated_at:"1609-07-29T07:15:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "I have heard of your paintings too, well", created_at:"1609-07-29T07:44:00-07:00", updated_at:"1609-07-29T07:44:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "enough. God hath given you one face, and you", created_at:"1609-07-29T08:18:15-07:00", updated_at:"1609-07-29T08:18:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "make yourselves another. You jig and amble, and", created_at:"1609-07-29T08:22:16-07:00", updated_at:"1609-07-29T08:22:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "you lisp; you nickname God’s creatures and make", created_at:"1609-07-29T08:59:34-07:00", updated_at:"1609-07-29T08:59:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "your wantonness your ignorance. Go to, I’ll no", created_at:"1609-07-29T09:15:53-07:00", updated_at:"1609-07-29T09:15:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "more on ’t. It hath made me mad. I say we will have", created_at:"1609-07-29T09:36:41-07:00", updated_at:"1609-07-29T09:36:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "no more marriage. Those that are married already,", created_at:"1609-07-29T09:46:18-07:00", updated_at:"1609-07-29T09:46:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "all but one, shall live. The rest shall keep as they are.", created_at:"1609-07-29T09:58:31-07:00", updated_at:"1609-07-29T09:58:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_29.id, body: "To a nunnery, go.", created_at:"1609-07-29T10:33:26-07:00", updated_at:"1609-07-29T10:33:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "O, what a noble mind is here o’erthrown!", created_at:"1609-07-29T10:56:02-07:00", updated_at:"1609-07-29T10:56:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "The courtier’s, soldier’s, scholar’s, eye, tongue,", created_at:"1609-07-29T11:32:42-07:00", updated_at:"1609-07-29T11:32:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "sword,", created_at:"1609-07-29T11:49:06-07:00", updated_at:"1609-07-29T11:49:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Th’ expectancy and rose of the fair state,", created_at:"1609-07-29T11:54:09-07:00", updated_at:"1609-07-29T11:54:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "The glass of fashion and the mold of form,", created_at:"1609-07-29T12:31:27-07:00", updated_at:"1609-07-29T12:31:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Th’ observed of all observers, quite, quite down!", created_at:"1609-07-29T12:51:40-07:00", updated_at:"1609-07-29T12:51:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "And I, of ladies most deject and wretched,", created_at:"1609-07-29T13:30:07-07:00", updated_at:"1609-07-29T13:30:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "That sucked the honey of his musicked vows,", created_at:"1609-07-29T13:38:03-07:00", updated_at:"1609-07-29T13:38:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Now see that noble and most sovereign reason,", created_at:"1609-07-29T14:05:19-07:00", updated_at:"1609-07-29T14:05:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Like sweet bells jangled, out of time and harsh;", created_at:"1609-07-29T14:25:31-07:00", updated_at:"1609-07-29T14:25:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "That unmatched form and stature of blown youth", created_at:"1609-07-29T14:26:56-07:00", updated_at:"1609-07-29T14:26:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Blasted with ecstasy. O, woe is me", created_at:"1609-07-29T14:42:18-07:00", updated_at:"1609-07-29T14:42:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "T’ have seen what I have seen, see what I see!", created_at:"1609-07-29T14:52:54-07:00", updated_at:"1609-07-29T14:52:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Love? His affections do not that way tend;", created_at:"1609-07-29T15:31:47-07:00", updated_at:"1609-07-29T15:31:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Nor what he spake, though it lacked form a little,", created_at:"1609-07-29T15:44:56-07:00", updated_at:"1609-07-29T15:44:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Was not like madness. There’s something in his soul", created_at:"1609-07-29T16:20:40-07:00", updated_at:"1609-07-29T16:20:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "O’er which his melancholy sits on brood,", created_at:"1609-07-29T16:48:49-07:00", updated_at:"1609-07-29T16:48:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "And I do doubt the hatch and the disclose", created_at:"1609-07-29T16:54:15-07:00", updated_at:"1609-07-29T16:54:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Will be some danger; which for to prevent,", created_at:"1609-07-29T17:27:15-07:00", updated_at:"1609-07-29T17:27:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "I have in quick determination", created_at:"1609-07-29T17:57:00-07:00", updated_at:"1609-07-29T17:57:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Thus set it down: he shall with speed to England", created_at:"1609-07-29T18:04:47-07:00", updated_at:"1609-07-29T18:04:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "For the demand of our neglected tribute.", created_at:"1609-07-29T18:07:56-07:00", updated_at:"1609-07-29T18:07:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Haply the seas, and countries different,", created_at:"1609-07-29T18:10:49-07:00", updated_at:"1609-07-29T18:10:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "With variable objects, shall expel", created_at:"1609-07-29T18:16:16-07:00", updated_at:"1609-07-29T18:16:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "This something-settled matter in his heart,", created_at:"1609-07-29T18:52:39-07:00", updated_at:"1609-07-29T18:52:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Whereon his brains still beating puts him thus", created_at:"1609-07-29T19:20:09-07:00", updated_at:"1609-07-29T19:20:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "From fashion of himself. What think you on ’t?", created_at:"1609-07-29T19:33:28-07:00", updated_at:"1609-07-29T19:33:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "It shall do well. But yet do I believe", created_at:"1609-07-29T20:12:52-07:00", updated_at:"1609-07-29T20:12:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "The origin and commencement of his grief", created_at:"1609-07-29T20:30:25-07:00", updated_at:"1609-07-29T20:30:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Sprung from neglected love.—How now, Ophelia?", created_at:"1609-07-29T20:37:41-07:00", updated_at:"1609-07-29T20:37:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "You need not tell us what Lord Hamlet said;", created_at:"1609-07-29T20:40:10-07:00", updated_at:"1609-07-29T20:40:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "We heard it all.—My lord, do as you please,", created_at:"1609-07-29T21:18:46-07:00", updated_at:"1609-07-29T21:18:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "But, if you hold it fit, after the play", created_at:"1609-07-29T21:34:47-07:00", updated_at:"1609-07-29T21:34:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "Let his queen-mother all alone entreat him", created_at:"1609-07-29T21:40:33-07:00", updated_at:"1609-07-29T21:40:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "To show his grief. Let her be round with him;", created_at:"1609-07-29T22:05:24-07:00", updated_at:"1609-07-29T22:05:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_28.id, body: "And I’ll be placed, so please you, in the ear", created_at:"1609-07-29T22:23:55-07:00", updated_at:"1609-07-29T22:23:55-07:00"})
