Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "With all the strength and armor of the mind", created_at:"1609-08-04T22:23:17-07:00", updated_at:"1609-08-04T22:23:17-07:00"})
