Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "That spirit upon whose weal depends and rests", created_at:"1609-08-04T23:27:12-07:00", updated_at:"1609-08-04T23:27:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "The lives of many. The cess of majesty", created_at:"1609-08-05T00:00:21-07:00", updated_at:"1609-08-05T00:00:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Dies not alone, but like a gulf doth draw", created_at:"1609-08-05T00:02:44-07:00", updated_at:"1609-08-05T00:02:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "What’s near it with it; or it is a massy wheel", created_at:"1609-08-05T00:35:08-07:00", updated_at:"1609-08-05T00:35:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Fixed on the summit of the highest mount,", created_at:"1609-08-05T00:42:21-07:00", updated_at:"1609-08-05T00:42:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "To whose huge spokes ten thousand lesser things", created_at:"1609-08-05T01:17:45-07:00", updated_at:"1609-08-05T01:17:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Are mortised and adjoined, which, when it falls,", created_at:"1609-08-05T01:55:37-07:00", updated_at:"1609-08-05T01:55:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Each small annexment, petty consequence,", created_at:"1609-08-05T02:32:21-07:00", updated_at:"1609-08-05T02:32:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Attends the boist’rous ruin. Never alone", created_at:"1609-08-05T03:10:16-07:00", updated_at:"1609-08-05T03:10:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Did the king sigh, but with a general groan.", created_at:"1609-08-05T03:21:17-07:00", updated_at:"1609-08-05T03:21:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Arm you, I pray you, to this speedy voyage,", created_at:"1609-08-05T03:29:24-07:00", updated_at:"1609-08-05T03:29:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "For we will fetters put about this fear,", created_at:"1609-08-05T03:56:18-07:00", updated_at:"1609-08-05T03:56:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "Which now goes too free-footed.", created_at:"1609-08-05T03:59:23-07:00", updated_at:"1609-08-05T03:59:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_40.id, body: "We will haste us.", created_at:"1609-08-05T04:31:56-07:00", updated_at:"1609-08-05T04:31:56-07:00"})
direct_message_41 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_41.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_41.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Polonius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_41.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "My lord, he’s going to his mother’s closet.", created_at:"1609-08-05T05:10:32-07:00", updated_at:"1609-08-05T05:10:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "Behind the arras I’ll convey myself", created_at:"1609-08-05T05:32:04-07:00", updated_at:"1609-08-05T05:32:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "To hear the process. I’ll warrant she’ll tax him", created_at:"1609-08-05T05:36:55-07:00", updated_at:"1609-08-05T05:36:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "home;", created_at:"1609-08-05T05:40:50-07:00", updated_at:"1609-08-05T05:40:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "And, as you said (and wisely was it said),", created_at:"1609-08-05T06:04:16-07:00", updated_at:"1609-08-05T06:04:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "’Tis meet that some more audience than a mother,", created_at:"1609-08-05T06:34:43-07:00", updated_at:"1609-08-05T06:34:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "Since nature makes them partial, should o’erhear", created_at:"1609-08-05T06:46:18-07:00", updated_at:"1609-08-05T06:46:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "The speech of vantage. Fare you well, my liege.", created_at:"1609-08-05T07:10:33-07:00", updated_at:"1609-08-05T07:10:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "I’ll call upon you ere you go to bed", created_at:"1609-08-05T07:10:48-07:00", updated_at:"1609-08-05T07:10:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "And tell you what I know.", created_at:"1609-08-05T07:19:09-07:00", updated_at:"1609-08-05T07:19:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_41.id, body: "Thanks, dear my lord.", created_at:"1609-08-05T07:49:00-07:00", updated_at:"1609-08-05T07:49:00-07:00"})
direct_message_42 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_42.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_42.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "O, my offense is rank, it smells to heaven;", created_at:"1609-08-05T07:53:32-07:00", updated_at:"1609-08-05T07:53:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "It hath the primal eldest curse upon ’t,", created_at:"1609-08-05T08:31:41-07:00", updated_at:"1609-08-05T08:31:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "A brother’s murder. Pray can I not,", created_at:"1609-08-05T08:42:37-07:00", updated_at:"1609-08-05T08:42:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Though inclination be as sharp as will.", created_at:"1609-08-05T09:17:36-07:00", updated_at:"1609-08-05T09:17:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "My stronger guilt defeats my strong intent,", created_at:"1609-08-05T09:31:32-07:00", updated_at:"1609-08-05T09:31:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "And, like a man to double business bound,", created_at:"1609-08-05T09:38:28-07:00", updated_at:"1609-08-05T09:38:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "I stand in pause where I shall first begin", created_at:"1609-08-05T09:59:52-07:00", updated_at:"1609-08-05T09:59:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "And both neglect. What if this cursèd hand", created_at:"1609-08-05T10:06:13-07:00", updated_at:"1609-08-05T10:06:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Were thicker than itself with brother’s blood?", created_at:"1609-08-05T10:15:15-07:00", updated_at:"1609-08-05T10:15:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Is there not rain enough in the sweet heavens", created_at:"1609-08-05T10:42:20-07:00", updated_at:"1609-08-05T10:42:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "To wash it white as snow? Whereto serves mercy", created_at:"1609-08-05T11:07:44-07:00", updated_at:"1609-08-05T11:07:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "But to confront the visage of offense?", created_at:"1609-08-05T11:20:28-07:00", updated_at:"1609-08-05T11:20:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "And what’s in prayer but this twofold force,", created_at:"1609-08-05T11:27:08-07:00", updated_at:"1609-08-05T11:27:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "To be forestallèd ere we come to fall,", created_at:"1609-08-05T11:52:14-07:00", updated_at:"1609-08-05T11:52:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Or pardoned being down? Then I’ll look up.", created_at:"1609-08-05T12:32:13-07:00", updated_at:"1609-08-05T12:32:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "My fault is past. But, O, what form of prayer", created_at:"1609-08-05T12:46:32-07:00", updated_at:"1609-08-05T12:46:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Can serve my turn? Forgive me my foul murder?", created_at:"1609-08-05T13:25:26-07:00", updated_at:"1609-08-05T13:25:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "That cannot be, since I am still possessed", created_at:"1609-08-05T13:56:29-07:00", updated_at:"1609-08-05T13:56:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Of those effects for which I did the murder:", created_at:"1609-08-05T14:34:45-07:00", updated_at:"1609-08-05T14:34:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "My crown, mine own ambition, and my queen.", created_at:"1609-08-05T15:11:06-07:00", updated_at:"1609-08-05T15:11:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "May one be pardoned and retain th’ offense?", created_at:"1609-08-05T15:22:24-07:00", updated_at:"1609-08-05T15:22:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "In the corrupted currents of this world,", created_at:"1609-08-05T15:42:39-07:00", updated_at:"1609-08-05T15:42:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Offense’s gilded hand may shove by justice,", created_at:"1609-08-05T16:02:32-07:00", updated_at:"1609-08-05T16:02:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "And oft ’tis seen the wicked prize itself", created_at:"1609-08-05T16:19:40-07:00", updated_at:"1609-08-05T16:19:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Buys out the law. But ’tis not so above:", created_at:"1609-08-05T16:33:45-07:00", updated_at:"1609-08-05T16:33:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "There is no shuffling; there the action lies", created_at:"1609-08-05T16:56:12-07:00", updated_at:"1609-08-05T16:56:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "In his true nature, and we ourselves compelled,", created_at:"1609-08-05T17:24:50-07:00", updated_at:"1609-08-05T17:24:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Even to the teeth and forehead of our faults,", created_at:"1609-08-05T17:45:24-07:00", updated_at:"1609-08-05T17:45:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "To give in evidence. What then? What rests?", created_at:"1609-08-05T18:03:43-07:00", updated_at:"1609-08-05T18:03:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Try what repentance can. What can it not?", created_at:"1609-08-05T18:18:11-07:00", updated_at:"1609-08-05T18:18:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Yet what can it, when one cannot repent?", created_at:"1609-08-05T18:33:55-07:00", updated_at:"1609-08-05T18:33:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "O wretched state! O bosom black as death!", created_at:"1609-08-05T19:03:41-07:00", updated_at:"1609-08-05T19:03:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "O limèd soul, that, struggling to be free,", created_at:"1609-08-05T19:24:13-07:00", updated_at:"1609-08-05T19:24:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Art more engaged! Help, angels! Make assay.", created_at:"1609-08-05T19:52:49-07:00", updated_at:"1609-08-05T19:52:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Bow, stubborn knees, and heart with strings of steel", created_at:"1609-08-05T20:25:05-07:00", updated_at:"1609-08-05T20:25:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Be soft as sinews of the newborn babe.", created_at:"1609-08-05T20:32:36-07:00", updated_at:"1609-08-05T20:32:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "All may be well.", created_at:"1609-08-05T20:48:47-07:00", updated_at:"1609-08-05T20:48:47-07:00"})
direct_message_43 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_43.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_43.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Hamlet@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_43.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "Now might I do it pat, now he is a-praying,", created_at:"1609-08-05T21:03:32-07:00", updated_at:"1609-08-05T21:03:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "And now I’ll do ’t.", created_at:"1609-08-05T21:28:57-07:00", updated_at:"1609-08-05T21:28:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "And so he goes to heaven,", created_at:"1609-08-05T21:31:07-07:00", updated_at:"1609-08-05T21:31:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "And so am I revenged. That would be scanned:", created_at:"1609-08-05T21:37:00-07:00", updated_at:"1609-08-05T21:37:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "A villain kills my father, and for that,", created_at:"1609-08-05T22:12:55-07:00", updated_at:"1609-08-05T22:12:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "I, his sole son, do this same villain send", created_at:"1609-08-05T22:20:21-07:00", updated_at:"1609-08-05T22:20:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "To heaven.", created_at:"1609-08-05T22:29:05-07:00", updated_at:"1609-08-05T22:29:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "Why, this is hire and salary, not revenge.", created_at:"1609-08-05T22:50:52-07:00", updated_at:"1609-08-05T22:50:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "He took my father grossly, full of bread,", created_at:"1609-08-05T23:10:24-07:00", updated_at:"1609-08-05T23:10:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "With all his crimes broad blown, as flush as May;", created_at:"1609-08-05T23:49:23-07:00", updated_at:"1609-08-05T23:49:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "And how his audit stands who knows save heaven.", created_at:"1609-08-06T00:14:27-07:00", updated_at:"1609-08-06T00:14:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "But in our circumstance and course of thought", created_at:"1609-08-06T00:22:40-07:00", updated_at:"1609-08-06T00:22:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "’Tis heavy with him. And am I then revenged", created_at:"1609-08-06T01:01:00-07:00", updated_at:"1609-08-06T01:01:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "To take him in the purging of his soul,", created_at:"1609-08-06T01:06:48-07:00", updated_at:"1609-08-06T01:06:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "When he is fit and seasoned for his passage?", created_at:"1609-08-06T01:41:21-07:00", updated_at:"1609-08-06T01:41:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "No.", created_at:"1609-08-06T01:50:34-07:00", updated_at:"1609-08-06T01:50:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "Up sword, and know thou a more horrid hent.", created_at:"1609-08-06T02:05:04-07:00", updated_at:"1609-08-06T02:05:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "When he is drunk asleep, or in his rage,", created_at:"1609-08-06T02:13:03-07:00", updated_at:"1609-08-06T02:13:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "Or in th’ incestuous pleasure of his bed,", created_at:"1609-08-06T02:36:01-07:00", updated_at:"1609-08-06T02:36:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "At game, a-swearing, or about some act", created_at:"1609-08-06T02:43:32-07:00", updated_at:"1609-08-06T02:43:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "That has no relish of salvation in ’t—", created_at:"1609-08-06T02:51:50-07:00", updated_at:"1609-08-06T02:51:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "Then trip him, that his heels may kick at heaven,", created_at:"1609-08-06T03:08:28-07:00", updated_at:"1609-08-06T03:08:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "And that his soul may be as damned and black", created_at:"1609-08-06T03:42:21-07:00", updated_at:"1609-08-06T03:42:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "As hell, whereto it goes. My mother stays.", created_at:"1609-08-06T04:18:45-07:00", updated_at:"1609-08-06T04:18:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_43.id, body: "This physic but prolongs thy sickly days.", created_at:"1609-08-06T04:19:04-07:00", updated_at:"1609-08-06T04:19:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "My words fly up, my thoughts remain below;", created_at:"1609-08-06T04:56:33-07:00", updated_at:"1609-08-06T04:56:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Words without thoughts never to heaven go.", created_at:"1609-08-06T05:04:54-07:00", updated_at:"1609-08-06T05:04:54-07:00"})
