DirectMessageParticipant.create!({direct_message_id: direct_message_44.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Gertrude@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_44.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Polonius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_44.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "He will come straight. Look you lay home to him.", created_at:"1609-08-06T05:41:34-07:00", updated_at:"1609-08-06T05:41:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "Tell him his pranks have been too broad to bear", created_at:"1609-08-06T06:15:33-07:00", updated_at:"1609-08-06T06:15:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "with", created_at:"1609-08-06T06:30:43-07:00", updated_at:"1609-08-06T06:30:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "And that your Grace hath screened and stood", created_at:"1609-08-06T06:44:52-07:00", updated_at:"1609-08-06T06:44:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "between", created_at:"1609-08-06T06:55:08-07:00", updated_at:"1609-08-06T06:55:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "Much heat and him. I’ll silence me even here.", created_at:"1609-08-06T07:00:24-07:00", updated_at:"1609-08-06T07:00:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "Pray you, be round with him.", created_at:"1609-08-06T07:01:19-07:00", updated_at:"1609-08-06T07:01:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "I’ll warrant you. Fear me not. Withdraw,", created_at:"1609-08-06T07:05:38-07:00", updated_at:"1609-08-06T07:05:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_44.id, body: "I hear him coming.", created_at:"1609-08-06T07:39:33-07:00", updated_at:"1609-08-06T07:39:33-07:00"})
