DirectMessageParticipant.create!({direct_message_id: direct_message_45.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Polonius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_45.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Now, mother, what’s the matter?", created_at:"1609-08-06T08:16:39-07:00", updated_at:"1609-08-06T08:16:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Hamlet, thou hast thy father much offended.", created_at:"1609-08-06T08:18:21-07:00", updated_at:"1609-08-06T08:18:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Mother, you have my father much offended.", created_at:"1609-08-06T08:33:55-07:00", updated_at:"1609-08-06T08:33:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Come, come, you answer with an idle tongue.", created_at:"1609-08-06T08:41:04-07:00", updated_at:"1609-08-06T08:41:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Go, go, you question with a wicked tongue.", created_at:"1609-08-06T09:15:56-07:00", updated_at:"1609-08-06T09:15:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Why, how now, Hamlet?", created_at:"1609-08-06T09:54:02-07:00", updated_at:"1609-08-06T09:54:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "What’s the matter now?", created_at:"1609-08-06T10:26:32-07:00", updated_at:"1609-08-06T10:26:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Have you forgot me?", created_at:"1609-08-06T11:01:48-07:00", updated_at:"1609-08-06T11:01:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "No, by the rood, not so.", created_at:"1609-08-06T11:35:47-07:00", updated_at:"1609-08-06T11:35:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "You are the Queen, your husband’s brother’s wife,", created_at:"1609-08-06T11:38:28-07:00", updated_at:"1609-08-06T11:38:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And (would it were not so) you are my mother.", created_at:"1609-08-06T11:44:39-07:00", updated_at:"1609-08-06T11:44:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Nay, then I’ll set those to you that can speak.", created_at:"1609-08-06T11:46:52-07:00", updated_at:"1609-08-06T11:46:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Come, come, and sit you down; you shall not budge.", created_at:"1609-08-06T11:54:51-07:00", updated_at:"1609-08-06T11:54:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "You go not till I set you up a glass", created_at:"1609-08-06T12:17:33-07:00", updated_at:"1609-08-06T12:17:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Where you may see the inmost part of you.", created_at:"1609-08-06T12:45:33-07:00", updated_at:"1609-08-06T12:45:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "What wilt thou do? Thou wilt not murder me?", created_at:"1609-08-06T12:51:24-07:00", updated_at:"1609-08-06T12:51:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Help, ho!", created_at:"1609-08-06T13:18:44-07:00", updated_at:"1609-08-06T13:18:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "What ho! Help!", created_at:"1609-08-06T13:57:32-07:00", updated_at:"1609-08-06T13:57:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "How now, a rat? Dead for a ducat, dead.", created_at:"1609-08-06T14:09:10-07:00", updated_at:"1609-08-06T14:09:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Polonius"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O, I am slain!", created_at:"1609-08-06T14:39:27-07:00", updated_at:"1609-08-06T14:39:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O me, what hast thou done?", created_at:"1609-08-06T15:11:24-07:00", updated_at:"1609-08-06T15:11:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Nay, I know not. Is it the King?", created_at:"1609-08-06T15:20:32-07:00", updated_at:"1609-08-06T15:20:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O, what a rash and bloody deed is this!", created_at:"1609-08-06T15:31:27-07:00", updated_at:"1609-08-06T15:31:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A bloody deed—almost as bad, good mother,", created_at:"1609-08-06T15:47:00-07:00", updated_at:"1609-08-06T15:47:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "As kill a king and marry with his brother.", created_at:"1609-08-06T16:13:27-07:00", updated_at:"1609-08-06T16:13:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "As kill a king?", created_at:"1609-08-06T16:44:22-07:00", updated_at:"1609-08-06T16:44:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Ay, lady, it was my word.", created_at:"1609-08-06T17:20:07-07:00", updated_at:"1609-08-06T17:20:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Thou wretched, rash, intruding fool, farewell.", created_at:"1609-08-06T17:27:39-07:00", updated_at:"1609-08-06T17:27:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I took thee for thy better. Take thy fortune.", created_at:"1609-08-06T17:32:22-07:00", updated_at:"1609-08-06T17:32:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Thou find’st to be too busy is some danger.", created_at:"1609-08-06T17:53:50-07:00", updated_at:"1609-08-06T17:53:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Leave wringing of your hands. Peace, sit", created_at:"1609-08-06T18:00:54-07:00", updated_at:"1609-08-06T18:00:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "you down,", created_at:"1609-08-06T18:13:21-07:00", updated_at:"1609-08-06T18:13:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And let me wring your heart; for so I shall", created_at:"1609-08-06T18:17:49-07:00", updated_at:"1609-08-06T18:17:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "If it be made of penetrable stuff,", created_at:"1609-08-06T18:21:55-07:00", updated_at:"1609-08-06T18:21:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "If damnèd custom have not brazed it so", created_at:"1609-08-06T18:42:03-07:00", updated_at:"1609-08-06T18:42:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That it be proof and bulwark against sense.", created_at:"1609-08-06T19:01:15-07:00", updated_at:"1609-08-06T19:01:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "What have I done, that thou dar’st wag thy tongue", created_at:"1609-08-06T19:06:12-07:00", updated_at:"1609-08-06T19:06:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "In noise so rude against me?", created_at:"1609-08-06T19:41:28-07:00", updated_at:"1609-08-06T19:41:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Such an act", created_at:"1609-08-06T20:16:58-07:00", updated_at:"1609-08-06T20:16:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That blurs the grace and blush of modesty,", created_at:"1609-08-06T20:35:56-07:00", updated_at:"1609-08-06T20:35:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Calls virtue hypocrite, takes off the rose", created_at:"1609-08-06T21:02:37-07:00", updated_at:"1609-08-06T21:02:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "From the fair forehead of an innocent love", created_at:"1609-08-06T21:11:40-07:00", updated_at:"1609-08-06T21:11:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And sets a blister there, makes marriage vows", created_at:"1609-08-06T21:28:18-07:00", updated_at:"1609-08-06T21:28:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "As false as dicers’ oaths—O, such a deed", created_at:"1609-08-06T21:29:47-07:00", updated_at:"1609-08-06T21:29:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "As from the body of contraction plucks", created_at:"1609-08-06T21:51:01-07:00", updated_at:"1609-08-06T21:51:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "The very soul, and sweet religion makes", created_at:"1609-08-06T22:14:59-07:00", updated_at:"1609-08-06T22:14:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A rhapsody of words! Heaven’s face does glow", created_at:"1609-08-06T22:31:39-07:00", updated_at:"1609-08-06T22:31:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O’er this solidity and compound mass", created_at:"1609-08-06T22:52:57-07:00", updated_at:"1609-08-06T22:52:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "With heated visage, as against the doom,", created_at:"1609-08-06T23:31:18-07:00", updated_at:"1609-08-06T23:31:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Is thought-sick at the act.", created_at:"1609-08-06T23:54:01-07:00", updated_at:"1609-08-06T23:54:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Ay me, what act", created_at:"1609-08-06T23:54:54-07:00", updated_at:"1609-08-06T23:54:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That roars so loud and thunders in the index?", created_at:"1609-08-07T00:33:13-07:00", updated_at:"1609-08-07T00:33:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Look here upon this picture and on this,", created_at:"1609-08-07T00:45:09-07:00", updated_at:"1609-08-07T00:45:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "The counterfeit presentment of two brothers.", created_at:"1609-08-07T01:22:49-07:00", updated_at:"1609-08-07T01:22:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "See what a grace was seated on this brow,", created_at:"1609-08-07T01:46:12-07:00", updated_at:"1609-08-07T01:46:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Hyperion’s curls, the front of Jove himself,", created_at:"1609-08-07T01:51:51-07:00", updated_at:"1609-08-07T01:51:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "An eye like Mars’ to threaten and command,", created_at:"1609-08-07T02:25:29-07:00", updated_at:"1609-08-07T02:25:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A station like the herald Mercury", created_at:"1609-08-07T03:03:47-07:00", updated_at:"1609-08-07T03:03:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "New-lighted on a heaven-kissing hill,", created_at:"1609-08-07T03:41:43-07:00", updated_at:"1609-08-07T03:41:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A combination and a form indeed", created_at:"1609-08-07T03:49:22-07:00", updated_at:"1609-08-07T03:49:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Where every god did seem to set his seal", created_at:"1609-08-07T04:11:12-07:00", updated_at:"1609-08-07T04:11:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To give the world assurance of a man.", created_at:"1609-08-07T04:24:34-07:00", updated_at:"1609-08-07T04:24:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "This was your husband. Look you now what follows.", created_at:"1609-08-07T04:37:39-07:00", updated_at:"1609-08-07T04:37:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Here is your husband, like a mildewed ear", created_at:"1609-08-07T04:47:15-07:00", updated_at:"1609-08-07T04:47:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Blasting his wholesome brother. Have you eyes?", created_at:"1609-08-07T05:24:36-07:00", updated_at:"1609-08-07T05:24:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Could you on this fair mountain leave to feed", created_at:"1609-08-07T05:42:18-07:00", updated_at:"1609-08-07T05:42:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And batten on this moor? Ha! Have you eyes?", created_at:"1609-08-07T06:17:31-07:00", updated_at:"1609-08-07T06:17:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "You cannot call it love, for at your age", created_at:"1609-08-07T06:19:10-07:00", updated_at:"1609-08-07T06:19:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "The heyday in the blood is tame, it’s humble", created_at:"1609-08-07T06:23:47-07:00", updated_at:"1609-08-07T06:23:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And waits upon the judgment; and what judgment", created_at:"1609-08-07T06:42:40-07:00", updated_at:"1609-08-07T06:42:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Would step from this to this? Sense sure you have,", created_at:"1609-08-07T06:50:17-07:00", updated_at:"1609-08-07T06:50:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Else could you not have motion; but sure that sense", created_at:"1609-08-07T07:12:55-07:00", updated_at:"1609-08-07T07:12:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Is apoplexed; for madness would not err,", created_at:"1609-08-07T07:46:42-07:00", updated_at:"1609-08-07T07:46:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Nor sense to ecstasy was ne’er so thralled,", created_at:"1609-08-07T08:23:11-07:00", updated_at:"1609-08-07T08:23:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "But it reserved some quantity of choice", created_at:"1609-08-07T08:28:53-07:00", updated_at:"1609-08-07T08:28:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To serve in such a difference. What devil was ’t", created_at:"1609-08-07T08:48:36-07:00", updated_at:"1609-08-07T08:48:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That thus hath cozened you at hoodman-blind?", created_at:"1609-08-07T09:03:44-07:00", updated_at:"1609-08-07T09:03:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Eyes without feeling, feeling without sight,", created_at:"1609-08-07T09:34:36-07:00", updated_at:"1609-08-07T09:34:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Ears without hands or eyes, smelling sans all,", created_at:"1609-08-07T09:51:44-07:00", updated_at:"1609-08-07T09:51:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Or but a sickly part of one true sense", created_at:"1609-08-07T10:05:58-07:00", updated_at:"1609-08-07T10:05:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Could not so mope. O shame, where is thy blush?", created_at:"1609-08-07T10:33:48-07:00", updated_at:"1609-08-07T10:33:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Rebellious hell,", created_at:"1609-08-07T11:13:24-07:00", updated_at:"1609-08-07T11:13:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "If thou canst mutine in a matron’s bones,", created_at:"1609-08-07T11:40:19-07:00", updated_at:"1609-08-07T11:40:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To flaming youth let virtue be as wax", created_at:"1609-08-07T12:05:06-07:00", updated_at:"1609-08-07T12:05:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And melt in her own fire. Proclaim no shame", created_at:"1609-08-07T12:08:07-07:00", updated_at:"1609-08-07T12:08:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "When the compulsive ardor gives the charge,", created_at:"1609-08-07T12:31:12-07:00", updated_at:"1609-08-07T12:31:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Since frost itself as actively doth burn,", created_at:"1609-08-07T12:45:51-07:00", updated_at:"1609-08-07T12:45:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And reason panders will.", created_at:"1609-08-07T13:03:54-07:00", updated_at:"1609-08-07T13:03:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O Hamlet, speak no more!", created_at:"1609-08-07T13:04:23-07:00", updated_at:"1609-08-07T13:04:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Thou turn’st my eyes into my very soul,", created_at:"1609-08-07T13:41:34-07:00", updated_at:"1609-08-07T13:41:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And there I see such black and grainèd spots", created_at:"1609-08-07T13:44:25-07:00", updated_at:"1609-08-07T13:44:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "As will not leave their tinct.", created_at:"1609-08-07T13:44:34-07:00", updated_at:"1609-08-07T13:44:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Nay, but to live", created_at:"1609-08-07T14:20:36-07:00", updated_at:"1609-08-07T14:20:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "In the rank sweat of an enseamèd bed,", created_at:"1609-08-07T14:49:46-07:00", updated_at:"1609-08-07T14:49:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Stewed in corruption, honeying and making love", created_at:"1609-08-07T15:08:40-07:00", updated_at:"1609-08-07T15:08:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Over the nasty sty!", created_at:"1609-08-07T15:33:57-07:00", updated_at:"1609-08-07T15:33:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O, speak to me no more!", created_at:"1609-08-07T16:07:41-07:00", updated_at:"1609-08-07T16:07:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "These words like daggers enter in my ears.", created_at:"1609-08-07T16:46:16-07:00", updated_at:"1609-08-07T16:46:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "No more, sweet Hamlet!", created_at:"1609-08-07T17:24:17-07:00", updated_at:"1609-08-07T17:24:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A murderer and a villain,", created_at:"1609-08-07T17:38:00-07:00", updated_at:"1609-08-07T17:38:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A slave that is not twentieth part the tithe", created_at:"1609-08-07T18:17:13-07:00", updated_at:"1609-08-07T18:17:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Of your precedent lord; a vice of kings,", created_at:"1609-08-07T18:36:46-07:00", updated_at:"1609-08-07T18:36:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A cutpurse of the empire and the rule,", created_at:"1609-08-07T19:16:24-07:00", updated_at:"1609-08-07T19:16:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That from a shelf the precious diadem stole", created_at:"1609-08-07T19:29:45-07:00", updated_at:"1609-08-07T19:29:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And put it in his pocket—", created_at:"1609-08-07T19:56:17-07:00", updated_at:"1609-08-07T19:56:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "No more!", created_at:"1609-08-07T20:01:06-07:00", updated_at:"1609-08-07T20:01:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "A king of shreds and patches—", created_at:"1609-08-07T20:06:27-07:00", updated_at:"1609-08-07T20:06:27-07:00"})
