Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Alas, he’s mad.", created_at:"1609-08-07T21:19:33-07:00", updated_at:"1609-08-07T21:19:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Do you not come your tardy son to chide,", created_at:"1609-08-07T21:47:05-07:00", updated_at:"1609-08-07T21:47:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "That, lapsed in time and passion, lets go by", created_at:"1609-08-07T22:20:40-07:00", updated_at:"1609-08-07T22:20:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Th’ important acting of your dread command?", created_at:"1609-08-07T22:54:42-07:00", updated_at:"1609-08-07T22:54:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "O, say!", created_at:"1609-08-07T23:13:25-07:00", updated_at:"1609-08-07T23:13:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Do not forget. This visitation", created_at:"1609-08-07T23:41:34-07:00", updated_at:"1609-08-07T23:41:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Is but to whet thy almost blunted purpose.", created_at:"1609-08-07T23:52:00-07:00", updated_at:"1609-08-07T23:52:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "But look, amazement on thy mother sits.", created_at:"1609-08-08T00:08:43-07:00", updated_at:"1609-08-08T00:08:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "O, step between her and her fighting soul.", created_at:"1609-08-08T00:32:29-07:00", updated_at:"1609-08-08T00:32:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Conceit in weakest bodies strongest works.", created_at:"1609-08-08T01:09:24-07:00", updated_at:"1609-08-08T01:09:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ghost"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Speak to her, Hamlet.", created_at:"1609-08-08T01:30:08-07:00", updated_at:"1609-08-08T01:30:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "How is it with you, lady?", created_at:"1609-08-08T01:46:38-07:00", updated_at:"1609-08-08T01:46:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Alas, how is ’t with you,", created_at:"1609-08-08T02:17:05-07:00", updated_at:"1609-08-08T02:17:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "That you do bend your eye on vacancy", created_at:"1609-08-08T02:55:18-07:00", updated_at:"1609-08-08T02:55:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "And with th’ incorporal air do hold discourse?", created_at:"1609-08-08T02:59:27-07:00", updated_at:"1609-08-08T02:59:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Forth at your eyes your spirits wildly peep,", created_at:"1609-08-08T03:04:12-07:00", updated_at:"1609-08-08T03:04:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "And, as the sleeping soldiers in th’ alarm,", created_at:"1609-08-08T03:27:25-07:00", updated_at:"1609-08-08T03:27:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Your bedded hair, like life in excrements,", created_at:"1609-08-08T03:33:21-07:00", updated_at:"1609-08-08T03:33:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Start up and stand an end. O gentle son,", created_at:"1609-08-08T03:47:22-07:00", updated_at:"1609-08-08T03:47:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Upon the heat and flame of thy distemper", created_at:"1609-08-08T03:54:03-07:00", updated_at:"1609-08-08T03:54:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Sprinkle cool patience! Whereon do you look?", created_at:"1609-08-08T04:32:53-07:00", updated_at:"1609-08-08T04:32:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "On him, on him! Look you how pale he glares.", created_at:"1609-08-08T04:35:47-07:00", updated_at:"1609-08-08T04:35:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "His form and cause conjoined, preaching to stones,", created_at:"1609-08-08T04:52:37-07:00", updated_at:"1609-08-08T04:52:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Would make them capable. Do not", created_at:"1609-08-08T05:01:33-07:00", updated_at:"1609-08-08T05:01:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "look upon me,", created_at:"1609-08-08T05:37:41-07:00", updated_at:"1609-08-08T05:37:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Lest with this piteous action you convert", created_at:"1609-08-08T05:59:42-07:00", updated_at:"1609-08-08T05:59:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "My stern effects. Then what I have to do", created_at:"1609-08-08T06:18:00-07:00", updated_at:"1609-08-08T06:18:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Will want true color—tears perchance for blood.", created_at:"1609-08-08T06:29:52-07:00", updated_at:"1609-08-08T06:29:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "To whom do you speak this?", created_at:"1609-08-08T06:41:00-07:00", updated_at:"1609-08-08T06:41:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Do you see nothing there?", created_at:"1609-08-08T06:52:21-07:00", updated_at:"1609-08-08T06:52:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Nothing at all; yet all that is I see.", created_at:"1609-08-08T07:08:51-07:00", updated_at:"1609-08-08T07:08:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Nor did you nothing hear?", created_at:"1609-08-08T07:39:54-07:00", updated_at:"1609-08-08T07:39:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "No, nothing but ourselves.", created_at:"1609-08-08T08:06:56-07:00", updated_at:"1609-08-08T08:06:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Why, look you there, look how it steals away!", created_at:"1609-08-08T08:11:31-07:00", updated_at:"1609-08-08T08:11:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "My father, in his habit as he lived!", created_at:"1609-08-08T08:12:31-07:00", updated_at:"1609-08-08T08:12:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_46.id, body: "Look where he goes even now out at the portal!", created_at:"1609-08-08T08:51:19-07:00", updated_at:"1609-08-08T08:51:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "This is the very coinage of your brain.", created_at:"1609-08-08T09:14:21-07:00", updated_at:"1609-08-08T09:14:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "This bodiless creation ecstasy", created_at:"1609-08-08T09:27:31-07:00", updated_at:"1609-08-08T09:27:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Is very cunning in.", created_at:"1609-08-08T09:42:57-07:00", updated_at:"1609-08-08T09:42:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Ecstasy?", created_at:"1609-08-08T09:48:40-07:00", updated_at:"1609-08-08T09:48:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "My pulse as yours doth temperately keep time", created_at:"1609-08-08T10:22:36-07:00", updated_at:"1609-08-08T10:22:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And makes as healthful music. It is not madness", created_at:"1609-08-08T10:22:37-07:00", updated_at:"1609-08-08T10:22:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That I have uttered. Bring me to the test,", created_at:"1609-08-08T10:44:02-07:00", updated_at:"1609-08-08T10:44:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And I the matter will reword, which madness", created_at:"1609-08-08T11:05:57-07:00", updated_at:"1609-08-08T11:05:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Would gambol from. Mother, for love of grace,", created_at:"1609-08-08T11:20:57-07:00", updated_at:"1609-08-08T11:20:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Lay not that flattering unction to your soul", created_at:"1609-08-08T11:31:44-07:00", updated_at:"1609-08-08T11:31:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That not your trespass but my madness speaks.", created_at:"1609-08-08T11:59:21-07:00", updated_at:"1609-08-08T11:59:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "It will but skin and film the ulcerous place,", created_at:"1609-08-08T12:22:06-07:00", updated_at:"1609-08-08T12:22:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Whiles rank corruption, mining all within,", created_at:"1609-08-08T13:00:28-07:00", updated_at:"1609-08-08T13:00:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Infects unseen. Confess yourself to heaven,", created_at:"1609-08-08T13:18:38-07:00", updated_at:"1609-08-08T13:18:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Repent what’s past, avoid what is to come,", created_at:"1609-08-08T13:51:00-07:00", updated_at:"1609-08-08T13:51:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And do not spread the compost on the weeds", created_at:"1609-08-08T14:12:18-07:00", updated_at:"1609-08-08T14:12:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To make them ranker. Forgive me this my virtue,", created_at:"1609-08-08T14:51:40-07:00", updated_at:"1609-08-08T14:51:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "For, in the fatness of these pursy times,", created_at:"1609-08-08T15:15:31-07:00", updated_at:"1609-08-08T15:15:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Virtue itself of vice must pardon beg,", created_at:"1609-08-08T15:32:14-07:00", updated_at:"1609-08-08T15:32:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Yea, curb and woo for leave to do him good.", created_at:"1609-08-08T15:50:38-07:00", updated_at:"1609-08-08T15:50:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O Hamlet, thou hast cleft my heart in twain!", created_at:"1609-08-08T16:05:59-07:00", updated_at:"1609-08-08T16:05:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "O, throw away the worser part of it,", created_at:"1609-08-08T16:19:14-07:00", updated_at:"1609-08-08T16:19:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And live the purer with the other half!", created_at:"1609-08-08T16:40:48-07:00", updated_at:"1609-08-08T16:40:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Good night. But go not to my uncle’s bed.", created_at:"1609-08-08T17:11:00-07:00", updated_at:"1609-08-08T17:11:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Assume a virtue if you have it not.", created_at:"1609-08-08T17:26:19-07:00", updated_at:"1609-08-08T17:26:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That monster, custom, who all sense doth eat,", created_at:"1609-08-08T17:32:49-07:00", updated_at:"1609-08-08T17:32:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Of habits devil, is angel yet in this,", created_at:"1609-08-08T17:36:45-07:00", updated_at:"1609-08-08T17:36:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That to the use of actions fair and good", created_at:"1609-08-08T17:42:09-07:00", updated_at:"1609-08-08T17:42:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "He likewise gives a frock or livery", created_at:"1609-08-08T17:55:34-07:00", updated_at:"1609-08-08T17:55:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That aptly is put on. Refrain tonight,", created_at:"1609-08-08T18:18:18-07:00", updated_at:"1609-08-08T18:18:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And that shall lend a kind of easiness", created_at:"1609-08-08T18:38:39-07:00", updated_at:"1609-08-08T18:38:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To the next abstinence, the next more easy;", created_at:"1609-08-08T18:44:44-07:00", updated_at:"1609-08-08T18:44:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "For use almost can change the stamp of nature", created_at:"1609-08-08T19:02:48-07:00", updated_at:"1609-08-08T19:02:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And either  the devil or throw him out", created_at:"1609-08-08T19:33:06-07:00", updated_at:"1609-08-08T19:33:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "With wondrous potency. Once more, good night,", created_at:"1609-08-08T19:44:12-07:00", updated_at:"1609-08-08T19:44:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And, when you are desirous to be blest,", created_at:"1609-08-08T20:17:13-07:00", updated_at:"1609-08-08T20:17:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I’ll blessing beg of you. For this same lord", created_at:"1609-08-08T20:20:06-07:00", updated_at:"1609-08-08T20:20:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I do repent; but heaven hath pleased it so", created_at:"1609-08-08T20:50:40-07:00", updated_at:"1609-08-08T20:50:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To punish me with this and this with me,", created_at:"1609-08-08T21:28:46-07:00", updated_at:"1609-08-08T21:28:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That I must be their scourge and minister.", created_at:"1609-08-08T22:07:55-07:00", updated_at:"1609-08-08T22:07:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I will bestow him and will answer well", created_at:"1609-08-08T22:15:56-07:00", updated_at:"1609-08-08T22:15:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "The death I gave him. So, again, good night.", created_at:"1609-08-08T22:31:22-07:00", updated_at:"1609-08-08T22:31:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I must be cruel only to be kind.", created_at:"1609-08-08T23:03:15-07:00", updated_at:"1609-08-08T23:03:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "This bad begins, and worse remains behind.", created_at:"1609-08-08T23:39:58-07:00", updated_at:"1609-08-08T23:39:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "One word more, good lady.", created_at:"1609-08-09T00:05:08-07:00", updated_at:"1609-08-09T00:05:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "What shall I do?", created_at:"1609-08-09T00:39:55-07:00", updated_at:"1609-08-09T00:39:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Not this by no means that I bid you do:", created_at:"1609-08-09T00:40:44-07:00", updated_at:"1609-08-09T00:40:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Let the bloat king tempt you again to bed,", created_at:"1609-08-09T00:57:01-07:00", updated_at:"1609-08-09T00:57:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Pinch wanton on your cheek, call you his mouse,", created_at:"1609-08-09T01:22:36-07:00", updated_at:"1609-08-09T01:22:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And let him, for a pair of reechy kisses", created_at:"1609-08-09T01:24:57-07:00", updated_at:"1609-08-09T01:24:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Or paddling in your neck with his damned fingers,", created_at:"1609-08-09T01:36:56-07:00", updated_at:"1609-08-09T01:36:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Make you to ravel all this matter out", created_at:"1609-08-09T01:59:44-07:00", updated_at:"1609-08-09T01:59:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "That I essentially am not in madness,", created_at:"1609-08-09T02:07:52-07:00", updated_at:"1609-08-09T02:07:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "But mad in craft. ’Twere good you let him know,", created_at:"1609-08-09T02:40:12-07:00", updated_at:"1609-08-09T02:40:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "For who that’s but a queen, fair, sober, wise,", created_at:"1609-08-09T03:19:27-07:00", updated_at:"1609-08-09T03:19:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Would from a paddock, from a bat, a gib,", created_at:"1609-08-09T03:24:41-07:00", updated_at:"1609-08-09T03:24:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Such dear concernings hide? Who would do so?", created_at:"1609-08-09T03:25:59-07:00", updated_at:"1609-08-09T03:25:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "No, in despite of sense and secrecy,", created_at:"1609-08-09T03:59:35-07:00", updated_at:"1609-08-09T03:59:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Unpeg the basket on the house’s top,", created_at:"1609-08-09T04:33:18-07:00", updated_at:"1609-08-09T04:33:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Let the birds fly, and like the famous ape,", created_at:"1609-08-09T05:12:19-07:00", updated_at:"1609-08-09T05:12:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "To try conclusions, in the basket creep", created_at:"1609-08-09T05:12:50-07:00", updated_at:"1609-08-09T05:12:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And break your own neck down.", created_at:"1609-08-09T05:51:57-07:00", updated_at:"1609-08-09T05:51:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Be thou assured, if words be made of breath", created_at:"1609-08-09T05:53:04-07:00", updated_at:"1609-08-09T05:53:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And breath of life, I have no life to breathe", created_at:"1609-08-09T05:56:49-07:00", updated_at:"1609-08-09T05:56:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "What thou hast said to me.", created_at:"1609-08-09T06:17:42-07:00", updated_at:"1609-08-09T06:17:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I must to England, you know that.", created_at:"1609-08-09T06:47:49-07:00", updated_at:"1609-08-09T06:47:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Alack,", created_at:"1609-08-09T06:50:11-07:00", updated_at:"1609-08-09T06:50:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I had forgot! ’Tis so concluded on.", created_at:"1609-08-09T07:08:36-07:00", updated_at:"1609-08-09T07:08:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "There’s letters sealed; and my two schoolfellows,", created_at:"1609-08-09T07:23:39-07:00", updated_at:"1609-08-09T07:23:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Whom I will trust as I will adders fanged,", created_at:"1609-08-09T08:00:33-07:00", updated_at:"1609-08-09T08:00:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "They bear the mandate; they must sweep my way", created_at:"1609-08-09T08:18:44-07:00", updated_at:"1609-08-09T08:18:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And marshal me to knavery. Let it work,", created_at:"1609-08-09T08:57:17-07:00", updated_at:"1609-08-09T08:57:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "For ’tis the sport to have the enginer", created_at:"1609-08-09T09:36:14-07:00", updated_at:"1609-08-09T09:36:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Hoist with his own petard; and ’t shall go hard", created_at:"1609-08-09T09:45:24-07:00", updated_at:"1609-08-09T09:45:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "But I will delve one yard below their mines", created_at:"1609-08-09T10:00:50-07:00", updated_at:"1609-08-09T10:00:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "And blow them at the moon. O, ’tis most sweet", created_at:"1609-08-09T10:27:33-07:00", updated_at:"1609-08-09T10:27:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "When in one line two crafts directly meet.", created_at:"1609-08-09T10:58:15-07:00", updated_at:"1609-08-09T10:58:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "This man shall set me packing.", created_at:"1609-08-09T11:27:20-07:00", updated_at:"1609-08-09T11:27:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "I’ll lug the guts into the neighbor room.", created_at:"1609-08-09T11:52:39-07:00", updated_at:"1609-08-09T11:52:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Mother, good night indeed. This counselor", created_at:"1609-08-09T12:10:18-07:00", updated_at:"1609-08-09T12:10:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Is now most still, most secret, and most grave,", created_at:"1609-08-09T12:34:16-07:00", updated_at:"1609-08-09T12:34:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Who was in life a foolish prating knave.—", created_at:"1609-08-09T12:50:35-07:00", updated_at:"1609-08-09T12:50:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Come, sir, to draw toward an end with you.—", created_at:"1609-08-09T13:04:31-07:00", updated_at:"1609-08-09T13:04:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_45.id, body: "Good night, mother.", created_at:"1609-08-09T13:32:30-07:00", updated_at:"1609-08-09T13:32:30-07:00"})
