DirectMessageParticipant.create!({direct_message_id: direct_message_47.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Gertrude@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_47.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Guildenstern@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_47.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Rosencrantz@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_47.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "There’s matter in these sighs; these profound heaves", created_at:"1609-08-09T13:53:02-07:00", updated_at:"1609-08-09T13:53:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "You must translate; ’tis fit we understand them.", created_at:"1609-08-09T14:27:20-07:00", updated_at:"1609-08-09T14:27:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "Where is your son?", created_at:"1609-08-09T15:04:01-07:00", updated_at:"1609-08-09T15:04:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "Bestow this place on us a little while.", created_at:"1609-08-09T15:06:45-07:00", updated_at:"1609-08-09T15:06:45-07:00"})
direct_message_48 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_48.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_48.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Gertrude@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_48.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Ah, mine own lord, what have I seen tonight!", created_at:"1609-08-09T15:31:41-07:00", updated_at:"1609-08-09T15:31:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "What, Gertrude? How does Hamlet?", created_at:"1609-08-09T15:42:19-07:00", updated_at:"1609-08-09T15:42:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Mad as the sea and wind when both contend", created_at:"1609-08-09T15:52:06-07:00", updated_at:"1609-08-09T15:52:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Which is the mightier. In his lawless fit,", created_at:"1609-08-09T16:03:50-07:00", updated_at:"1609-08-09T16:03:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Behind the arras hearing something stir,", created_at:"1609-08-09T16:41:10-07:00", updated_at:"1609-08-09T16:41:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Whips out his rapier, cries A rat, a rat,", created_at:"1609-08-09T16:48:50-07:00", updated_at:"1609-08-09T16:48:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "And in this brainish apprehension kills", created_at:"1609-08-09T17:26:49-07:00", updated_at:"1609-08-09T17:26:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "The unseen good old man.", created_at:"1609-08-09T17:42:25-07:00", updated_at:"1609-08-09T17:42:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "O heavy deed!", created_at:"1609-08-09T17:57:46-07:00", updated_at:"1609-08-09T17:57:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "It had been so with us, had we been there.", created_at:"1609-08-09T18:21:35-07:00", updated_at:"1609-08-09T18:21:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "His liberty is full of threats to all—", created_at:"1609-08-09T18:22:14-07:00", updated_at:"1609-08-09T18:22:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "To you yourself, to us, to everyone.", created_at:"1609-08-09T18:25:29-07:00", updated_at:"1609-08-09T18:25:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Alas, how shall this bloody deed be answered?", created_at:"1609-08-09T18:58:52-07:00", updated_at:"1609-08-09T18:58:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "It will be laid to us, whose providence", created_at:"1609-08-09T19:22:54-07:00", updated_at:"1609-08-09T19:22:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Should have kept short, restrained, and out of haunt", created_at:"1609-08-09T19:50:51-07:00", updated_at:"1609-08-09T19:50:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "This mad young man. But so much was our love,", created_at:"1609-08-09T20:21:41-07:00", updated_at:"1609-08-09T20:21:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "We would not understand what was most fit,", created_at:"1609-08-09T20:31:12-07:00", updated_at:"1609-08-09T20:31:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "But, like the owner of a foul disease,", created_at:"1609-08-09T20:40:56-07:00", updated_at:"1609-08-09T20:40:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "To keep it from divulging, let it feed", created_at:"1609-08-09T21:08:25-07:00", updated_at:"1609-08-09T21:08:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Even on the pith of life. Where is he gone?", created_at:"1609-08-09T21:33:43-07:00", updated_at:"1609-08-09T21:33:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "To draw apart the body he hath killed,", created_at:"1609-08-09T21:39:17-07:00", updated_at:"1609-08-09T21:39:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "O’er whom his very madness, like some ore", created_at:"1609-08-09T22:02:04-07:00", updated_at:"1609-08-09T22:02:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Among a mineral of metals base,", created_at:"1609-08-09T22:12:17-07:00", updated_at:"1609-08-09T22:12:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Shows itself pure: he weeps for what is done.", created_at:"1609-08-09T22:50:35-07:00", updated_at:"1609-08-09T22:50:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "O Gertrude, come away!", created_at:"1609-08-09T22:56:02-07:00", updated_at:"1609-08-09T22:56:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "The sun no sooner shall the mountains touch", created_at:"1609-08-09T23:00:46-07:00", updated_at:"1609-08-09T23:00:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "But we will ship him hence; and this vile deed", created_at:"1609-08-09T23:05:42-07:00", updated_at:"1609-08-09T23:05:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "We must with all our majesty and skill", created_at:"1609-08-09T23:14:14-07:00", updated_at:"1609-08-09T23:14:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Both countenance and excuse.—Ho, Guildenstern!", created_at:"1609-08-09T23:43:22-07:00", updated_at:"1609-08-09T23:43:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "Friends both, go join you with some further aid.", created_at:"1609-08-10T00:04:39-07:00", updated_at:"1609-08-10T00:04:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "Hamlet in madness hath Polonius slain,", created_at:"1609-08-10T00:39:18-07:00", updated_at:"1609-08-10T00:39:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "And from his mother’s closet hath he dragged him.", created_at:"1609-08-10T00:55:07-07:00", updated_at:"1609-08-10T00:55:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "Go seek him out, speak fair, and bring the body", created_at:"1609-08-10T01:25:12-07:00", updated_at:"1609-08-10T01:25:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_47.id, body: "Into the chapel. I pray you, haste in this.", created_at:"1609-08-10T01:59:37-07:00", updated_at:"1609-08-10T01:59:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Come, Gertrude, we’ll call up our wisest friends", created_at:"1609-08-10T02:32:35-07:00", updated_at:"1609-08-10T02:32:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "And let them know both what we mean to do", created_at:"1609-08-10T03:01:18-07:00", updated_at:"1609-08-10T03:01:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "And what’s untimely done. ", created_at:"1609-08-10T03:08:43-07:00", updated_at:"1609-08-10T03:08:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Whose whisper o’er the world’s diameter,", created_at:"1609-08-10T03:13:47-07:00", updated_at:"1609-08-10T03:13:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "As level as the cannon to his blank", created_at:"1609-08-10T03:20:03-07:00", updated_at:"1609-08-10T03:20:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Transports his poisoned shot, may miss our name", created_at:"1609-08-10T03:48:14-07:00", updated_at:"1609-08-10T03:48:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "And hit the woundless air. O, come away!", created_at:"1609-08-10T03:52:02-07:00", updated_at:"1609-08-10T03:52:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "My soul is full of discord and dismay.", created_at:"1609-08-10T04:07:06-07:00", updated_at:"1609-08-10T04:07:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Safely stowed.", created_at:"1609-08-10T04:15:57-07:00", updated_at:"1609-08-10T04:15:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "But soft, what noise? Who calls on Hamlet?", created_at:"1609-08-10T04:55:39-07:00", updated_at:"1609-08-10T04:55:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "O, here they come.", created_at:"1609-08-10T05:27:06-07:00", updated_at:"1609-08-10T05:27:06-07:00"})
