Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "What have you done, my lord, with the dead body?", created_at:"1609-08-10T05:42:27-07:00", updated_at:"1609-08-10T05:42:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Compounded it with dust, whereto ’tis kin.", created_at:"1609-08-10T06:11:26-07:00", updated_at:"1609-08-10T06:11:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Tell us where ’tis, that we may take it thence", created_at:"1609-08-10T06:42:50-07:00", updated_at:"1609-08-10T06:42:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "And bear it to the chapel.", created_at:"1609-08-10T07:16:54-07:00", updated_at:"1609-08-10T07:16:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Do not believe it.", created_at:"1609-08-10T07:20:15-07:00", updated_at:"1609-08-10T07:20:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Believe what?", created_at:"1609-08-10T07:38:05-07:00", updated_at:"1609-08-10T07:38:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "That I can keep your counsel and not mine", created_at:"1609-08-10T08:04:37-07:00", updated_at:"1609-08-10T08:04:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "own. Besides, to be demanded of a sponge, what", created_at:"1609-08-10T08:37:33-07:00", updated_at:"1609-08-10T08:37:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "replication should be made by the son of a king?", created_at:"1609-08-10T09:15:19-07:00", updated_at:"1609-08-10T09:15:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Take you me for a sponge, my lord?", created_at:"1609-08-10T09:26:54-07:00", updated_at:"1609-08-10T09:26:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Ay, sir, that soaks up the King’s countenance,", created_at:"1609-08-10T09:56:07-07:00", updated_at:"1609-08-10T09:56:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "his rewards, his authorities. But such officers do the", created_at:"1609-08-10T10:29:10-07:00", updated_at:"1609-08-10T10:29:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "King best service in the end. He keeps them like an", created_at:"1609-08-10T10:29:47-07:00", updated_at:"1609-08-10T10:29:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "ape an apple in the corner of his jaw, first mouthed,", created_at:"1609-08-10T10:31:34-07:00", updated_at:"1609-08-10T10:31:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "to be last swallowed. When he needs what you have", created_at:"1609-08-10T11:11:09-07:00", updated_at:"1609-08-10T11:11:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "gleaned, it is but squeezing you, and, sponge, you", created_at:"1609-08-10T11:39:13-07:00", updated_at:"1609-08-10T11:39:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "shall be dry again.", created_at:"1609-08-10T12:08:17-07:00", updated_at:"1609-08-10T12:08:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "I understand you not, my lord.", created_at:"1609-08-10T12:36:31-07:00", updated_at:"1609-08-10T12:36:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "I am glad of it. A knavish speech sleeps in a", created_at:"1609-08-10T12:58:36-07:00", updated_at:"1609-08-10T12:58:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "foolish ear.", created_at:"1609-08-10T13:32:05-07:00", updated_at:"1609-08-10T13:32:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "My lord, you must tell us where the", created_at:"1609-08-10T13:46:19-07:00", updated_at:"1609-08-10T13:46:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "body is and go with us to the King.", created_at:"1609-08-10T13:55:35-07:00", updated_at:"1609-08-10T13:55:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "The body is with the King, but the King is not", created_at:"1609-08-10T14:17:02-07:00", updated_at:"1609-08-10T14:17:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "with the body. The King is a thing—", created_at:"1609-08-10T14:49:05-07:00", updated_at:"1609-08-10T14:49:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Guildenstern"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "A thing, my lord?", created_at:"1609-08-10T14:55:52-07:00", updated_at:"1609-08-10T14:55:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Of nothing. Bring me to him. Hide fox, and", created_at:"1609-08-10T15:21:33-07:00", updated_at:"1609-08-10T15:21:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "all after!", created_at:"1609-08-10T15:47:59-07:00", updated_at:"1609-08-10T15:47:59-07:00"})
