Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "I have sent to seek him and to find the body.", created_at:"1609-08-10T16:11:20-07:00", updated_at:"1609-08-10T16:11:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "How dangerous is it that this man goes loose!", created_at:"1609-08-10T16:38:08-07:00", updated_at:"1609-08-10T16:38:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "Yet must not we put the strong law on him.", created_at:"1609-08-10T16:55:17-07:00", updated_at:"1609-08-10T16:55:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "He’s loved of the distracted multitude,", created_at:"1609-08-10T17:33:19-07:00", updated_at:"1609-08-10T17:33:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "Who like not in their judgment, but their eyes;", created_at:"1609-08-10T17:59:04-07:00", updated_at:"1609-08-10T17:59:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "And, where ’tis so, th’ offender’s scourge is weighed,", created_at:"1609-08-10T18:34:45-07:00", updated_at:"1609-08-10T18:34:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "But never the offense. To bear all smooth and even,", created_at:"1609-08-10T18:54:54-07:00", updated_at:"1609-08-10T18:54:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "This sudden sending him away must seem", created_at:"1609-08-10T19:28:24-07:00", updated_at:"1609-08-10T19:28:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "Deliberate pause. Diseases desperate grown", created_at:"1609-08-10T19:55:04-07:00", updated_at:"1609-08-10T19:55:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "By desperate appliance are relieved", created_at:"1609-08-10T20:35:04-07:00", updated_at:"1609-08-10T20:35:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_50.id, body: "Or not at all.", created_at:"1609-08-10T20:41:36-07:00", updated_at:"1609-08-10T20:41:36-07:00"})
