Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "How now, what hath befallen?", created_at:"1609-08-10T21:18:32-07:00", updated_at:"1609-08-10T21:18:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "Where the dead body is bestowed, my lord,", created_at:"1609-08-10T21:34:20-07:00", updated_at:"1609-08-10T21:34:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "We cannot get from him.", created_at:"1609-08-10T22:10:28-07:00", updated_at:"1609-08-10T22:10:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "But where is he?", created_at:"1609-08-10T22:17:44-07:00", updated_at:"1609-08-10T22:17:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "Without, my lord; guarded, to know your pleasure.", created_at:"1609-08-10T22:19:22-07:00", updated_at:"1609-08-10T22:19:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "Bring him before us.", created_at:"1609-08-10T22:37:47-07:00", updated_at:"1609-08-10T22:37:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_51.id, body: "Ho! Bring in the lord.", created_at:"1609-08-10T23:05:20-07:00", updated_at:"1609-08-10T23:05:20-07:00"})
