Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "For England.", created_at:"1609-08-11T07:02:52-07:00", updated_at:"1609-08-11T07:02:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "For England?", created_at:"1609-08-11T07:38:35-07:00", updated_at:"1609-08-11T07:38:35-07:00"})
