Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "So is it, if thou knew’st our purposes.", created_at:"1609-08-11T08:36:50-07:00", updated_at:"1609-08-11T08:36:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "I see a cherub that sees them. But come, for", created_at:"1609-08-11T08:37:32-07:00", updated_at:"1609-08-11T08:37:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "England.", created_at:"1609-08-11T08:41:09-07:00", updated_at:"1609-08-11T08:41:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "Farewell, dear mother.", created_at:"1609-08-11T08:54:56-07:00", updated_at:"1609-08-11T08:54:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "Thy loving father, Hamlet.", created_at:"1609-08-11T09:23:28-07:00", updated_at:"1609-08-11T09:23:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "My mother. Father and mother is man and wife,", created_at:"1609-08-11T09:58:25-07:00", updated_at:"1609-08-11T09:58:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_53.id, body: "Man and wife is one flesh, and so, my mother.—", created_at:"1609-08-11T10:16:42-07:00", updated_at:"1609-08-11T10:16:42-07:00"})
