Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_54.id, body: "Follow him at foot; tempt him with speed aboard.", created_at:"1609-08-11T10:44:12-07:00", updated_at:"1609-08-11T10:44:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_54.id, body: "Delay it not. I’ll have him hence tonight.", created_at:"1609-08-11T11:00:07-07:00", updated_at:"1609-08-11T11:00:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_54.id, body: "Away, for everything is sealed and done", created_at:"1609-08-11T11:14:52-07:00", updated_at:"1609-08-11T11:14:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_54.id, body: "That else leans on th’ affair. Pray you, make haste.", created_at:"1609-08-11T11:41:26-07:00", updated_at:"1609-08-11T11:41:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "And England, if my love thou hold’st at aught", created_at:"1609-08-11T12:17:01-07:00", updated_at:"1609-08-11T12:17:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "(As my great power thereof may give thee sense,", created_at:"1609-08-11T12:48:09-07:00", updated_at:"1609-08-11T12:48:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Since yet thy cicatrice looks raw and red", created_at:"1609-08-11T13:13:34-07:00", updated_at:"1609-08-11T13:13:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "After the Danish sword, and thy free awe", created_at:"1609-08-11T13:22:44-07:00", updated_at:"1609-08-11T13:22:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Pays homage to us), thou mayst not coldly set", created_at:"1609-08-11T13:30:39-07:00", updated_at:"1609-08-11T13:30:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Our sovereign process, which imports at full,", created_at:"1609-08-11T13:54:56-07:00", updated_at:"1609-08-11T13:54:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "By letters congruing to that effect,", created_at:"1609-08-11T14:30:01-07:00", updated_at:"1609-08-11T14:30:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "The present death of Hamlet. Do it, England,", created_at:"1609-08-11T15:01:13-07:00", updated_at:"1609-08-11T15:01:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "For like the hectic in my blood he rages,", created_at:"1609-08-11T15:33:20-07:00", updated_at:"1609-08-11T15:33:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "And thou must cure me. Till I know ’tis done,", created_at:"1609-08-11T15:40:36-07:00", updated_at:"1609-08-11T15:40:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_42.id, body: "Howe’er my haps, my joys will ne’er begin.", created_at:"1609-08-11T15:40:52-07:00", updated_at:"1609-08-11T15:40:52-07:00"})
