Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "DirectMessage", parent_id: direct_message_55.id, body: "Tell him that by his license Fortinbras", created_at:"1609-08-11T16:29:05-07:00", updated_at:"1609-08-11T16:29:05-07:00"})
