Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "DirectMessage", parent_id: direct_message_55.id, body: "Over his kingdom. You know the rendezvous.", created_at:"1609-08-11T17:03:26-07:00", updated_at:"1609-08-11T17:03:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "DirectMessage", parent_id: direct_message_55.id, body: "If that his Majesty would aught with us,", created_at:"1609-08-11T17:05:59-07:00", updated_at:"1609-08-11T17:05:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "DirectMessage", parent_id: direct_message_55.id, body: "We shall express our duty in his eye;", created_at:"1609-08-11T17:24:28-07:00", updated_at:"1609-08-11T17:24:28-07:00"})
