DirectMessageParticipant.create!({direct_message_id: direct_message_56.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Good sir, whose powers are these?", created_at:"1609-08-11T18:08:14-07:00", updated_at:"1609-08-11T18:08:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "How purposed, sir, I pray you?", created_at:"1609-08-11T18:43:27-07:00", updated_at:"1609-08-11T18:43:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Who commands them, sir?", created_at:"1609-08-11T18:45:17-07:00", updated_at:"1609-08-11T18:45:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Goes it against the main of Poland, sir,", created_at:"1609-08-11T18:47:49-07:00", updated_at:"1609-08-11T18:47:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Or for some frontier?", created_at:"1609-08-11T19:12:53-07:00", updated_at:"1609-08-11T19:12:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Why, then, the Polack never will defend it.", created_at:"1609-08-11T19:25:08-07:00", updated_at:"1609-08-11T19:25:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Two thousand souls and twenty thousand ducats", created_at:"1609-08-11T19:57:32-07:00", updated_at:"1609-08-11T19:57:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Will not debate the question of this straw.", created_at:"1609-08-11T20:05:33-07:00", updated_at:"1609-08-11T20:05:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "This is th’ impostume of much wealth and peace,", created_at:"1609-08-11T20:32:35-07:00", updated_at:"1609-08-11T20:32:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "That inward breaks and shows no cause without", created_at:"1609-08-11T20:47:13-07:00", updated_at:"1609-08-11T20:47:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_56.id, body: "Why the man dies.—I humbly thank you, sir.", created_at:"1609-08-11T21:05:22-07:00", updated_at:"1609-08-11T21:05:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Rosencrantz"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "Will ’t please you go, my lord?", created_at:"1609-08-11T21:34:27-07:00", updated_at:"1609-08-11T21:34:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_49.id, body: "I’ll be with you straight. Go a little before.", created_at:"1609-08-11T21:48:09-07:00", updated_at:"1609-08-11T21:48:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "How all occasions do inform against me", created_at:"1609-08-11T21:57:13-07:00", updated_at:"1609-08-11T21:57:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "And spur my dull revenge. What is a man", created_at:"1609-08-11T22:20:32-07:00", updated_at:"1609-08-11T22:20:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "If his chief good and market of his time", created_at:"1609-08-11T22:39:09-07:00", updated_at:"1609-08-11T22:39:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Be but to sleep and feed? A beast, no more.", created_at:"1609-08-11T23:14:51-07:00", updated_at:"1609-08-11T23:14:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Sure He that made us with such large discourse,", created_at:"1609-08-11T23:31:14-07:00", updated_at:"1609-08-11T23:31:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Looking before and after, gave us not", created_at:"1609-08-12T00:03:13-07:00", updated_at:"1609-08-12T00:03:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That capability and godlike reason", created_at:"1609-08-12T00:43:03-07:00", updated_at:"1609-08-12T00:43:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "To fust in us unused. Now whether it be", created_at:"1609-08-12T01:16:22-07:00", updated_at:"1609-08-12T01:16:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Bestial oblivion or some craven scruple", created_at:"1609-08-12T01:23:04-07:00", updated_at:"1609-08-12T01:23:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Of thinking too precisely on th’ event", created_at:"1609-08-12T01:59:19-07:00", updated_at:"1609-08-12T01:59:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "(A thought which, quartered, hath but one part", created_at:"1609-08-12T02:06:11-07:00", updated_at:"1609-08-12T02:06:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "wisdom", created_at:"1609-08-12T02:37:05-07:00", updated_at:"1609-08-12T02:37:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "And ever three parts coward), I do not know", created_at:"1609-08-12T02:55:12-07:00", updated_at:"1609-08-12T02:55:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Why yet I live to say This thing’s to do,", created_at:"1609-08-12T03:23:50-07:00", updated_at:"1609-08-12T03:23:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Sith I have cause, and will, and strength, and means", created_at:"1609-08-12T03:24:34-07:00", updated_at:"1609-08-12T03:24:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "To do ’t. Examples gross as Earth exhort me:", created_at:"1609-08-12T03:52:09-07:00", updated_at:"1609-08-12T03:52:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Witness this army of such mass and charge,", created_at:"1609-08-12T03:55:02-07:00", updated_at:"1609-08-12T03:55:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Led by a delicate and tender prince,", created_at:"1609-08-12T04:33:47-07:00", updated_at:"1609-08-12T04:33:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Whose spirit with divine ambition puffed", created_at:"1609-08-12T05:10:14-07:00", updated_at:"1609-08-12T05:10:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Makes mouths at the invisible event,", created_at:"1609-08-12T05:35:52-07:00", updated_at:"1609-08-12T05:35:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Exposing what is mortal and unsure", created_at:"1609-08-12T05:54:52-07:00", updated_at:"1609-08-12T05:54:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "To all that fortune, death, and danger dare,", created_at:"1609-08-12T06:27:08-07:00", updated_at:"1609-08-12T06:27:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Even for an eggshell. Rightly to be great", created_at:"1609-08-12T06:29:09-07:00", updated_at:"1609-08-12T06:29:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Is not to stir without great argument,", created_at:"1609-08-12T07:06:30-07:00", updated_at:"1609-08-12T07:06:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "But greatly to find quarrel in a straw", created_at:"1609-08-12T07:32:37-07:00", updated_at:"1609-08-12T07:32:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "When honor’s at the stake. How stand I, then,", created_at:"1609-08-12T07:42:27-07:00", updated_at:"1609-08-12T07:42:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That have a father killed, a mother stained,", created_at:"1609-08-12T07:51:16-07:00", updated_at:"1609-08-12T07:51:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Excitements of my reason and my blood,", created_at:"1609-08-12T08:19:41-07:00", updated_at:"1609-08-12T08:19:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "And let all sleep, while to my shame I see", created_at:"1609-08-12T08:29:32-07:00", updated_at:"1609-08-12T08:29:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "The imminent death of twenty thousand men", created_at:"1609-08-12T08:32:01-07:00", updated_at:"1609-08-12T08:32:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "That for a fantasy and trick of fame", created_at:"1609-08-12T08:48:01-07:00", updated_at:"1609-08-12T08:48:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Go to their graves like beds, fight for a plot", created_at:"1609-08-12T09:23:38-07:00", updated_at:"1609-08-12T09:23:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Whereon the numbers cannot try the cause,", created_at:"1609-08-12T09:50:47-07:00", updated_at:"1609-08-12T09:50:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "Which is not tomb enough and continent", created_at:"1609-08-12T10:09:13-07:00", updated_at:"1609-08-12T10:09:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "To hide the slain? O, from this time forth", created_at:"1609-08-12T10:49:06-07:00", updated_at:"1609-08-12T10:49:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_6.id, body: "My thoughts be bloody or be nothing worth!", created_at:"1609-08-12T11:05:40-07:00", updated_at:"1609-08-12T11:05:40-07:00"})
