Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "I will not speak with her.", created_at:"1609-08-12T11:12:06-07:00", updated_at:"1609-08-12T11:12:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "She is importunate,", created_at:"1609-08-12T11:41:29-07:00", updated_at:"1609-08-12T11:41:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Indeed distract; her mood will needs be pitied.", created_at:"1609-08-12T12:19:08-07:00", updated_at:"1609-08-12T12:19:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "What would she have?", created_at:"1609-08-12T12:48:18-07:00", updated_at:"1609-08-12T12:48:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "She speaks much of her father, says she hears", created_at:"1609-08-12T13:14:42-07:00", updated_at:"1609-08-12T13:14:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "There’s tricks i’ th’ world, and hems, and beats her", created_at:"1609-08-12T13:35:40-07:00", updated_at:"1609-08-12T13:35:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "heart,", created_at:"1609-08-12T14:03:12-07:00", updated_at:"1609-08-12T14:03:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Spurns enviously at straws, speaks things in doubt", created_at:"1609-08-12T14:11:32-07:00", updated_at:"1609-08-12T14:11:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "That carry but half sense. Her speech is nothing,", created_at:"1609-08-12T14:44:35-07:00", updated_at:"1609-08-12T14:44:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Yet the unshapèd use of it doth move", created_at:"1609-08-12T15:24:30-07:00", updated_at:"1609-08-12T15:24:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "The hearers to collection. They aim at it", created_at:"1609-08-12T15:47:35-07:00", updated_at:"1609-08-12T15:47:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "And botch the words up fit to their own thoughts;", created_at:"1609-08-12T16:09:14-07:00", updated_at:"1609-08-12T16:09:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Which, as her winks and nods and gestures yield", created_at:"1609-08-12T16:15:28-07:00", updated_at:"1609-08-12T16:15:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "them,", created_at:"1609-08-12T16:29:32-07:00", updated_at:"1609-08-12T16:29:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Indeed would make one think there might be", created_at:"1609-08-12T16:54:42-07:00", updated_at:"1609-08-12T16:54:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "thought,", created_at:"1609-08-12T17:14:41-07:00", updated_at:"1609-08-12T17:14:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Though nothing sure, yet much unhappily.", created_at:"1609-08-12T17:52:15-07:00", updated_at:"1609-08-12T17:52:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "’Twere good she were spoken with, for she may", created_at:"1609-08-12T18:17:05-07:00", updated_at:"1609-08-12T18:17:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "strew", created_at:"1609-08-12T18:35:19-07:00", updated_at:"1609-08-12T18:35:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Dangerous conjectures in ill-breeding minds.", created_at:"1609-08-12T19:04:27-07:00", updated_at:"1609-08-12T19:04:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_57.id, body: "Let her come in.", created_at:"1609-08-12T19:39:00-07:00", updated_at:"1609-08-12T19:39:00-07:00"})
