Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_59.id, body: "How should I your true love know", created_at:"1609-08-12T20:53:27-07:00", updated_at:"1609-08-12T20:53:27-07:00"})
