Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_59.id, body: "He is dead and gone;", created_at:"1609-08-12T23:19:00-07:00", updated_at:"1609-08-12T23:19:00-07:00"})
