Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Alas, look here, my lord.", created_at:"1609-08-13T01:15:58-07:00", updated_at:"1609-08-13T01:15:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Larded all with sweet flowers;", created_at:"1609-08-13T01:39:35-07:00", updated_at:"1609-08-13T01:39:35-07:00"})
