Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "With true-love showers.", created_at:"1609-08-13T01:45:41-07:00", updated_at:"1609-08-13T01:45:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "How do you, pretty lady?", created_at:"1609-08-13T02:23:55-07:00", updated_at:"1609-08-13T02:23:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Well, God dild you. They say the owl was a", created_at:"1609-08-13T02:32:42-07:00", updated_at:"1609-08-13T02:32:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "baker’s daughter. Lord, we know what we are but", created_at:"1609-08-13T02:35:03-07:00", updated_at:"1609-08-13T02:35:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "know not what we may be. God be at your table.", created_at:"1609-08-13T03:05:10-07:00", updated_at:"1609-08-13T03:05:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Conceit upon her father.", created_at:"1609-08-13T03:43:42-07:00", updated_at:"1609-08-13T03:43:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Pray let’s have no words of this, but when", created_at:"1609-08-13T03:52:50-07:00", updated_at:"1609-08-13T03:52:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "they ask you what it means, say you this:", created_at:"1609-08-13T04:13:03-07:00", updated_at:"1609-08-13T04:13:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Tomorrow is Saint Valentine’s day,", created_at:"1609-08-13T04:38:13-07:00", updated_at:"1609-08-13T04:38:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "All in the morning betime,", created_at:"1609-08-13T04:56:17-07:00", updated_at:"1609-08-13T04:56:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "And I a maid at your window,", created_at:"1609-08-13T05:17:36-07:00", updated_at:"1609-08-13T05:17:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "To be your Valentine.", created_at:"1609-08-13T05:47:16-07:00", updated_at:"1609-08-13T05:47:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Then up he rose and donned his clothes", created_at:"1609-08-13T06:25:46-07:00", updated_at:"1609-08-13T06:25:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "And dupped the chamber door,", created_at:"1609-08-13T06:54:48-07:00", updated_at:"1609-08-13T06:54:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Let in the maid, that out a maid", created_at:"1609-08-13T07:31:54-07:00", updated_at:"1609-08-13T07:31:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Never departed more.", created_at:"1609-08-13T07:58:06-07:00", updated_at:"1609-08-13T07:58:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Pretty Ophelia—", created_at:"1609-08-13T08:32:54-07:00", updated_at:"1609-08-13T08:32:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Indeed, without an oath, I’ll make an end on ’t:", created_at:"1609-08-13T08:42:35-07:00", updated_at:"1609-08-13T08:42:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "By Gis and by Saint Charity,", created_at:"1609-08-13T09:19:31-07:00", updated_at:"1609-08-13T09:19:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Alack and fie for shame,", created_at:"1609-08-13T09:25:10-07:00", updated_at:"1609-08-13T09:25:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Young men will do ’t, if they come to ’t;", created_at:"1609-08-13T10:00:36-07:00", updated_at:"1609-08-13T10:00:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "By Cock, they are to blame.", created_at:"1609-08-13T10:35:36-07:00", updated_at:"1609-08-13T10:35:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "Quoth she Before you tumbled me,", created_at:"1609-08-13T11:14:28-07:00", updated_at:"1609-08-13T11:14:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "You promised me to wed.", created_at:"1609-08-13T11:20:38-07:00", updated_at:"1609-08-13T11:20:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "He answers:", created_at:"1609-08-13T11:24:55-07:00", updated_at:"1609-08-13T11:24:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "So would I ’a done, by yonder sun,", created_at:"1609-08-13T12:03:30-07:00", updated_at:"1609-08-13T12:03:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "An thou hadst not come to my bed.", created_at:"1609-08-13T12:12:33-07:00", updated_at:"1609-08-13T12:12:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "How long hath she been thus?", created_at:"1609-08-13T12:29:52-07:00", updated_at:"1609-08-13T12:29:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "I hope all will be well. We must be patient,", created_at:"1609-08-13T12:53:55-07:00", updated_at:"1609-08-13T12:53:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "but I cannot choose but weep to think they would", created_at:"1609-08-13T13:06:28-07:00", updated_at:"1609-08-13T13:06:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "lay him i’ th’ cold ground. My brother shall know of", created_at:"1609-08-13T13:33:48-07:00", updated_at:"1609-08-13T13:33:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "it. And so I thank you for your good counsel. Come,", created_at:"1609-08-13T13:46:21-07:00", updated_at:"1609-08-13T13:46:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "my coach! Good night, ladies, good night, sweet", created_at:"1609-08-13T14:23:15-07:00", updated_at:"1609-08-13T14:23:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_60.id, body: "ladies, good night, good night.", created_at:"1609-08-13T14:25:13-07:00", updated_at:"1609-08-13T14:25:13-07:00"})
