Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "For good Polonius’ death, and we have done but", created_at:"1609-08-13T17:44:53-07:00", updated_at:"1609-08-13T17:44:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "greenly", created_at:"1609-08-13T17:47:39-07:00", updated_at:"1609-08-13T17:47:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "In hugger-mugger to inter him; poor Ophelia", created_at:"1609-08-13T18:03:06-07:00", updated_at:"1609-08-13T18:03:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Divided from herself and her fair judgment,", created_at:"1609-08-13T18:11:56-07:00", updated_at:"1609-08-13T18:11:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Without the which we are pictures or mere beasts;", created_at:"1609-08-13T18:44:51-07:00", updated_at:"1609-08-13T18:44:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Last, and as much containing as all these,", created_at:"1609-08-13T19:15:57-07:00", updated_at:"1609-08-13T19:15:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Her brother is in secret come from France,", created_at:"1609-08-13T19:49:26-07:00", updated_at:"1609-08-13T19:49:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Feeds on his wonder, keeps himself in clouds,", created_at:"1609-08-13T20:18:33-07:00", updated_at:"1609-08-13T20:18:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "And wants not buzzers to infect his ear", created_at:"1609-08-13T20:45:02-07:00", updated_at:"1609-08-13T20:45:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "With pestilent speeches of his father’s death,", created_at:"1609-08-13T21:19:27-07:00", updated_at:"1609-08-13T21:19:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Wherein necessity, of matter beggared,", created_at:"1609-08-13T21:58:07-07:00", updated_at:"1609-08-13T21:58:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Will nothing stick our person to arraign", created_at:"1609-08-13T22:11:23-07:00", updated_at:"1609-08-13T22:11:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "In ear and ear. O, my dear Gertrude, this,", created_at:"1609-08-13T22:46:19-07:00", updated_at:"1609-08-13T22:46:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Like to a murd’ring piece, in many places", created_at:"1609-08-13T22:46:59-07:00", updated_at:"1609-08-13T22:46:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Gives me superfluous death.", created_at:"1609-08-13T22:50:50-07:00", updated_at:"1609-08-13T22:50:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Alack, what noise is this?", created_at:"1609-08-13T23:30:43-07:00", updated_at:"1609-08-13T23:30:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Attend!", created_at:"1609-08-13T23:38:42-07:00", updated_at:"1609-08-13T23:38:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Where is my Switzers? Let them guard the door.", created_at:"1609-08-14T00:02:11-07:00", updated_at:"1609-08-14T00:02:11-07:00"})
