Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "What is the matter?", created_at:"1609-08-14T00:04:25-07:00", updated_at:"1609-08-14T00:04:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "Save yourself, my lord.", created_at:"1609-08-14T00:34:48-07:00", updated_at:"1609-08-14T00:34:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "The ocean, overpeering of his list,", created_at:"1609-08-14T01:04:15-07:00", updated_at:"1609-08-14T01:04:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "Eats not the flats with more impiteous haste", created_at:"1609-08-14T01:33:24-07:00", updated_at:"1609-08-14T01:33:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "Than young Laertes, in a riotous head,", created_at:"1609-08-14T02:01:00-07:00", updated_at:"1609-08-14T02:01:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "O’erbears your officers. The rabble call him lord,", created_at:"1609-08-14T02:35:11-07:00", updated_at:"1609-08-14T02:35:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "And, as the world were now but to begin,", created_at:"1609-08-14T03:08:03-07:00", updated_at:"1609-08-14T03:08:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "Antiquity forgot, custom not known,", created_at:"1609-08-14T03:43:52-07:00", updated_at:"1609-08-14T03:43:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "The ratifiers and props of every word,", created_at:"1609-08-14T04:14:54-07:00", updated_at:"1609-08-14T04:14:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "They cry Choose we, Laertes shall be king!", created_at:"1609-08-14T04:28:37-07:00", updated_at:"1609-08-14T04:28:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "Caps, hands, and tongues applaud it to the clouds,", created_at:"1609-08-14T04:51:39-07:00", updated_at:"1609-08-14T04:51:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.1"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "Laertes shall be king! Laertes king!", created_at:"1609-08-14T05:01:37-07:00", updated_at:"1609-08-14T05:01:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "How cheerfully on the false trail they cry.", created_at:"1609-08-14T05:37:40-07:00", updated_at:"1609-08-14T05:37:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "O, this is counter, you false Danish dogs!", created_at:"1609-08-14T05:50:11-07:00", updated_at:"1609-08-14T05:50:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_62.id, body: "The doors are broke.", created_at:"1609-08-14T06:05:33-07:00", updated_at:"1609-08-14T06:05:33-07:00"})
