DirectMessageParticipant.create!({direct_message_id: direct_message_63.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_63.id, body: "Where is this king?—Sirs, stand you all without.", created_at:"1609-08-14T06:37:56-07:00", updated_at:"1609-08-14T06:37:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "FOLLOWERS.LAERTES"}).id, parent_type: "DirectMessage", parent_id: direct_message_63.id, body: "No, let’s come in!", created_at:"1609-08-14T07:12:45-07:00", updated_at:"1609-08-14T07:12:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_63.id, body: "I pray you, give me leave.", created_at:"1609-08-14T07:23:15-07:00", updated_at:"1609-08-14T07:23:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "FOLLOWERS.LAERTES"}).id, parent_type: "DirectMessage", parent_id: direct_message_63.id, body: "We will, we will.", created_at:"1609-08-14T07:27:25-07:00", updated_at:"1609-08-14T07:27:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_63.id, body: "I thank you. Keep the door. O, thou", created_at:"1609-08-14T07:47:52-07:00", updated_at:"1609-08-14T07:47:52-07:00"})
