Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "vile king,", created_at:"1609-08-14T08:05:59-07:00", updated_at:"1609-08-14T08:05:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Give me my father!", created_at:"1609-08-14T08:17:04-07:00", updated_at:"1609-08-14T08:17:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Calmly, good Laertes.", created_at:"1609-08-14T08:35:43-07:00", updated_at:"1609-08-14T08:35:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "That drop of blood that’s calm proclaims me", created_at:"1609-08-14T09:13:41-07:00", updated_at:"1609-08-14T09:13:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "bastard,", created_at:"1609-08-14T09:18:52-07:00", updated_at:"1609-08-14T09:18:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Cries cuckold to my father, brands the harlot", created_at:"1609-08-14T09:27:25-07:00", updated_at:"1609-08-14T09:27:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Even here between the chaste unsmirchèd brow", created_at:"1609-08-14T09:35:27-07:00", updated_at:"1609-08-14T09:35:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Of my true mother.", created_at:"1609-08-14T09:48:09-07:00", updated_at:"1609-08-14T09:48:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "What is the cause, Laertes,", created_at:"1609-08-14T09:48:56-07:00", updated_at:"1609-08-14T09:48:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "That thy rebellion looks so giant-like?—", created_at:"1609-08-14T09:54:12-07:00", updated_at:"1609-08-14T09:54:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Let him go, Gertrude. Do not fear our person.", created_at:"1609-08-14T10:34:09-07:00", updated_at:"1609-08-14T10:34:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "There’s such divinity doth hedge a king", created_at:"1609-08-14T10:41:23-07:00", updated_at:"1609-08-14T10:41:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "That treason can but peep to what it would,", created_at:"1609-08-14T10:46:15-07:00", updated_at:"1609-08-14T10:46:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Acts little of his will.—Tell me, Laertes,", created_at:"1609-08-14T10:55:28-07:00", updated_at:"1609-08-14T10:55:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Why thou art thus incensed.—Let him go,", created_at:"1609-08-14T11:13:31-07:00", updated_at:"1609-08-14T11:13:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Gertrude.—", created_at:"1609-08-14T11:50:45-07:00", updated_at:"1609-08-14T11:50:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Speak, man.", created_at:"1609-08-14T12:26:56-07:00", updated_at:"1609-08-14T12:26:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Where is my father?", created_at:"1609-08-14T12:32:01-07:00", updated_at:"1609-08-14T12:32:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Dead.", created_at:"1609-08-14T13:01:36-07:00", updated_at:"1609-08-14T13:01:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "But not by him.", created_at:"1609-08-14T13:12:41-07:00", updated_at:"1609-08-14T13:12:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Let him demand his fill.", created_at:"1609-08-14T13:28:11-07:00", updated_at:"1609-08-14T13:28:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "How came he dead? I’ll not be juggled with.", created_at:"1609-08-14T13:31:47-07:00", updated_at:"1609-08-14T13:31:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "To hell, allegiance! Vows, to the blackest devil!", created_at:"1609-08-14T13:45:04-07:00", updated_at:"1609-08-14T13:45:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Conscience and grace, to the profoundest pit!", created_at:"1609-08-14T13:52:52-07:00", updated_at:"1609-08-14T13:52:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "I dare damnation. To this point I stand,", created_at:"1609-08-14T14:20:31-07:00", updated_at:"1609-08-14T14:20:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "That both the worlds I give to negligence,", created_at:"1609-08-14T14:58:16-07:00", updated_at:"1609-08-14T14:58:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Let come what comes, only I’ll be revenged", created_at:"1609-08-14T15:25:40-07:00", updated_at:"1609-08-14T15:25:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Most throughly for my father.", created_at:"1609-08-14T15:55:16-07:00", updated_at:"1609-08-14T15:55:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Who shall stay you?", created_at:"1609-08-14T16:08:33-07:00", updated_at:"1609-08-14T16:08:33-07:00"})
