Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "Till our scale turn the beam! O rose of May,", created_at:"1609-08-15T01:14:09-07:00", updated_at:"1609-08-15T01:14:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "Dear maid, kind sister, sweet Ophelia!", created_at:"1609-08-15T01:31:55-07:00", updated_at:"1609-08-15T01:31:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "O heavens, is ’t possible a young maid’s wits", created_at:"1609-08-15T01:51:20-07:00", updated_at:"1609-08-15T01:51:20-07:00"})
