Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "Fare you well, my dove.", created_at:"1609-08-15T04:46:26-07:00", updated_at:"1609-08-15T04:46:26-07:00"})
