Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "A document in madness: thoughts and remembrance", created_at:"1609-08-15T08:22:37-07:00", updated_at:"1609-08-15T08:22:37-07:00"})
