Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "There’s fennel for you, and columbines.", created_at:"1609-08-15T09:00:35-07:00", updated_at:"1609-08-15T09:00:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "There’s rue for you, and here’s some for me; we", created_at:"1609-08-15T09:04:29-07:00", updated_at:"1609-08-15T09:04:29-07:00"})
