Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "your rue with a difference. There’s a daisy. I would", created_at:"1609-08-15T09:30:55-07:00", updated_at:"1609-08-15T09:30:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "give you some violets, but they withered all when", created_at:"1609-08-15T10:08:55-07:00", updated_at:"1609-08-15T10:08:55-07:00"})
