Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "For bonny sweet Robin is all my joy.", created_at:"1609-08-15T10:42:18-07:00", updated_at:"1609-08-15T10:42:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "Thought and afflictions, passion, hell itself", created_at:"1609-08-15T11:14:34-07:00", updated_at:"1609-08-15T11:14:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "She turns to favor and to prettiness.", created_at:"1609-08-15T11:39:30-07:00", updated_at:"1609-08-15T11:39:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "And will he not come again?", created_at:"1609-08-15T11:59:52-07:00", updated_at:"1609-08-15T11:59:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "And will he not come again?", created_at:"1609-08-15T12:11:30-07:00", updated_at:"1609-08-15T12:11:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "No, no, he is dead.", created_at:"1609-08-15T12:33:42-07:00", updated_at:"1609-08-15T12:33:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "Go to thy deathbed.", created_at:"1609-08-15T12:45:00-07:00", updated_at:"1609-08-15T12:45:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "He never will come again.", created_at:"1609-08-15T13:20:43-07:00", updated_at:"1609-08-15T13:20:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "His beard was as white as snow,", created_at:"1609-08-15T13:40:05-07:00", updated_at:"1609-08-15T13:40:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "All flaxen was his poll.", created_at:"1609-08-15T14:00:52-07:00", updated_at:"1609-08-15T14:00:52-07:00"})
