Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "And we cast away moan.", created_at:"1609-08-15T14:42:36-07:00", updated_at:"1609-08-15T14:42:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "God ’a mercy on his soul.", created_at:"1609-08-15T14:47:36-07:00", updated_at:"1609-08-15T14:47:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "And of all Christians’ souls, I pray God. God be wi’", created_at:"1609-08-15T15:23:44-07:00", updated_at:"1609-08-15T15:23:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Ophelia"}).id, parent_type: "DirectMessage", parent_id: direct_message_65.id, body: "you.", created_at:"1609-08-15T15:39:48-07:00", updated_at:"1609-08-15T15:39:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Do you see this, O God?", created_at:"1609-08-15T15:59:57-07:00", updated_at:"1609-08-15T15:59:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Laertes, I must commune with your grief,", created_at:"1609-08-15T16:26:21-07:00", updated_at:"1609-08-15T16:26:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Or you deny me right. Go but apart,", created_at:"1609-08-15T16:46:52-07:00", updated_at:"1609-08-15T16:46:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Make choice of whom your wisest friends you will,", created_at:"1609-08-15T16:59:19-07:00", updated_at:"1609-08-15T16:59:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "And they shall hear and judge ’twixt you and me.", created_at:"1609-08-15T17:19:53-07:00", updated_at:"1609-08-15T17:19:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "If by direct or by collateral hand", created_at:"1609-08-15T17:56:05-07:00", updated_at:"1609-08-15T17:56:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "They find us touched, we will our kingdom give,", created_at:"1609-08-15T18:26:12-07:00", updated_at:"1609-08-15T18:26:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Our crown, our life, and all that we call ours,", created_at:"1609-08-15T19:05:33-07:00", updated_at:"1609-08-15T19:05:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "To you in satisfaction; but if not,", created_at:"1609-08-15T19:18:48-07:00", updated_at:"1609-08-15T19:18:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Be you content to lend your patience to us,", created_at:"1609-08-15T19:21:27-07:00", updated_at:"1609-08-15T19:21:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "And we shall jointly labor with your soul", created_at:"1609-08-15T19:42:54-07:00", updated_at:"1609-08-15T19:42:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "To give it due content.", created_at:"1609-08-15T19:59:21-07:00", updated_at:"1609-08-15T19:59:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Let this be so.", created_at:"1609-08-15T20:36:56-07:00", updated_at:"1609-08-15T20:36:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "His means of death, his obscure funeral", created_at:"1609-08-15T21:15:45-07:00", updated_at:"1609-08-15T21:15:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "(No trophy, sword, nor hatchment o’er his bones,", created_at:"1609-08-15T21:42:38-07:00", updated_at:"1609-08-15T21:42:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "No noble rite nor formal ostentation)", created_at:"1609-08-15T21:56:24-07:00", updated_at:"1609-08-15T21:56:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "Cry to be heard, as ’twere from heaven to earth,", created_at:"1609-08-15T22:33:00-07:00", updated_at:"1609-08-15T22:33:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "That I must call ’t in question.", created_at:"1609-08-15T22:38:25-07:00", updated_at:"1609-08-15T22:38:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "So you shall,", created_at:"1609-08-15T23:06:12-07:00", updated_at:"1609-08-15T23:06:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "And where th’ offense is, let the great ax fall.", created_at:"1609-08-15T23:16:34-07:00", updated_at:"1609-08-15T23:16:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_64.id, body: "I pray you, go with me.", created_at:"1609-08-15T23:49:29-07:00", updated_at:"1609-08-15T23:49:29-07:00"})
