Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_66.id, body: "What are they that would speak with me?", created_at:"1609-08-16T00:23:22-07:00", updated_at:"1609-08-16T00:23:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_66.id, body: "Let them come in. I do not", created_at:"1609-08-16T00:46:44-07:00", updated_at:"1609-08-16T00:46:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_66.id, body: "know from what part of the world I should be", created_at:"1609-08-16T00:50:02-07:00", updated_at:"1609-08-16T00:50:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_66.id, body: "greeted, if not from Lord Hamlet.", created_at:"1609-08-16T01:18:54-07:00", updated_at:"1609-08-16T01:18:54-07:00"})
