DirectMessageParticipant.create!({direct_message_id: direct_message_67.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "Let Him bless thee too.", created_at:"1609-08-16T01:30:01-07:00", updated_at:"1609-08-16T01:30:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "Horatio, when thou shalt have", created_at:"1609-08-16T01:36:46-07:00", updated_at:"1609-08-16T01:36:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "overlooked this, give these fellows some means to the", created_at:"1609-08-16T01:52:58-07:00", updated_at:"1609-08-16T01:52:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "King. They have letters for him. Ere we were two days", created_at:"1609-08-16T01:58:28-07:00", updated_at:"1609-08-16T01:58:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "old at sea, a pirate of very warlike appointment gave", created_at:"1609-08-16T02:21:56-07:00", updated_at:"1609-08-16T02:21:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "us chase. Finding ourselves too slow of sail, we put on", created_at:"1609-08-16T02:48:07-07:00", updated_at:"1609-08-16T02:48:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "a compelled valor, and in the grapple I boarded them.", created_at:"1609-08-16T02:59:36-07:00", updated_at:"1609-08-16T02:59:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "On the instant, they got clear of our ship; so I alone", created_at:"1609-08-16T03:25:00-07:00", updated_at:"1609-08-16T03:25:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "became their prisoner. They have dealt with me like", created_at:"1609-08-16T03:56:24-07:00", updated_at:"1609-08-16T03:56:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "thieves of mercy, but they knew what they did: I am to", created_at:"1609-08-16T04:24:29-07:00", updated_at:"1609-08-16T04:24:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "do a good turn for them. Let the King have the letters", created_at:"1609-08-16T04:42:41-07:00", updated_at:"1609-08-16T04:42:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "I have sent, and repair thou to me with as much speed", created_at:"1609-08-16T05:09:19-07:00", updated_at:"1609-08-16T05:09:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "as thou wouldst fly death. I have words to speak in", created_at:"1609-08-16T05:32:25-07:00", updated_at:"1609-08-16T05:32:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "thine ear will make thee dumb; yet are they much too", created_at:"1609-08-16T05:40:13-07:00", updated_at:"1609-08-16T05:40:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "light for the bore of the matter. These good fellows", created_at:"1609-08-16T05:44:32-07:00", updated_at:"1609-08-16T05:44:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "will bring thee where I am. Rosencrantz and Guildenstern", created_at:"1609-08-16T05:50:30-07:00", updated_at:"1609-08-16T05:50:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "hold their course for England; of them I have", created_at:"1609-08-16T06:21:17-07:00", updated_at:"1609-08-16T06:21:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "much to tell thee. Farewell.", created_at:"1609-08-16T06:32:55-07:00", updated_at:"1609-08-16T06:32:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "He that thou knowest thine,", created_at:"1609-08-16T06:59:48-07:00", updated_at:"1609-08-16T06:59:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "Hamlet.", created_at:"1609-08-16T07:10:42-07:00", updated_at:"1609-08-16T07:10:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "Come, I will give you way for these your letters", created_at:"1609-08-16T07:12:30-07:00", updated_at:"1609-08-16T07:12:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "And do ’t the speedier that you may direct me", created_at:"1609-08-16T07:49:25-07:00", updated_at:"1609-08-16T07:49:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_67.id, body: "To him from whom you brought them.", created_at:"1609-08-16T08:00:27-07:00", updated_at:"1609-08-16T08:00:27-07:00"})
direct_message_68 = DirectMessage.create!({})
DirectMessageParticipant.create!({direct_message_id: direct_message_68.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Claudius@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_68.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "Laertes@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_68.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Now must your conscience my acquittance seal,", created_at:"1609-08-16T08:05:33-07:00", updated_at:"1609-08-16T08:05:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And you must put me in your heart for friend,", created_at:"1609-08-16T08:24:47-07:00", updated_at:"1609-08-16T08:24:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Sith you have heard, and with a knowing ear,", created_at:"1609-08-16T08:31:46-07:00", updated_at:"1609-08-16T08:31:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That he which hath your noble father slain", created_at:"1609-08-16T08:42:32-07:00", updated_at:"1609-08-16T08:42:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Pursued my life.", created_at:"1609-08-16T09:07:05-07:00", updated_at:"1609-08-16T09:07:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "It well appears. But tell me", created_at:"1609-08-16T09:46:17-07:00", updated_at:"1609-08-16T09:46:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Why you proceeded not against these feats,", created_at:"1609-08-16T10:02:44-07:00", updated_at:"1609-08-16T10:02:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "So criminal and so capital in nature,", created_at:"1609-08-16T10:27:06-07:00", updated_at:"1609-08-16T10:27:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "As by your safety, greatness, wisdom, all things else,", created_at:"1609-08-16T10:34:19-07:00", updated_at:"1609-08-16T10:34:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "You mainly were stirred up.", created_at:"1609-08-16T10:47:38-07:00", updated_at:"1609-08-16T10:47:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "O, for two special reasons,", created_at:"1609-08-16T10:47:53-07:00", updated_at:"1609-08-16T10:47:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Which may to you perhaps seem much unsinewed,", created_at:"1609-08-16T11:14:55-07:00", updated_at:"1609-08-16T11:14:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "But yet to me they’re strong. The Queen his mother", created_at:"1609-08-16T11:43:56-07:00", updated_at:"1609-08-16T11:43:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Lives almost by his looks, and for myself", created_at:"1609-08-16T12:22:54-07:00", updated_at:"1609-08-16T12:22:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "(My virtue or my plague, be it either which),", created_at:"1609-08-16T12:30:55-07:00", updated_at:"1609-08-16T12:30:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "She is so conjunctive to my life and soul", created_at:"1609-08-16T12:36:55-07:00", updated_at:"1609-08-16T12:36:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That, as the star moves not but in his sphere,", created_at:"1609-08-16T12:48:17-07:00", updated_at:"1609-08-16T12:48:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I could not but by her. The other motive", created_at:"1609-08-16T13:18:13-07:00", updated_at:"1609-08-16T13:18:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Why to a public count I might not go", created_at:"1609-08-16T13:46:03-07:00", updated_at:"1609-08-16T13:46:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Is the great love the general gender bear him,", created_at:"1609-08-16T14:23:17-07:00", updated_at:"1609-08-16T14:23:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Who, dipping all his faults in their affection,", created_at:"1609-08-16T14:54:38-07:00", updated_at:"1609-08-16T14:54:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Work like the spring that turneth wood to stone,", created_at:"1609-08-16T15:27:41-07:00", updated_at:"1609-08-16T15:27:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Convert his gyves to graces, so that my arrows,", created_at:"1609-08-16T15:38:00-07:00", updated_at:"1609-08-16T15:38:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Too slightly timbered for so loud a wind,", created_at:"1609-08-16T15:48:38-07:00", updated_at:"1609-08-16T15:48:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Would have reverted to my bow again,", created_at:"1609-08-16T15:49:51-07:00", updated_at:"1609-08-16T15:49:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "But not where I have aimed them.", created_at:"1609-08-16T16:09:52-07:00", updated_at:"1609-08-16T16:09:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And so have I a noble father lost,", created_at:"1609-08-16T16:29:05-07:00", updated_at:"1609-08-16T16:29:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A sister driven into desp’rate terms,", created_at:"1609-08-16T16:54:33-07:00", updated_at:"1609-08-16T16:54:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Whose worth, if praises may go back again,", created_at:"1609-08-16T17:23:49-07:00", updated_at:"1609-08-16T17:23:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Stood challenger on mount of all the age", created_at:"1609-08-16T17:51:21-07:00", updated_at:"1609-08-16T17:51:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "For her perfections. But my revenge will come.", created_at:"1609-08-16T17:54:21-07:00", updated_at:"1609-08-16T17:54:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Break not your sleeps for that. You must not think", created_at:"1609-08-16T18:33:00-07:00", updated_at:"1609-08-16T18:33:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That we are made of stuff so flat and dull", created_at:"1609-08-16T19:03:42-07:00", updated_at:"1609-08-16T19:03:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That we can let our beard be shook with danger", created_at:"1609-08-16T19:14:24-07:00", updated_at:"1609-08-16T19:14:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And think it pastime. You shortly shall hear more.", created_at:"1609-08-16T19:27:52-07:00", updated_at:"1609-08-16T19:27:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I loved your father, and we love ourself,", created_at:"1609-08-16T20:01:01-07:00", updated_at:"1609-08-16T20:01:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And that, I hope, will teach you to imagine—", created_at:"1609-08-16T20:28:08-07:00", updated_at:"1609-08-16T20:28:08-07:00"})
