User.create!({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, display_name: "MESSENGERS.2", email: "MESSENGERS.2@hamlet.com", password: "password"})
DirectMessageParticipant.create!({direct_message_id: direct_message_69.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "MESSENGERS.2@hamlet.com"}).id})
DirectMessageParticipant.create!({direct_message_id: direct_message_69.id, participant_id: User.find_by({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, email: "user@demo.com"}).id})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "How now? What news?", created_at:"1609-08-16T20:29:05-07:00", updated_at:"1609-08-16T20:29:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.2"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "Letters, my lord, from", created_at:"1609-08-16T20:53:33-07:00", updated_at:"1609-08-16T20:53:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.2"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "Hamlet.", created_at:"1609-08-16T21:18:48-07:00", updated_at:"1609-08-16T21:18:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.2"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "These to your Majesty, this to the Queen.", created_at:"1609-08-16T21:42:30-07:00", updated_at:"1609-08-16T21:42:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "From Hamlet? Who brought them?", created_at:"1609-08-16T22:18:36-07:00", updated_at:"1609-08-16T22:18:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.2"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "Sailors, my lord, they say. I saw them not.", created_at:"1609-08-16T22:48:43-07:00", updated_at:"1609-08-16T22:48:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.2"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "They were given me by Claudio. He received them", created_at:"1609-08-16T23:22:10-07:00", updated_at:"1609-08-16T23:22:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "MESSENGERS.2"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "Of him that brought them.", created_at:"1609-08-16T23:29:31-07:00", updated_at:"1609-08-16T23:29:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "Laertes, you shall hear", created_at:"1609-08-17T00:04:40-07:00", updated_at:"1609-08-17T00:04:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "them.—", created_at:"1609-08-17T00:40:49-07:00", updated_at:"1609-08-17T00:40:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_69.id, body: "Leave us.", created_at:"1609-08-17T01:07:30-07:00", updated_at:"1609-08-17T01:07:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "High and mighty, you shall know I am set", created_at:"1609-08-17T01:27:47-07:00", updated_at:"1609-08-17T01:27:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "naked on your kingdom. Tomorrow shall I beg leave to", created_at:"1609-08-17T02:00:12-07:00", updated_at:"1609-08-17T02:00:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "see your kingly eyes, when I shall (first asking your", created_at:"1609-08-17T02:09:23-07:00", updated_at:"1609-08-17T02:09:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "pardon) thereunto recount the occasion of my sudden", created_at:"1609-08-17T02:21:03-07:00", updated_at:"1609-08-17T02:21:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "and more strange return. Hamlet.", created_at:"1609-08-17T02:29:10-07:00", updated_at:"1609-08-17T02:29:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "What should this mean? Are all the rest come back?", created_at:"1609-08-17T02:34:13-07:00", updated_at:"1609-08-17T02:34:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Or is it some abuse and no such thing?", created_at:"1609-08-17T02:48:08-07:00", updated_at:"1609-08-17T02:48:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Know you the hand?", created_at:"1609-08-17T02:55:41-07:00", updated_at:"1609-08-17T02:55:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "’Tis Hamlet’s character. Naked—", created_at:"1609-08-17T03:09:41-07:00", updated_at:"1609-08-17T03:09:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And in a postscript here, he says alone.", created_at:"1609-08-17T03:13:12-07:00", updated_at:"1609-08-17T03:13:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Can you advise me?", created_at:"1609-08-17T03:21:18-07:00", updated_at:"1609-08-17T03:21:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I am lost in it, my lord. But let him come.", created_at:"1609-08-17T03:50:18-07:00", updated_at:"1609-08-17T03:50:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "It warms the very sickness in my heart", created_at:"1609-08-17T04:12:02-07:00", updated_at:"1609-08-17T04:12:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That I shall live and tell him to his teeth", created_at:"1609-08-17T04:47:25-07:00", updated_at:"1609-08-17T04:47:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Thus didst thou.", created_at:"1609-08-17T04:51:22-07:00", updated_at:"1609-08-17T04:51:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "If it be so, Laertes", created_at:"1609-08-17T05:01:06-07:00", updated_at:"1609-08-17T05:01:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "(As how should it be so? how otherwise?),", created_at:"1609-08-17T05:25:18-07:00", updated_at:"1609-08-17T05:25:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Will you be ruled by me?", created_at:"1609-08-17T05:52:31-07:00", updated_at:"1609-08-17T05:52:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Ay, my lord,", created_at:"1609-08-17T06:07:52-07:00", updated_at:"1609-08-17T06:07:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "So you will not o’errule me to a peace.", created_at:"1609-08-17T06:29:50-07:00", updated_at:"1609-08-17T06:29:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "To thine own peace. If he be now returned,", created_at:"1609-08-17T06:52:37-07:00", updated_at:"1609-08-17T06:52:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "As checking at his voyage, and that he means", created_at:"1609-08-17T07:09:41-07:00", updated_at:"1609-08-17T07:09:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "No more to undertake it, I will work him", created_at:"1609-08-17T07:35:23-07:00", updated_at:"1609-08-17T07:35:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "To an exploit, now ripe in my device,", created_at:"1609-08-17T07:54:18-07:00", updated_at:"1609-08-17T07:54:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Under the which he shall not choose but fall;", created_at:"1609-08-17T08:23:21-07:00", updated_at:"1609-08-17T08:23:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And for his death no wind of blame shall breathe,", created_at:"1609-08-17T08:48:42-07:00", updated_at:"1609-08-17T08:48:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "But even his mother shall uncharge the practice", created_at:"1609-08-17T09:13:39-07:00", updated_at:"1609-08-17T09:13:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And call it accident.", created_at:"1609-08-17T09:41:53-07:00", updated_at:"1609-08-17T09:41:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "My lord, I will be ruled,", created_at:"1609-08-17T09:44:16-07:00", updated_at:"1609-08-17T09:44:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "The rather if you could devise it so", created_at:"1609-08-17T09:59:08-07:00", updated_at:"1609-08-17T09:59:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That I might be the organ.", created_at:"1609-08-17T09:59:43-07:00", updated_at:"1609-08-17T09:59:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "It falls right.", created_at:"1609-08-17T10:00:11-07:00", updated_at:"1609-08-17T10:00:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "You have been talked of since your travel much,", created_at:"1609-08-17T10:30:40-07:00", updated_at:"1609-08-17T10:30:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And that in Hamlet’s hearing, for a quality", created_at:"1609-08-17T10:53:34-07:00", updated_at:"1609-08-17T10:53:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Wherein they say you shine. Your sum of parts", created_at:"1609-08-17T11:29:00-07:00", updated_at:"1609-08-17T11:29:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Did not together pluck such envy from him", created_at:"1609-08-17T11:30:09-07:00", updated_at:"1609-08-17T11:30:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "As did that one, and that, in my regard,", created_at:"1609-08-17T11:41:55-07:00", updated_at:"1609-08-17T11:41:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Of the unworthiest siege.", created_at:"1609-08-17T11:44:32-07:00", updated_at:"1609-08-17T11:44:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "What part is that, my lord?", created_at:"1609-08-17T12:12:21-07:00", updated_at:"1609-08-17T12:12:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A very ribbon in the cap of youth—", created_at:"1609-08-17T12:20:55-07:00", updated_at:"1609-08-17T12:20:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Yet needful too, for youth no less becomes", created_at:"1609-08-17T12:29:45-07:00", updated_at:"1609-08-17T12:29:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "The light and careless livery that it wears", created_at:"1609-08-17T12:42:51-07:00", updated_at:"1609-08-17T12:42:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Than settled age his sables and his weeds,", created_at:"1609-08-17T12:47:00-07:00", updated_at:"1609-08-17T12:47:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Importing health and graveness. Two months since", created_at:"1609-08-17T13:20:29-07:00", updated_at:"1609-08-17T13:20:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Here was a gentleman of Normandy.", created_at:"1609-08-17T13:22:33-07:00", updated_at:"1609-08-17T13:22:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I have seen myself, and served against, the French,", created_at:"1609-08-17T13:49:49-07:00", updated_at:"1609-08-17T13:49:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And they can well on horseback, but this gallant", created_at:"1609-08-17T14:09:29-07:00", updated_at:"1609-08-17T14:09:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Had witchcraft in ’t. He grew unto his seat,", created_at:"1609-08-17T14:48:07-07:00", updated_at:"1609-08-17T14:48:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And to such wondrous doing brought his horse", created_at:"1609-08-17T14:57:55-07:00", updated_at:"1609-08-17T14:57:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "As had he been encorpsed and demi-natured", created_at:"1609-08-17T15:01:12-07:00", updated_at:"1609-08-17T15:01:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "With the brave beast. So far he topped my thought", created_at:"1609-08-17T15:03:46-07:00", updated_at:"1609-08-17T15:03:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That I in forgery of shapes and tricks", created_at:"1609-08-17T15:30:16-07:00", updated_at:"1609-08-17T15:30:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Come short of what he did.", created_at:"1609-08-17T15:52:55-07:00", updated_at:"1609-08-17T15:52:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A Norman was ’t?", created_at:"1609-08-17T16:00:07-07:00", updated_at:"1609-08-17T16:00:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A Norman.", created_at:"1609-08-17T16:20:55-07:00", updated_at:"1609-08-17T16:20:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Upon my life, Lamord.", created_at:"1609-08-17T17:00:22-07:00", updated_at:"1609-08-17T17:00:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "The very same.", created_at:"1609-08-17T17:11:35-07:00", updated_at:"1609-08-17T17:11:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I know him well. He is the brooch indeed", created_at:"1609-08-17T17:18:22-07:00", updated_at:"1609-08-17T17:18:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And gem of all the nation.", created_at:"1609-08-17T17:43:51-07:00", updated_at:"1609-08-17T17:43:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "He made confession of you", created_at:"1609-08-17T18:01:48-07:00", updated_at:"1609-08-17T18:01:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And gave you such a masterly report", created_at:"1609-08-17T18:37:14-07:00", updated_at:"1609-08-17T18:37:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "For art and exercise in your defense,", created_at:"1609-08-17T18:49:33-07:00", updated_at:"1609-08-17T18:49:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And for your rapier most especial,", created_at:"1609-08-17T18:59:18-07:00", updated_at:"1609-08-17T18:59:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That he cried out ’twould be a sight indeed", created_at:"1609-08-17T19:09:01-07:00", updated_at:"1609-08-17T19:09:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "If one could match you. The ’scrimers of their", created_at:"1609-08-17T19:32:08-07:00", updated_at:"1609-08-17T19:32:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "nation", created_at:"1609-08-17T19:46:16-07:00", updated_at:"1609-08-17T19:46:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "He swore had neither motion, guard, nor eye,", created_at:"1609-08-17T20:07:52-07:00", updated_at:"1609-08-17T20:07:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "If you opposed them. Sir, this report of his", created_at:"1609-08-17T20:16:43-07:00", updated_at:"1609-08-17T20:16:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Did Hamlet so envenom with his envy", created_at:"1609-08-17T20:51:36-07:00", updated_at:"1609-08-17T20:51:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That he could nothing do but wish and beg", created_at:"1609-08-17T21:05:44-07:00", updated_at:"1609-08-17T21:05:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Your sudden coming-o’er, to play with you.", created_at:"1609-08-17T21:35:45-07:00", updated_at:"1609-08-17T21:35:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Now out of this—", created_at:"1609-08-17T21:58:55-07:00", updated_at:"1609-08-17T21:58:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "What out of this, my lord?", created_at:"1609-08-17T22:29:35-07:00", updated_at:"1609-08-17T22:29:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Laertes, was your father dear to you?", created_at:"1609-08-17T22:33:55-07:00", updated_at:"1609-08-17T22:33:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Or are you like the painting of a sorrow,", created_at:"1609-08-17T22:53:47-07:00", updated_at:"1609-08-17T22:53:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A face without a heart?", created_at:"1609-08-17T23:02:00-07:00", updated_at:"1609-08-17T23:02:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Why ask you this?", created_at:"1609-08-17T23:26:18-07:00", updated_at:"1609-08-17T23:26:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Not that I think you did not love your father,", created_at:"1609-08-17T23:49:43-07:00", updated_at:"1609-08-17T23:49:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "But that I know love is begun by time", created_at:"1609-08-18T00:24:52-07:00", updated_at:"1609-08-18T00:24:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And that I see, in passages of proof,", created_at:"1609-08-18T00:40:45-07:00", updated_at:"1609-08-18T00:40:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Time qualifies the spark and fire of it.", created_at:"1609-08-18T01:04:40-07:00", updated_at:"1609-08-18T01:04:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "There lives within the very flame of love", created_at:"1609-08-18T01:18:04-07:00", updated_at:"1609-08-18T01:18:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A kind of wick or snuff that will abate it,", created_at:"1609-08-18T01:20:17-07:00", updated_at:"1609-08-18T01:20:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And nothing is at a like goodness still;", created_at:"1609-08-18T01:53:51-07:00", updated_at:"1609-08-18T01:53:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "For goodness, growing to a pleurisy,", created_at:"1609-08-18T01:59:56-07:00", updated_at:"1609-08-18T01:59:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Dies in his own too-much. That we would do", created_at:"1609-08-18T02:29:01-07:00", updated_at:"1609-08-18T02:29:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "We should do when we would; for this would", created_at:"1609-08-18T02:51:45-07:00", updated_at:"1609-08-18T02:51:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "changes", created_at:"1609-08-18T03:17:35-07:00", updated_at:"1609-08-18T03:17:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And hath abatements and delays as many", created_at:"1609-08-18T03:38:03-07:00", updated_at:"1609-08-18T03:38:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "As there are tongues, are hands, are accidents;", created_at:"1609-08-18T03:47:47-07:00", updated_at:"1609-08-18T03:47:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And then this should is like a spendthrift sigh,", created_at:"1609-08-18T04:08:35-07:00", updated_at:"1609-08-18T04:08:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That hurts by easing. But to the quick of th’ ulcer:", created_at:"1609-08-18T04:37:16-07:00", updated_at:"1609-08-18T04:37:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Hamlet comes back; what would you undertake", created_at:"1609-08-18T05:11:25-07:00", updated_at:"1609-08-18T05:11:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "To show yourself indeed your father’s son", created_at:"1609-08-18T05:34:26-07:00", updated_at:"1609-08-18T05:34:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "More than in words?", created_at:"1609-08-18T06:07:14-07:00", updated_at:"1609-08-18T06:07:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "To cut his throat i’ th’ church.", created_at:"1609-08-18T06:22:38-07:00", updated_at:"1609-08-18T06:22:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "No place indeed should murder sanctuarize;", created_at:"1609-08-18T06:51:11-07:00", updated_at:"1609-08-18T06:51:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Revenge should have no bounds. But, good Laertes,", created_at:"1609-08-18T07:29:12-07:00", updated_at:"1609-08-18T07:29:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Will you do this? Keep close within your chamber.", created_at:"1609-08-18T07:58:16-07:00", updated_at:"1609-08-18T07:58:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Hamlet, returned, shall know you are come home.", created_at:"1609-08-18T08:22:15-07:00", updated_at:"1609-08-18T08:22:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "We’ll put on those shall praise your excellence", created_at:"1609-08-18T08:22:54-07:00", updated_at:"1609-08-18T08:22:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And set a double varnish on the fame", created_at:"1609-08-18T08:49:12-07:00", updated_at:"1609-08-18T08:49:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "The Frenchman gave you; bring you, in fine,", created_at:"1609-08-18T09:24:14-07:00", updated_at:"1609-08-18T09:24:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "together", created_at:"1609-08-18T09:32:05-07:00", updated_at:"1609-08-18T09:32:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And wager on your heads. He, being remiss,", created_at:"1609-08-18T10:11:49-07:00", updated_at:"1609-08-18T10:11:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Most generous, and free from all contriving,", created_at:"1609-08-18T10:23:32-07:00", updated_at:"1609-08-18T10:23:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Will not peruse the foils, so that with ease,", created_at:"1609-08-18T10:35:36-07:00", updated_at:"1609-08-18T10:35:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Or with a little shuffling, you may choose", created_at:"1609-08-18T11:02:28-07:00", updated_at:"1609-08-18T11:02:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A sword unbated, and in a pass of practice", created_at:"1609-08-18T11:12:25-07:00", updated_at:"1609-08-18T11:12:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Requite him for your father.", created_at:"1609-08-18T11:21:42-07:00", updated_at:"1609-08-18T11:21:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I will do ’t,", created_at:"1609-08-18T11:40:31-07:00", updated_at:"1609-08-18T11:40:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And for that purpose I’ll anoint my sword.", created_at:"1609-08-18T12:13:32-07:00", updated_at:"1609-08-18T12:13:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I bought an unction of a mountebank", created_at:"1609-08-18T12:34:11-07:00", updated_at:"1609-08-18T12:34:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "So mortal that, but dip a knife in it,", created_at:"1609-08-18T12:44:42-07:00", updated_at:"1609-08-18T12:44:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Where it draws blood no cataplasm so rare,", created_at:"1609-08-18T12:52:23-07:00", updated_at:"1609-08-18T12:52:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Collected from all simples that have virtue", created_at:"1609-08-18T12:57:34-07:00", updated_at:"1609-08-18T12:57:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Under the moon, can save the thing from death", created_at:"1609-08-18T13:36:02-07:00", updated_at:"1609-08-18T13:36:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "That is but scratched withal. I’ll touch my point", created_at:"1609-08-18T13:51:09-07:00", updated_at:"1609-08-18T13:51:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "With this contagion, that, if I gall him slightly,", created_at:"1609-08-18T13:51:31-07:00", updated_at:"1609-08-18T13:51:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "It may be death.", created_at:"1609-08-18T14:10:49-07:00", updated_at:"1609-08-18T14:10:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Let’s further think of this,", created_at:"1609-08-18T14:25:31-07:00", updated_at:"1609-08-18T14:25:31-07:00"})
