Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "Should have a back or second that might hold", created_at:"1609-08-18T16:57:55-07:00", updated_at:"1609-08-18T16:57:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "If this did blast in proof. Soft, let me see.", created_at:"1609-08-18T17:26:16-07:00", updated_at:"1609-08-18T17:26:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "We’ll make a solemn wager on your cunnings—", created_at:"1609-08-18T17:47:10-07:00", updated_at:"1609-08-18T17:47:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "I ha ’t!", created_at:"1609-08-18T18:08:36-07:00", updated_at:"1609-08-18T18:08:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "When in your motion you are hot and dry", created_at:"1609-08-18T18:46:46-07:00", updated_at:"1609-08-18T18:46:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "(As make your bouts more violent to that end)", created_at:"1609-08-18T19:15:04-07:00", updated_at:"1609-08-18T19:15:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "And that he calls for drink, I’ll have prepared", created_at:"1609-08-18T19:27:09-07:00", updated_at:"1609-08-18T19:27:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "him", created_at:"1609-08-18T19:48:41-07:00", updated_at:"1609-08-18T19:48:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "A chalice for the nonce, whereon but sipping,", created_at:"1609-08-18T20:10:45-07:00", updated_at:"1609-08-18T20:10:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_68.id, body: "If he by chance escape your venomed stuck,", created_at:"1609-08-18T20:26:53-07:00", updated_at:"1609-08-18T20:26:53-07:00"})
