Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "One woe doth tread upon another’s heel,", created_at:"1609-08-18T21:24:24-07:00", updated_at:"1609-08-18T21:24:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "So fast they follow. Your sister’s drowned, Laertes.", created_at:"1609-08-18T21:36:54-07:00", updated_at:"1609-08-18T21:36:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Drowned? O, where?", created_at:"1609-08-18T21:54:13-07:00", updated_at:"1609-08-18T21:54:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "There is a willow grows askant the brook", created_at:"1609-08-18T22:14:06-07:00", updated_at:"1609-08-18T22:14:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "That shows his hoar leaves in the glassy stream.", created_at:"1609-08-18T22:31:52-07:00", updated_at:"1609-08-18T22:31:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Therewith fantastic garlands did she make", created_at:"1609-08-18T23:03:45-07:00", updated_at:"1609-08-18T23:03:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Of crowflowers, nettles, daisies, and long purples,", created_at:"1609-08-18T23:06:16-07:00", updated_at:"1609-08-18T23:06:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "That liberal shepherds give a grosser name,", created_at:"1609-08-18T23:22:15-07:00", updated_at:"1609-08-18T23:22:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "But our cold maids do dead men’s fingers call", created_at:"1609-08-18T23:50:45-07:00", updated_at:"1609-08-18T23:50:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "them.", created_at:"1609-08-18T23:58:13-07:00", updated_at:"1609-08-18T23:58:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "There on the pendant boughs her coronet weeds", created_at:"1609-08-19T00:12:58-07:00", updated_at:"1609-08-19T00:12:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Clamb’ring to hang, an envious sliver broke,", created_at:"1609-08-19T00:24:32-07:00", updated_at:"1609-08-19T00:24:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "When down her weedy trophies and herself", created_at:"1609-08-19T00:58:47-07:00", updated_at:"1609-08-19T00:58:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Fell in the weeping brook. Her clothes spread wide,", created_at:"1609-08-19T01:08:18-07:00", updated_at:"1609-08-19T01:08:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "And mermaid-like awhile they bore her up,", created_at:"1609-08-19T01:46:05-07:00", updated_at:"1609-08-19T01:46:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Which time she chanted snatches of old lauds,", created_at:"1609-08-19T02:06:57-07:00", updated_at:"1609-08-19T02:06:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "As one incapable of her own distress", created_at:"1609-08-19T02:40:33-07:00", updated_at:"1609-08-19T02:40:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Or like a creature native and endued", created_at:"1609-08-19T02:54:30-07:00", updated_at:"1609-08-19T02:54:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Unto that element. But long it could not be", created_at:"1609-08-19T03:17:12-07:00", updated_at:"1609-08-19T03:17:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Till that her garments, heavy with their drink,", created_at:"1609-08-19T03:50:34-07:00", updated_at:"1609-08-19T03:50:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Pulled the poor wretch from her melodious lay", created_at:"1609-08-19T04:16:40-07:00", updated_at:"1609-08-19T04:16:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "To muddy death.", created_at:"1609-08-19T04:49:46-07:00", updated_at:"1609-08-19T04:49:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Alas, then she is drowned.", created_at:"1609-08-19T04:55:52-07:00", updated_at:"1609-08-19T04:55:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Drowned, drowned.", created_at:"1609-08-19T05:22:30-07:00", updated_at:"1609-08-19T05:22:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Too much of water hast thou, poor Ophelia,", created_at:"1609-08-19T05:59:15-07:00", updated_at:"1609-08-19T05:59:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "And therefore I forbid my tears. But yet", created_at:"1609-08-19T06:04:07-07:00", updated_at:"1609-08-19T06:04:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "It is our trick; nature her custom holds,", created_at:"1609-08-19T06:05:13-07:00", updated_at:"1609-08-19T06:05:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "Let shame say what it will. When these are gone,", created_at:"1609-08-19T06:21:05-07:00", updated_at:"1609-08-19T06:21:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "The woman will be out.—Adieu, my lord.", created_at:"1609-08-19T06:57:03-07:00", updated_at:"1609-08-19T06:57:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "I have a speech o’ fire that fain would blaze,", created_at:"1609-08-19T07:07:14-07:00", updated_at:"1609-08-19T07:07:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "DirectMessage", parent_id: direct_message_70.id, body: "But that this folly drowns it.", created_at:"1609-08-19T07:32:28-07:00", updated_at:"1609-08-19T07:32:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Let’s follow, Gertrude.", created_at:"1609-08-19T07:51:12-07:00", updated_at:"1609-08-19T07:51:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "How much I had to do to calm his rage!", created_at:"1609-08-19T07:59:42-07:00", updated_at:"1609-08-19T07:59:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Now fear I this will give it start again.", created_at:"1609-08-19T08:25:41-07:00", updated_at:"1609-08-19T08:25:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "DirectMessage", parent_id: direct_message_48.id, body: "Therefore, let’s follow.", created_at:"1609-08-19T08:27:53-07:00", updated_at:"1609-08-19T08:27:53-07:00"})
