Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "Is she to be buried in Christian burial,", created_at:"1609-08-19T08:50:32-07:00", updated_at:"1609-08-19T08:50:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "when she willfully seeks her own salvation?", created_at:"1609-08-19T08:57:39-07:00", updated_at:"1609-08-19T08:57:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "How can that be, unless she drowned", created_at:"1609-08-19T09:24:05-07:00", updated_at:"1609-08-19T09:24:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "herself in her own defense?", created_at:"1609-08-19T09:32:10-07:00", updated_at:"1609-08-19T09:32:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "It must be se offendendo; it cannot be", created_at:"1609-08-19T09:51:33-07:00", updated_at:"1609-08-19T09:51:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "else. For here lies the point: if I drown myself", created_at:"1609-08-19T10:27:50-07:00", updated_at:"1609-08-19T10:27:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "wittingly, it argues an act, and an act hath three", created_at:"1609-08-19T10:34:23-07:00", updated_at:"1609-08-19T10:34:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "branches—it is to act, to do, to perform. Argal, she", created_at:"1609-08-19T11:00:19-07:00", updated_at:"1609-08-19T11:00:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "drowned herself wittingly.", created_at:"1609-08-19T11:17:38-07:00", updated_at:"1609-08-19T11:17:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "Give me leave. Here lies the water;", created_at:"1609-08-19T11:50:01-07:00", updated_at:"1609-08-19T11:50:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "good. Here stands the man; good. If the man go to", created_at:"1609-08-19T12:23:20-07:00", updated_at:"1609-08-19T12:23:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "this water and drown himself, it is (will he, nill he)", created_at:"1609-08-19T12:29:02-07:00", updated_at:"1609-08-19T12:29:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "he goes; mark you that. But if the water come to him", created_at:"1609-08-19T12:54:16-07:00", updated_at:"1609-08-19T12:54:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "and drown him, he drowns not himself. Argal, he", created_at:"1609-08-19T13:28:07-07:00", updated_at:"1609-08-19T13:28:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "that is not guilty of his own death shortens not his", created_at:"1609-08-19T13:49:43-07:00", updated_at:"1609-08-19T13:49:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "own life.", created_at:"1609-08-19T14:11:22-07:00", updated_at:"1609-08-19T14:11:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "Ay, marry, is ’t—crowner’s ’quest law.", created_at:"1609-08-19T14:19:34-07:00", updated_at:"1609-08-19T14:19:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "Why, there thou sayst. And the more", created_at:"1609-08-19T14:28:31-07:00", updated_at:"1609-08-19T14:28:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "pity that great folk should have count’nance in this", created_at:"1609-08-19T14:55:15-07:00", updated_at:"1609-08-19T14:55:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "world to drown or hang themselves more than", created_at:"1609-08-19T15:15:03-07:00", updated_at:"1609-08-19T15:15:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "their even-Christian. Come, my spade. There is no", created_at:"1609-08-19T15:26:23-07:00", updated_at:"1609-08-19T15:26:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "ancient gentlemen but gard’ners, ditchers, and", created_at:"1609-08-19T15:29:43-07:00", updated_at:"1609-08-19T15:29:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_71.id, body: "grave-makers. They hold up Adam’s profession.", created_at:"1609-08-19T15:55:57-07:00", updated_at:"1609-08-19T15:55:57-07:00"})
