Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "length and breadth of a pair of indentures? The very", created_at:"1609-08-20T14:22:06-07:00", updated_at:"1609-08-20T14:22:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "conveyances of his lands will scarcely lie in this box,", created_at:"1609-08-20T14:43:25-07:00", updated_at:"1609-08-20T14:43:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "and must th’ inheritor himself have no more, ha?", created_at:"1609-08-20T15:18:38-07:00", updated_at:"1609-08-20T15:18:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Not a jot more, my lord.", created_at:"1609-08-20T15:54:04-07:00", updated_at:"1609-08-20T15:54:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Is not parchment made of sheepskins?", created_at:"1609-08-20T15:54:47-07:00", updated_at:"1609-08-20T15:54:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Ay, my lord, and of calves’ skins too.", created_at:"1609-08-20T16:21:18-07:00", updated_at:"1609-08-20T16:21:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "They are sheep and calves which seek out", created_at:"1609-08-20T16:56:09-07:00", updated_at:"1609-08-20T16:56:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "assurance in that. I will speak to this fellow.—", created_at:"1609-08-20T17:14:23-07:00", updated_at:"1609-08-20T17:14:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Whose grave’s this, sirrah?", created_at:"1609-08-20T17:49:02-07:00", updated_at:"1609-08-20T17:49:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Mine, sir.", created_at:"1609-08-20T18:22:59-07:00", updated_at:"1609-08-20T18:22:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "O, a pit of clay for to be made", created_at:"1609-08-20T18:34:51-07:00", updated_at:"1609-08-20T18:34:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "For such a guest is meet.", created_at:"1609-08-20T18:59:13-07:00", updated_at:"1609-08-20T18:59:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "I think it be thine indeed, for thou liest in ’t.", created_at:"1609-08-20T19:19:48-07:00", updated_at:"1609-08-20T19:19:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "You lie out on ’t, sir, and therefore ’tis", created_at:"1609-08-20T19:59:43-07:00", updated_at:"1609-08-20T19:59:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "not yours. For my part, I do not lie in ’t, yet it is", created_at:"1609-08-20T20:00:39-07:00", updated_at:"1609-08-20T20:00:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "mine.", created_at:"1609-08-20T20:29:14-07:00", updated_at:"1609-08-20T20:29:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Thou dost lie in ’t, to be in ’t and say it is thine.", created_at:"1609-08-20T20:38:37-07:00", updated_at:"1609-08-20T20:38:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "’Tis for the dead, not for the quick; therefore thou", created_at:"1609-08-20T21:12:02-07:00", updated_at:"1609-08-20T21:12:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "liest.", created_at:"1609-08-20T21:21:24-07:00", updated_at:"1609-08-20T21:21:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "’Tis a quick lie, sir; ’twill away again", created_at:"1609-08-20T21:54:20-07:00", updated_at:"1609-08-20T21:54:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "from me to you.", created_at:"1609-08-20T22:10:46-07:00", updated_at:"1609-08-20T22:10:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "What man dost thou dig it for?", created_at:"1609-08-20T22:26:12-07:00", updated_at:"1609-08-20T22:26:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "For no man, sir.", created_at:"1609-08-20T22:44:56-07:00", updated_at:"1609-08-20T22:44:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "What woman then?", created_at:"1609-08-20T22:52:07-07:00", updated_at:"1609-08-20T22:52:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "For none, neither.", created_at:"1609-08-20T23:01:42-07:00", updated_at:"1609-08-20T23:01:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Who is to be buried in ’t?", created_at:"1609-08-20T23:18:40-07:00", updated_at:"1609-08-20T23:18:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "One that was a woman, sir, but, rest", created_at:"1609-08-20T23:25:47-07:00", updated_at:"1609-08-20T23:25:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "her soul, she’s dead.", created_at:"1609-08-20T23:55:33-07:00", updated_at:"1609-08-20T23:55:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "How absolute the knave is! We must speak by", created_at:"1609-08-21T00:05:24-07:00", updated_at:"1609-08-21T00:05:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "the card, or equivocation will undo us. By the", created_at:"1609-08-21T00:30:22-07:00", updated_at:"1609-08-21T00:30:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Lord, Horatio, this three years I have took note of", created_at:"1609-08-21T00:45:18-07:00", updated_at:"1609-08-21T00:45:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "it: the age is grown so picked that the toe of the", created_at:"1609-08-21T01:19:52-07:00", updated_at:"1609-08-21T01:19:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "peasant comes so near the heel of the courtier, he", created_at:"1609-08-21T01:26:09-07:00", updated_at:"1609-08-21T01:26:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "galls his kibe.—How long hast thou been", created_at:"1609-08-21T01:40:37-07:00", updated_at:"1609-08-21T01:40:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "grave-maker?", created_at:"1609-08-21T02:07:43-07:00", updated_at:"1609-08-21T02:07:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Of all the days i’ th’ year, I came to ’t", created_at:"1609-08-21T02:09:42-07:00", updated_at:"1609-08-21T02:09:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "that day that our last King Hamlet overcame", created_at:"1609-08-21T02:44:25-07:00", updated_at:"1609-08-21T02:44:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Fortinbras.", created_at:"1609-08-21T02:59:18-07:00", updated_at:"1609-08-21T02:59:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "How long is that since?", created_at:"1609-08-21T03:22:11-07:00", updated_at:"1609-08-21T03:22:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Cannot you tell that? Every fool can", created_at:"1609-08-21T03:29:23-07:00", updated_at:"1609-08-21T03:29:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "tell that. It was that very day that young Hamlet", created_at:"1609-08-21T03:55:56-07:00", updated_at:"1609-08-21T03:55:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "was born—he that is mad, and sent into England.", created_at:"1609-08-21T04:18:11-07:00", updated_at:"1609-08-21T04:18:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Ay, marry, why was he sent into England?", created_at:"1609-08-21T04:39:32-07:00", updated_at:"1609-08-21T04:39:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Why, because he was mad. He shall", created_at:"1609-08-21T04:52:54-07:00", updated_at:"1609-08-21T04:52:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "recover his wits there. Or if he do not, ’tis no great", created_at:"1609-08-21T04:55:39-07:00", updated_at:"1609-08-21T04:55:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "matter there.", created_at:"1609-08-21T05:09:50-07:00", updated_at:"1609-08-21T05:09:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Why?", created_at:"1609-08-21T05:10:45-07:00", updated_at:"1609-08-21T05:10:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "’Twill not be seen in him there. There", created_at:"1609-08-21T05:42:05-07:00", updated_at:"1609-08-21T05:42:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "the men are as mad as he.", created_at:"1609-08-21T06:15:21-07:00", updated_at:"1609-08-21T06:15:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "How came he mad?", created_at:"1609-08-21T06:34:53-07:00", updated_at:"1609-08-21T06:34:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Very strangely, they say.", created_at:"1609-08-21T07:00:56-07:00", updated_at:"1609-08-21T07:00:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "How strangely?", created_at:"1609-08-21T07:08:04-07:00", updated_at:"1609-08-21T07:08:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Faith, e’en with losing his wits.", created_at:"1609-08-21T07:42:23-07:00", updated_at:"1609-08-21T07:42:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Upon what ground?", created_at:"1609-08-21T08:11:53-07:00", updated_at:"1609-08-21T08:11:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Why, here in Denmark. I have been", created_at:"1609-08-21T08:32:47-07:00", updated_at:"1609-08-21T08:32:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "sexton here, man and boy, thirty years.", created_at:"1609-08-21T08:35:59-07:00", updated_at:"1609-08-21T08:35:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "How long will a man lie i’ th’ earth ere he rot?", created_at:"1609-08-21T09:06:47-07:00", updated_at:"1609-08-21T09:06:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Faith, if he be not rotten before he die", created_at:"1609-08-21T09:09:38-07:00", updated_at:"1609-08-21T09:09:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "(as we have many pocky corses nowadays that will", created_at:"1609-08-21T09:26:51-07:00", updated_at:"1609-08-21T09:26:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "scarce hold the laying in), he will last you some", created_at:"1609-08-21T09:27:34-07:00", updated_at:"1609-08-21T09:27:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "eight year or nine year. A tanner will last you nine", created_at:"1609-08-21T10:05:38-07:00", updated_at:"1609-08-21T10:05:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "year.", created_at:"1609-08-21T10:18:20-07:00", updated_at:"1609-08-21T10:18:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Why he more than another?", created_at:"1609-08-21T10:47:38-07:00", updated_at:"1609-08-21T10:47:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Why, sir, his hide is so tanned with his", created_at:"1609-08-21T11:10:54-07:00", updated_at:"1609-08-21T11:10:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "trade that he will keep out water a great while; and", created_at:"1609-08-21T11:22:54-07:00", updated_at:"1609-08-21T11:22:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "your water is a sore decayer of your whoreson dead", created_at:"1609-08-21T11:53:36-07:00", updated_at:"1609-08-21T11:53:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "body. Here’s a skull now hath lien you i’ th’ earth", created_at:"1609-08-21T12:03:33-07:00", updated_at:"1609-08-21T12:03:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "three-and-twenty years.", created_at:"1609-08-21T12:18:13-07:00", updated_at:"1609-08-21T12:18:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Whose was it?", created_at:"1609-08-21T12:36:31-07:00", updated_at:"1609-08-21T12:36:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "A whoreson mad fellow’s it was.", created_at:"1609-08-21T12:53:37-07:00", updated_at:"1609-08-21T12:53:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Whose do you think it was?", created_at:"1609-08-21T13:04:12-07:00", updated_at:"1609-08-21T13:04:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Nay, I know not.", created_at:"1609-08-21T13:40:52-07:00", updated_at:"1609-08-21T13:40:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "A pestilence on him for a mad rogue!", created_at:"1609-08-21T13:48:02-07:00", updated_at:"1609-08-21T13:48:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "He poured a flagon of Rhenish on my head once.", created_at:"1609-08-21T14:03:35-07:00", updated_at:"1609-08-21T14:03:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "This same skull, sir, was, sir, Yorick’s skull, the", created_at:"1609-08-21T14:18:17-07:00", updated_at:"1609-08-21T14:18:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "King’s jester.", created_at:"1609-08-21T14:57:06-07:00", updated_at:"1609-08-21T14:57:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "This?", created_at:"1609-08-21T15:18:15-07:00", updated_at:"1609-08-21T15:18:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gravedigger"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "E’en that.", created_at:"1609-08-21T15:49:07-07:00", updated_at:"1609-08-21T15:49:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Let me see. Alas, poor", created_at:"1609-08-21T16:20:40-07:00", updated_at:"1609-08-21T16:20:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Yorick! I knew him, Horatio—a fellow of infinite", created_at:"1609-08-21T16:35:08-07:00", updated_at:"1609-08-21T16:35:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "jest, of most excellent fancy. He hath bore me on his", created_at:"1609-08-21T16:39:56-07:00", updated_at:"1609-08-21T16:39:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "back a thousand times, and now how abhorred in", created_at:"1609-08-21T17:17:21-07:00", updated_at:"1609-08-21T17:17:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "my imagination it is! My gorge rises at it. Here hung", created_at:"1609-08-21T17:18:59-07:00", updated_at:"1609-08-21T17:18:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "those lips that I have kissed I know not how oft.", created_at:"1609-08-21T17:55:13-07:00", updated_at:"1609-08-21T17:55:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Where be your gibes now? your gambols? your", created_at:"1609-08-21T18:15:52-07:00", updated_at:"1609-08-21T18:15:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "songs? your flashes of merriment that were wont to", created_at:"1609-08-21T18:16:03-07:00", updated_at:"1609-08-21T18:16:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "set the table on a roar? Not one now to mock your", created_at:"1609-08-21T18:38:17-07:00", updated_at:"1609-08-21T18:38:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "own grinning? Quite chapfallen? Now get you to my", created_at:"1609-08-21T18:43:11-07:00", updated_at:"1609-08-21T18:43:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "lady’s chamber, and tell her, let her paint an inch", created_at:"1609-08-21T18:50:36-07:00", updated_at:"1609-08-21T18:50:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "thick, to this favor she must come. Make her laugh", created_at:"1609-08-21T19:11:23-07:00", updated_at:"1609-08-21T19:11:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "at that.—Prithee, Horatio, tell me one thing.", created_at:"1609-08-21T19:46:01-07:00", updated_at:"1609-08-21T19:46:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "What’s that, my lord?", created_at:"1609-08-21T20:09:46-07:00", updated_at:"1609-08-21T20:09:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Dost thou think Alexander looked o’ this", created_at:"1609-08-21T20:30:25-07:00", updated_at:"1609-08-21T20:30:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "fashion i’ th’ earth?", created_at:"1609-08-21T20:32:06-07:00", updated_at:"1609-08-21T20:32:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "E’en so.", created_at:"1609-08-21T21:02:04-07:00", updated_at:"1609-08-21T21:02:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "And smelt so? Pah!", created_at:"1609-08-21T21:18:46-07:00", updated_at:"1609-08-21T21:18:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "E’en so, my lord.", created_at:"1609-08-21T21:42:45-07:00", updated_at:"1609-08-21T21:42:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "To what base uses we may return, Horatio!", created_at:"1609-08-21T22:02:59-07:00", updated_at:"1609-08-21T22:02:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Why may not imagination trace the noble dust of", created_at:"1609-08-21T22:37:50-07:00", updated_at:"1609-08-21T22:37:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Alexander till he find it stopping a bunghole?", created_at:"1609-08-21T23:03:31-07:00", updated_at:"1609-08-21T23:03:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "’Twere to consider too curiously to consider", created_at:"1609-08-21T23:20:01-07:00", updated_at:"1609-08-21T23:20:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "so.", created_at:"1609-08-21T23:30:30-07:00", updated_at:"1609-08-21T23:30:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "No, faith, not a jot; but to follow him thither,", created_at:"1609-08-21T23:44:52-07:00", updated_at:"1609-08-21T23:44:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "with modesty enough and likelihood to lead it, as", created_at:"1609-08-22T00:04:16-07:00", updated_at:"1609-08-22T00:04:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "thus: Alexander died, Alexander was buried, Alexander", created_at:"1609-08-22T00:04:50-07:00", updated_at:"1609-08-22T00:04:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "returneth to dust; the dust is earth; of earth", created_at:"1609-08-22T00:14:22-07:00", updated_at:"1609-08-22T00:14:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "we make loam; and why of that loam whereto he", created_at:"1609-08-22T00:35:57-07:00", updated_at:"1609-08-22T00:35:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "was converted might they not stop a beer barrel?", created_at:"1609-08-22T00:38:09-07:00", updated_at:"1609-08-22T00:38:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Imperious Caesar, dead and turned to clay,", created_at:"1609-08-22T01:08:57-07:00", updated_at:"1609-08-22T01:08:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Might stop a hole to keep the wind away.", created_at:"1609-08-22T01:24:40-07:00", updated_at:"1609-08-22T01:24:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "O, that that earth which kept the world in awe", created_at:"1609-08-22T01:55:48-07:00", updated_at:"1609-08-22T01:55:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_73.id, body: "Should patch a wall t’ expel the winter’s flaw!", created_at:"1609-08-22T02:35:34-07:00", updated_at:"1609-08-22T02:35:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "But soft, but soft awhile! Here comes the King,", created_at:"1609-08-22T03:07:40-07:00", updated_at:"1609-08-22T03:07:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "The Queen, the courtiers. Who is this they follow?", created_at:"1609-08-22T03:14:10-07:00", updated_at:"1609-08-22T03:14:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "And with such maimèd rites? This doth betoken", created_at:"1609-08-22T03:42:11-07:00", updated_at:"1609-08-22T03:42:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "The corse they follow did with desp’rate hand", created_at:"1609-08-22T04:20:53-07:00", updated_at:"1609-08-22T04:20:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Fordo its own life. ’Twas of some estate.", created_at:"1609-08-22T04:42:36-07:00", updated_at:"1609-08-22T04:42:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Couch we awhile and mark.", created_at:"1609-08-22T05:07:10-07:00", updated_at:"1609-08-22T05:07:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "What ceremony else?", created_at:"1609-08-22T05:14:36-07:00", updated_at:"1609-08-22T05:14:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "That is Laertes, a very noble youth. Mark.", created_at:"1609-08-22T05:36:19-07:00", updated_at:"1609-08-22T05:36:19-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "What ceremony else?", created_at:"1609-08-22T05:41:23-07:00", updated_at:"1609-08-22T05:41:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Must there no more be done?", created_at:"1609-08-22T06:01:29-07:00", updated_at:"1609-08-22T06:01:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Lay her i’ th’ earth,", created_at:"1609-08-22T06:07:36-07:00", updated_at:"1609-08-22T06:07:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "And from her fair and unpolluted flesh", created_at:"1609-08-22T06:47:30-07:00", updated_at:"1609-08-22T06:47:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "May violets spring! I tell thee, churlish priest,", created_at:"1609-08-22T07:19:18-07:00", updated_at:"1609-08-22T07:19:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "A minist’ring angel shall my sister be", created_at:"1609-08-22T07:23:09-07:00", updated_at:"1609-08-22T07:23:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "When thou liest howling.", created_at:"1609-08-22T07:30:16-07:00", updated_at:"1609-08-22T07:30:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "What, the fair Ophelia?", created_at:"1609-08-22T08:07:38-07:00", updated_at:"1609-08-22T08:07:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Sweets to the sweet, farewell!", created_at:"1609-08-22T08:24:12-07:00", updated_at:"1609-08-22T08:24:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I hoped thou shouldst have been my Hamlet’s wife;", created_at:"1609-08-22T08:55:09-07:00", updated_at:"1609-08-22T08:55:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I thought thy bride-bed to have decked, sweet maid,", created_at:"1609-08-22T09:26:59-07:00", updated_at:"1609-08-22T09:26:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "And not have strewed thy grave.", created_at:"1609-08-22T09:58:48-07:00", updated_at:"1609-08-22T09:58:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "O, treble woe", created_at:"1609-08-22T10:24:52-07:00", updated_at:"1609-08-22T10:24:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Fall ten times treble on that cursèd head", created_at:"1609-08-22T11:00:18-07:00", updated_at:"1609-08-22T11:00:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Whose wicked deed thy most ingenious sense", created_at:"1609-08-22T11:09:05-07:00", updated_at:"1609-08-22T11:09:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Deprived thee of!—Hold off the earth awhile,", created_at:"1609-08-22T11:28:27-07:00", updated_at:"1609-08-22T11:28:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Till I have caught her once more in mine arms.", created_at:"1609-08-22T11:38:07-07:00", updated_at:"1609-08-22T11:38:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Now pile your dust upon the quick and dead,", created_at:"1609-08-22T11:55:03-07:00", updated_at:"1609-08-22T11:55:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Till of this flat a mountain you have made", created_at:"1609-08-22T12:14:36-07:00", updated_at:"1609-08-22T12:14:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "T’ o’ertop old Pelion or the skyish head", created_at:"1609-08-22T12:48:01-07:00", updated_at:"1609-08-22T12:48:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Of blue Olympus.", created_at:"1609-08-22T13:15:26-07:00", updated_at:"1609-08-22T13:15:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "What is he whose grief", created_at:"1609-08-22T13:46:56-07:00", updated_at:"1609-08-22T13:46:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Bears such an emphasis, whose phrase of sorrow", created_at:"1609-08-22T14:19:41-07:00", updated_at:"1609-08-22T14:19:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Conjures the wand’ring stars and makes them stand", created_at:"1609-08-22T14:36:53-07:00", updated_at:"1609-08-22T14:36:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Like wonder-wounded hearers? This is I,", created_at:"1609-08-22T14:41:51-07:00", updated_at:"1609-08-22T14:41:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Hamlet the Dane.", created_at:"1609-08-22T14:51:53-07:00", updated_at:"1609-08-22T14:51:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "The devil take thy soul!", created_at:"1609-08-22T15:07:13-07:00", updated_at:"1609-08-22T15:07:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Thou pray’st not well.", created_at:"1609-08-22T15:15:23-07:00", updated_at:"1609-08-22T15:15:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I prithee take thy fingers from my throat,", created_at:"1609-08-22T15:52:30-07:00", updated_at:"1609-08-22T15:52:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "For though I am not splenitive and rash,", created_at:"1609-08-22T16:15:52-07:00", updated_at:"1609-08-22T16:15:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Yet have I in me something dangerous,", created_at:"1609-08-22T16:46:20-07:00", updated_at:"1609-08-22T16:46:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Which let thy wisdom fear. Hold off thy hand.", created_at:"1609-08-22T17:24:06-07:00", updated_at:"1609-08-22T17:24:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Pluck them asunder.", created_at:"1609-08-22T17:35:23-07:00", updated_at:"1609-08-22T17:35:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Hamlet! Hamlet!", created_at:"1609-08-22T17:50:43-07:00", updated_at:"1609-08-22T17:50:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Gentlemen!", created_at:"1609-08-22T17:51:06-07:00", updated_at:"1609-08-22T17:51:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Good my lord, be quiet.", created_at:"1609-08-22T18:03:32-07:00", updated_at:"1609-08-22T18:03:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Why, I will fight with him upon this theme", created_at:"1609-08-22T18:32:01-07:00", updated_at:"1609-08-22T18:32:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Until my eyelids will no longer wag!", created_at:"1609-08-22T19:00:47-07:00", updated_at:"1609-08-22T19:00:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "O my son, what theme?", created_at:"1609-08-22T19:22:32-07:00", updated_at:"1609-08-22T19:22:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I loved Ophelia. Forty thousand brothers", created_at:"1609-08-22T19:48:23-07:00", updated_at:"1609-08-22T19:48:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Could not with all their quantity of love", created_at:"1609-08-22T20:26:55-07:00", updated_at:"1609-08-22T20:26:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Make up my sum. What wilt thou do for her?", created_at:"1609-08-22T21:02:38-07:00", updated_at:"1609-08-22T21:02:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "O, he is mad, Laertes!", created_at:"1609-08-22T21:03:54-07:00", updated_at:"1609-08-22T21:03:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "For love of God, forbear him.", created_at:"1609-08-22T21:31:34-07:00", updated_at:"1609-08-22T21:31:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "’Swounds, show me what thou ’t do.", created_at:"1609-08-22T21:39:57-07:00", updated_at:"1609-08-22T21:39:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Woo’t weep, woo’t fight, woo’t fast, woo’t tear", created_at:"1609-08-22T21:51:35-07:00", updated_at:"1609-08-22T21:51:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "thyself,", created_at:"1609-08-22T22:01:12-07:00", updated_at:"1609-08-22T22:01:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Woo’t drink up eisel, eat a crocodile?", created_at:"1609-08-22T22:34:58-07:00", updated_at:"1609-08-22T22:34:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I’ll do ’t. Dost thou come here to whine?", created_at:"1609-08-22T22:42:17-07:00", updated_at:"1609-08-22T22:42:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "To outface me with leaping in her grave?", created_at:"1609-08-22T22:51:27-07:00", updated_at:"1609-08-22T22:51:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Be buried quick with her, and so will I.", created_at:"1609-08-22T23:18:44-07:00", updated_at:"1609-08-22T23:18:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "And if thou prate of mountains, let them throw", created_at:"1609-08-22T23:46:07-07:00", updated_at:"1609-08-22T23:46:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Millions of acres on us, till our ground,", created_at:"1609-08-22T23:46:35-07:00", updated_at:"1609-08-22T23:46:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Singeing his pate against the burning zone,", created_at:"1609-08-23T00:18:34-07:00", updated_at:"1609-08-23T00:18:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Make Ossa like a wart. Nay, an thou ’lt mouth,", created_at:"1609-08-23T00:46:45-07:00", updated_at:"1609-08-23T00:46:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I’ll rant as well as thou.", created_at:"1609-08-23T01:18:08-07:00", updated_at:"1609-08-23T01:18:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "This is mere madness;", created_at:"1609-08-23T01:41:05-07:00", updated_at:"1609-08-23T01:41:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "And thus awhile the fit will work on him.", created_at:"1609-08-23T02:19:11-07:00", updated_at:"1609-08-23T02:19:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Anon, as patient as the female dove", created_at:"1609-08-23T02:23:41-07:00", updated_at:"1609-08-23T02:23:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "When that her golden couplets are disclosed,", created_at:"1609-08-23T02:37:24-07:00", updated_at:"1609-08-23T02:37:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "His silence will sit drooping.", created_at:"1609-08-23T02:40:37-07:00", updated_at:"1609-08-23T02:40:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Hear you, sir,", created_at:"1609-08-23T02:46:54-07:00", updated_at:"1609-08-23T02:46:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "What is the reason that you use me thus?", created_at:"1609-08-23T03:19:34-07:00", updated_at:"1609-08-23T03:19:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I loved you ever. But it is no matter.", created_at:"1609-08-23T03:44:08-07:00", updated_at:"1609-08-23T03:44:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Let Hercules himself do what he may,", created_at:"1609-08-23T04:12:50-07:00", updated_at:"1609-08-23T04:12:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "The cat will mew, and dog will have his day.", created_at:"1609-08-23T04:14:20-07:00", updated_at:"1609-08-23T04:14:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "I pray thee, good Horatio, wait upon him.", created_at:"1609-08-23T04:17:25-07:00", updated_at:"1609-08-23T04:17:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Strengthen your patience in our last", created_at:"1609-08-23T04:20:40-07:00", updated_at:"1609-08-23T04:20:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "night’s speech.", created_at:"1609-08-23T04:28:50-07:00", updated_at:"1609-08-23T04:28:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "We’ll put the matter to the present push.—", created_at:"1609-08-23T04:29:15-07:00", updated_at:"1609-08-23T04:29:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Good Gertrude, set some watch over your son.—", created_at:"1609-08-23T04:30:54-07:00", updated_at:"1609-08-23T04:30:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "This grave shall have a living monument.", created_at:"1609-08-23T04:47:21-07:00", updated_at:"1609-08-23T04:47:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "An hour of quiet thereby shall we see.", created_at:"1609-08-23T05:25:46-07:00", updated_at:"1609-08-23T05:25:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "service for orphelia"}).id, body: "Till then in patience our proceeding be.", created_at:"1609-08-23T06:03:58-07:00", updated_at:"1609-08-23T06:03:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "So much for this, sir. Now shall you see the other.", created_at:"1609-08-23T06:06:28-07:00", updated_at:"1609-08-23T06:06:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "You do remember all the circumstance?", created_at:"1609-08-23T06:38:05-07:00", updated_at:"1609-08-23T06:38:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Remember it, my lord!", created_at:"1609-08-23T07:05:09-07:00", updated_at:"1609-08-23T07:05:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Sir, in my heart there was a kind of fighting", created_at:"1609-08-23T07:43:21-07:00", updated_at:"1609-08-23T07:43:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "That would not let me sleep. Methought I lay", created_at:"1609-08-23T08:02:15-07:00", updated_at:"1609-08-23T08:02:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Worse than the mutines in the bilboes. Rashly—", created_at:"1609-08-23T08:15:52-07:00", updated_at:"1609-08-23T08:15:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "And praised be rashness for it: let us know,", created_at:"1609-08-23T08:27:56-07:00", updated_at:"1609-08-23T08:27:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Our indiscretion sometime serves us well", created_at:"1609-08-23T09:02:42-07:00", updated_at:"1609-08-23T09:02:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "When our deep plots do pall; and that should learn", created_at:"1609-08-23T09:36:42-07:00", updated_at:"1609-08-23T09:36:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "us", created_at:"1609-08-23T09:47:48-07:00", updated_at:"1609-08-23T09:47:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "There’s a divinity that shapes our ends,", created_at:"1609-08-23T10:25:53-07:00", updated_at:"1609-08-23T10:25:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Rough-hew them how we will—", created_at:"1609-08-23T10:59:56-07:00", updated_at:"1609-08-23T10:59:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "That is most", created_at:"1609-08-23T11:21:38-07:00", updated_at:"1609-08-23T11:21:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "certain.", created_at:"1609-08-23T12:00:34-07:00", updated_at:"1609-08-23T12:00:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Up from my cabin,", created_at:"1609-08-23T12:10:50-07:00", updated_at:"1609-08-23T12:10:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "My sea-gown scarfed about me, in the dark", created_at:"1609-08-23T12:20:13-07:00", updated_at:"1609-08-23T12:20:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Groped I to find out them; had my desire,", created_at:"1609-08-23T12:58:38-07:00", updated_at:"1609-08-23T12:58:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Fingered their packet, and in fine withdrew", created_at:"1609-08-23T13:14:11-07:00", updated_at:"1609-08-23T13:14:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "To mine own room again, making so bold", created_at:"1609-08-23T13:25:23-07:00", updated_at:"1609-08-23T13:25:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "(My fears forgetting manners) to unfold", created_at:"1609-08-23T13:56:59-07:00", updated_at:"1609-08-23T13:56:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Their grand commission; where I found, Horatio,", created_at:"1609-08-23T14:03:33-07:00", updated_at:"1609-08-23T14:03:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "A royal knavery—an exact command,", created_at:"1609-08-23T14:40:06-07:00", updated_at:"1609-08-23T14:40:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Larded with many several sorts of reasons", created_at:"1609-08-23T15:19:40-07:00", updated_at:"1609-08-23T15:19:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Importing Denmark’s health and England’s too,", created_at:"1609-08-23T15:54:50-07:00", updated_at:"1609-08-23T15:54:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "With—ho!—such bugs and goblins in my life,", created_at:"1609-08-23T16:13:05-07:00", updated_at:"1609-08-23T16:13:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "That on the supervise, no leisure bated,", created_at:"1609-08-23T16:23:40-07:00", updated_at:"1609-08-23T16:23:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "No, not to stay the grinding of the ax,", created_at:"1609-08-23T16:37:15-07:00", updated_at:"1609-08-23T16:37:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "My head should be struck off.", created_at:"1609-08-23T17:15:26-07:00", updated_at:"1609-08-23T17:15:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Is ’t possible?", created_at:"1609-08-23T17:48:52-07:00", updated_at:"1609-08-23T17:48:52-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Here’s the commission. Read it at more leisure.", created_at:"1609-08-23T18:28:01-07:00", updated_at:"1609-08-23T18:28:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "But wilt thou hear now how I did proceed?", created_at:"1609-08-23T19:06:10-07:00", updated_at:"1609-08-23T19:06:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "I beseech you.", created_at:"1609-08-23T19:13:31-07:00", updated_at:"1609-08-23T19:13:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Being thus benetted round with villainies,", created_at:"1609-08-23T19:36:20-07:00", updated_at:"1609-08-23T19:36:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Or I could make a prologue to my brains,", created_at:"1609-08-23T19:51:41-07:00", updated_at:"1609-08-23T19:51:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "They had begun the play. I sat me down,", created_at:"1609-08-23T20:01:47-07:00", updated_at:"1609-08-23T20:01:47-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Devised a new commission, wrote it fair—", created_at:"1609-08-23T20:23:26-07:00", updated_at:"1609-08-23T20:23:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "I once did hold it, as our statists do,", created_at:"1609-08-23T20:42:21-07:00", updated_at:"1609-08-23T20:42:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "A baseness to write fair, and labored much", created_at:"1609-08-23T20:49:46-07:00", updated_at:"1609-08-23T20:49:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "How to forget that learning; but, sir, now", created_at:"1609-08-23T21:23:42-07:00", updated_at:"1609-08-23T21:23:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "It did me yeoman’s service. Wilt thou know", created_at:"1609-08-23T21:49:36-07:00", updated_at:"1609-08-23T21:49:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Th’ effect of what I wrote?", created_at:"1609-08-23T21:49:38-07:00", updated_at:"1609-08-23T21:49:38-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Ay, good my lord.", created_at:"1609-08-23T22:06:30-07:00", updated_at:"1609-08-23T22:06:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "An earnest conjuration from the King,", created_at:"1609-08-23T22:09:51-07:00", updated_at:"1609-08-23T22:09:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "As England was his faithful tributary,", created_at:"1609-08-23T22:40:36-07:00", updated_at:"1609-08-23T22:40:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "As love between them like the palm might flourish,", created_at:"1609-08-23T22:47:48-07:00", updated_at:"1609-08-23T22:47:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "As peace should still her wheaten garland wear", created_at:"1609-08-23T23:18:04-07:00", updated_at:"1609-08-23T23:18:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "And stand a comma ’tween their amities,", created_at:"1609-08-23T23:20:54-07:00", updated_at:"1609-08-23T23:20:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "And many suchlike ases of great charge,", created_at:"1609-08-23T23:38:29-07:00", updated_at:"1609-08-23T23:38:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "That, on the view and knowing of these contents,", created_at:"1609-08-24T00:08:11-07:00", updated_at:"1609-08-24T00:08:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Without debatement further, more or less,", created_at:"1609-08-24T00:41:17-07:00", updated_at:"1609-08-24T00:41:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "He should those bearers put to sudden death,", created_at:"1609-08-24T01:02:28-07:00", updated_at:"1609-08-24T01:02:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Not shriving time allowed.", created_at:"1609-08-24T01:35:26-07:00", updated_at:"1609-08-24T01:35:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "How was this sealed?", created_at:"1609-08-24T01:36:32-07:00", updated_at:"1609-08-24T01:36:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Why, even in that was heaven ordinant.", created_at:"1609-08-24T01:46:58-07:00", updated_at:"1609-08-24T01:46:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "I had my father’s signet in my purse,", created_at:"1609-08-24T01:47:58-07:00", updated_at:"1609-08-24T01:47:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Which was the model of that Danish seal;", created_at:"1609-08-24T02:18:45-07:00", updated_at:"1609-08-24T02:18:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Folded the writ up in the form of th’ other,", created_at:"1609-08-24T02:24:45-07:00", updated_at:"1609-08-24T02:24:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Subscribed it, gave ’t th’ impression, placed it", created_at:"1609-08-24T02:41:01-07:00", updated_at:"1609-08-24T02:41:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "safely,", created_at:"1609-08-24T02:55:17-07:00", updated_at:"1609-08-24T02:55:17-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "The changeling never known. Now, the next day", created_at:"1609-08-24T03:09:59-07:00", updated_at:"1609-08-24T03:09:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Was our sea-fight; and what to this was sequent", created_at:"1609-08-24T03:36:48-07:00", updated_at:"1609-08-24T03:36:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Thou knowest already.", created_at:"1609-08-24T03:40:50-07:00", updated_at:"1609-08-24T03:40:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "So Guildenstern and Rosencrantz go to ’t.", created_at:"1609-08-24T03:51:54-07:00", updated_at:"1609-08-24T03:51:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Why, man, they did make love to this employment.", created_at:"1609-08-24T04:09:16-07:00", updated_at:"1609-08-24T04:09:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "They are not near my conscience. Their defeat", created_at:"1609-08-24T04:24:07-07:00", updated_at:"1609-08-24T04:24:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Does by their own insinuation grow.", created_at:"1609-08-24T04:48:05-07:00", updated_at:"1609-08-24T04:48:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "’Tis dangerous when the baser nature comes", created_at:"1609-08-24T05:15:44-07:00", updated_at:"1609-08-24T05:15:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Between the pass and fell incensèd points", created_at:"1609-08-24T05:49:29-07:00", updated_at:"1609-08-24T05:49:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Of mighty opposites.", created_at:"1609-08-24T06:00:51-07:00", updated_at:"1609-08-24T06:00:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Why, what a king is this!", created_at:"1609-08-24T06:10:20-07:00", updated_at:"1609-08-24T06:10:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Does it not, think thee, stand me now upon—", created_at:"1609-08-24T06:15:39-07:00", updated_at:"1609-08-24T06:15:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "He that hath killed my king and whored my mother,", created_at:"1609-08-24T06:39:21-07:00", updated_at:"1609-08-24T06:39:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Popped in between th’ election and my hopes,", created_at:"1609-08-24T07:00:06-07:00", updated_at:"1609-08-24T07:00:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Thrown out his angle for my proper life,", created_at:"1609-08-24T07:39:41-07:00", updated_at:"1609-08-24T07:39:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "And with such cozenage—is ’t not perfect", created_at:"1609-08-24T08:04:04-07:00", updated_at:"1609-08-24T08:04:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "conscience", created_at:"1609-08-24T08:30:09-07:00", updated_at:"1609-08-24T08:30:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "To quit him with this arm? And is ’t not to be", created_at:"1609-08-24T08:44:55-07:00", updated_at:"1609-08-24T08:44:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "damned", created_at:"1609-08-24T09:06:59-07:00", updated_at:"1609-08-24T09:06:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "To let this canker of our nature come", created_at:"1609-08-24T09:28:37-07:00", updated_at:"1609-08-24T09:28:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "In further evil?", created_at:"1609-08-24T09:52:37-07:00", updated_at:"1609-08-24T09:52:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "It must be shortly known to him from England", created_at:"1609-08-24T10:25:45-07:00", updated_at:"1609-08-24T10:25:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "What is the issue of the business there.", created_at:"1609-08-24T10:58:45-07:00", updated_at:"1609-08-24T10:58:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "It will be short. The interim’s mine,", created_at:"1609-08-24T10:59:27-07:00", updated_at:"1609-08-24T10:59:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "And a man’s life’s no more than to say one.", created_at:"1609-08-24T11:34:51-07:00", updated_at:"1609-08-24T11:34:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "But I am very sorry, good Horatio,", created_at:"1609-08-24T11:35:51-07:00", updated_at:"1609-08-24T11:35:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "That to Laertes I forgot myself,", created_at:"1609-08-24T12:02:30-07:00", updated_at:"1609-08-24T12:02:30-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "For by the image of my cause I see", created_at:"1609-08-24T12:18:35-07:00", updated_at:"1609-08-24T12:18:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "The portraiture of his. I’ll court his favors.", created_at:"1609-08-24T12:30:43-07:00", updated_at:"1609-08-24T12:30:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "But, sure, the bravery of his grief did put me", created_at:"1609-08-24T12:59:24-07:00", updated_at:"1609-08-24T12:59:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Into a tow’ring passion.", created_at:"1609-08-24T13:32:55-07:00", updated_at:"1609-08-24T13:32:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_31.id, body: "Peace, who comes here?", created_at:"1609-08-24T14:08:48-07:00", updated_at:"1609-08-24T14:08:48-07:00"})
