Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "Your Lordship is right welcome back to", created_at:"1609-08-24T14:37:48-07:00", updated_at:"1609-08-24T14:37:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "Denmark.", created_at:"1609-08-24T15:10:15-07:00", updated_at:"1609-08-24T15:10:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "I humbly thank you, sir.", created_at:"1609-08-24T15:47:54-07:00", updated_at:"1609-08-24T15:47:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "Dost know this waterfly?", created_at:"1609-08-24T15:51:08-07:00", updated_at:"1609-08-24T15:51:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "No, my good lord.", created_at:"1609-08-24T16:12:34-07:00", updated_at:"1609-08-24T16:12:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "Thy state is the more gracious,", created_at:"1609-08-24T16:14:42-07:00", updated_at:"1609-08-24T16:14:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "for ’tis a vice to know him. He hath much", created_at:"1609-08-24T16:34:35-07:00", updated_at:"1609-08-24T16:34:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "land, and fertile. Let a beast be lord of beasts and his", created_at:"1609-08-24T17:05:16-07:00", updated_at:"1609-08-24T17:05:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "crib shall stand at the king’s mess. ’Tis a chough,", created_at:"1609-08-24T17:06:09-07:00", updated_at:"1609-08-24T17:06:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "but, as I say, spacious in the possession of dirt.", created_at:"1609-08-24T17:13:33-07:00", updated_at:"1609-08-24T17:13:33-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "Sweet lord, if your Lordship were at leisure, I", created_at:"1609-08-24T17:13:56-07:00", updated_at:"1609-08-24T17:13:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "should impart a thing to you from his Majesty.", created_at:"1609-08-24T17:52:45-07:00", updated_at:"1609-08-24T17:52:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "I will receive it, sir, with all diligence of", created_at:"1609-08-24T18:15:02-07:00", updated_at:"1609-08-24T18:15:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "spirit. Put your bonnet to his right use: ’tis for the", created_at:"1609-08-24T18:30:34-07:00", updated_at:"1609-08-24T18:30:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "DirectMessage", parent_id: direct_message_77.id, body: "head.", created_at:"1609-08-24T18:51:30-07:00", updated_at:"1609-08-24T18:51:30-07:00"})
