Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Till by some elder masters of known honor", created_at:"1609-08-26T20:42:12-07:00", updated_at:"1609-08-26T20:42:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I have a voice and precedent of peace", created_at:"1609-08-26T20:48:56-07:00", updated_at:"1609-08-26T20:48:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "To keep my name ungored. But till that time", created_at:"1609-08-26T21:26:09-07:00", updated_at:"1609-08-26T21:26:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I do receive your offered love like love", created_at:"1609-08-26T21:47:07-07:00", updated_at:"1609-08-26T21:47:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And will not wrong it.", created_at:"1609-08-26T21:51:50-07:00", updated_at:"1609-08-26T21:51:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I embrace it freely", created_at:"1609-08-26T22:17:11-07:00", updated_at:"1609-08-26T22:17:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And will this brothers’ wager frankly play.—", created_at:"1609-08-26T22:48:46-07:00", updated_at:"1609-08-26T22:48:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Give us the foils. Come on.", created_at:"1609-08-26T23:25:15-07:00", updated_at:"1609-08-26T23:25:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Come, one for me.", created_at:"1609-08-26T23:45:25-07:00", updated_at:"1609-08-26T23:45:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I’ll be your foil, Laertes; in mine ignorance", created_at:"1609-08-26T23:59:27-07:00", updated_at:"1609-08-26T23:59:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Your skill shall, like a star i’ th’ darkest night,", created_at:"1609-08-26T23:59:51-07:00", updated_at:"1609-08-26T23:59:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Stick fiery off indeed.", created_at:"1609-08-27T00:32:04-07:00", updated_at:"1609-08-27T00:32:04-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "You mock me, sir.", created_at:"1609-08-27T00:56:10-07:00", updated_at:"1609-08-27T00:56:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "No, by this hand.", created_at:"1609-08-27T01:03:50-07:00", updated_at:"1609-08-27T01:03:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Give them the foils, young Osric. Cousin Hamlet,", created_at:"1609-08-27T01:40:07-07:00", updated_at:"1609-08-27T01:40:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "You know the wager?", created_at:"1609-08-27T01:50:08-07:00", updated_at:"1609-08-27T01:50:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Very well, my lord.", created_at:"1609-08-27T01:56:31-07:00", updated_at:"1609-08-27T01:56:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Your Grace has laid the odds o’ th’ weaker side.", created_at:"1609-08-27T02:09:28-07:00", updated_at:"1609-08-27T02:09:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I do not fear it; I have seen you both.", created_at:"1609-08-27T02:18:43-07:00", updated_at:"1609-08-27T02:18:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "But, since he is better, we have therefore odds.", created_at:"1609-08-27T02:47:51-07:00", updated_at:"1609-08-27T02:47:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "This is too heavy. Let me see another.", created_at:"1609-08-27T03:12:51-07:00", updated_at:"1609-08-27T03:12:51-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "This likes me well. These foils have all a length?", created_at:"1609-08-27T03:52:45-07:00", updated_at:"1609-08-27T03:52:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Ay, my good lord.", created_at:"1609-08-27T03:53:46-07:00", updated_at:"1609-08-27T03:53:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Set me the stoups of wine upon that table.—", created_at:"1609-08-27T03:54:26-07:00", updated_at:"1609-08-27T03:54:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "If Hamlet give the first or second hit", created_at:"1609-08-27T04:31:09-07:00", updated_at:"1609-08-27T04:31:09-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Or quit in answer of the third exchange,", created_at:"1609-08-27T05:03:16-07:00", updated_at:"1609-08-27T05:03:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Let all the battlements their ordnance fire.", created_at:"1609-08-27T05:18:11-07:00", updated_at:"1609-08-27T05:18:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The King shall drink to Hamlet’s better breath,", created_at:"1609-08-27T05:48:48-07:00", updated_at:"1609-08-27T05:48:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And in the cup an union shall he throw,", created_at:"1609-08-27T06:10:22-07:00", updated_at:"1609-08-27T06:10:22-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Richer than that which four successive kings", created_at:"1609-08-27T06:24:01-07:00", updated_at:"1609-08-27T06:24:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "In Denmark’s crown have worn. Give me the cups,", created_at:"1609-08-27T06:50:18-07:00", updated_at:"1609-08-27T06:50:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And let the kettle to the trumpet speak,", created_at:"1609-08-27T07:01:12-07:00", updated_at:"1609-08-27T07:01:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The trumpet to the cannoneer without,", created_at:"1609-08-27T07:07:14-07:00", updated_at:"1609-08-27T07:07:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The cannons to the heavens, the heaven to earth,", created_at:"1609-08-27T07:08:18-07:00", updated_at:"1609-08-27T07:08:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Now the King drinks to Hamlet. Come, begin.", created_at:"1609-08-27T07:21:29-07:00", updated_at:"1609-08-27T07:21:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And you, the judges, bear a wary eye.", created_at:"1609-08-27T07:24:29-07:00", updated_at:"1609-08-27T07:24:29-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Come on, sir.", created_at:"1609-08-27T07:54:58-07:00", updated_at:"1609-08-27T07:54:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Come, my lord.", created_at:"1609-08-27T08:19:39-07:00", updated_at:"1609-08-27T08:19:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "One.", created_at:"1609-08-27T08:32:50-07:00", updated_at:"1609-08-27T08:32:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "No.", created_at:"1609-08-27T08:35:25-07:00", updated_at:"1609-08-27T08:35:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Judgment!", created_at:"1609-08-27T08:45:10-07:00", updated_at:"1609-08-27T08:45:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "A hit, a very palpable hit.", created_at:"1609-08-27T09:02:03-07:00", updated_at:"1609-08-27T09:02:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Well, again.", created_at:"1609-08-27T09:40:54-07:00", updated_at:"1609-08-27T09:40:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Stay, give me drink.—Hamlet, this pearl is thine.", created_at:"1609-08-27T10:20:08-07:00", updated_at:"1609-08-27T10:20:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Here’s to thy health.", created_at:"1609-08-27T10:27:59-07:00", updated_at:"1609-08-27T10:27:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Give him the cup.", created_at:"1609-08-27T10:51:20-07:00", updated_at:"1609-08-27T10:51:20-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I’ll play this bout first. Set it by awhile.", created_at:"1609-08-27T11:01:24-07:00", updated_at:"1609-08-27T11:01:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Come. Another hit. What say you?", created_at:"1609-08-27T11:01:48-07:00", updated_at:"1609-08-27T11:01:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "A touch, a touch. I do confess ’t.", created_at:"1609-08-27T11:21:54-07:00", updated_at:"1609-08-27T11:21:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Our son shall win.", created_at:"1609-08-27T11:59:14-07:00", updated_at:"1609-08-27T11:59:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "He’s fat and scant of breath.—", created_at:"1609-08-27T12:35:42-07:00", updated_at:"1609-08-27T12:35:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Here, Hamlet, take my napkin; rub thy brows.", created_at:"1609-08-27T12:40:58-07:00", updated_at:"1609-08-27T12:40:58-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The Queen carouses to thy fortune, Hamlet.", created_at:"1609-08-27T12:42:16-07:00", updated_at:"1609-08-27T12:42:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Good madam.", created_at:"1609-08-27T12:46:31-07:00", updated_at:"1609-08-27T12:46:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Gertrude, do not drink.", created_at:"1609-08-27T12:56:13-07:00", updated_at:"1609-08-27T12:56:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I will, my lord; I pray you pardon me.", created_at:"1609-08-27T13:12:46-07:00", updated_at:"1609-08-27T13:12:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "It is the poisoned cup. It is too late.", created_at:"1609-08-27T13:43:10-07:00", updated_at:"1609-08-27T13:43:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I dare not drink yet, madam—by and by.", created_at:"1609-08-27T14:07:53-07:00", updated_at:"1609-08-27T14:07:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Come, let me wipe thy face.", created_at:"1609-08-27T14:10:16-07:00", updated_at:"1609-08-27T14:10:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "My lord, I’ll hit him now.", created_at:"1609-08-27T14:47:16-07:00", updated_at:"1609-08-27T14:47:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I do not think ’t.", created_at:"1609-08-27T15:15:05-07:00", updated_at:"1609-08-27T15:15:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And yet it is almost against my conscience.", created_at:"1609-08-27T15:36:48-07:00", updated_at:"1609-08-27T15:36:48-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Come, for the third, Laertes. You do but dally.", created_at:"1609-08-27T15:40:13-07:00", updated_at:"1609-08-27T15:40:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I pray you pass with your best violence.", created_at:"1609-08-27T16:18:40-07:00", updated_at:"1609-08-27T16:18:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I am afeard you make a wanton of me.", created_at:"1609-08-27T16:29:44-07:00", updated_at:"1609-08-27T16:29:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Say you so? Come on.", created_at:"1609-08-27T16:46:59-07:00", updated_at:"1609-08-27T16:46:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Nothing neither way.", created_at:"1609-08-27T17:18:36-07:00", updated_at:"1609-08-27T17:18:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Have at you now!", created_at:"1609-08-27T17:48:26-07:00", updated_at:"1609-08-27T17:48:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Part them. They are incensed.", created_at:"1609-08-27T18:15:34-07:00", updated_at:"1609-08-27T18:15:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Nay, come again.", created_at:"1609-08-27T18:16:50-07:00", updated_at:"1609-08-27T18:16:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Look to the Queen there, ho!", created_at:"1609-08-27T18:33:36-07:00", updated_at:"1609-08-27T18:33:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "They bleed on both sides.—How is it, my lord?", created_at:"1609-08-27T18:51:21-07:00", updated_at:"1609-08-27T18:51:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "How is ’t, Laertes?", created_at:"1609-08-27T19:28:25-07:00", updated_at:"1609-08-27T19:28:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Why as a woodcock to mine own springe, Osric.", created_at:"1609-08-27T19:45:16-07:00", updated_at:"1609-08-27T19:45:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I am justly killed with mine own treachery.", created_at:"1609-08-27T20:21:32-07:00", updated_at:"1609-08-27T20:21:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "How does the Queen?", created_at:"1609-08-27T20:31:37-07:00", updated_at:"1609-08-27T20:31:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "She swoons to see them bleed.", created_at:"1609-08-27T20:38:12-07:00", updated_at:"1609-08-27T20:38:12-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "No, no, the drink, the drink! O, my dear Hamlet!", created_at:"1609-08-27T20:48:16-07:00", updated_at:"1609-08-27T20:48:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Gertrude"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The drink, the drink! I am poisoned.", created_at:"1609-08-27T20:49:26-07:00", updated_at:"1609-08-27T20:49:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "O villainy! Ho! Let the door be locked.", created_at:"1609-08-27T20:57:01-07:00", updated_at:"1609-08-27T20:57:01-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Treachery! Seek it out.", created_at:"1609-08-27T21:11:25-07:00", updated_at:"1609-08-27T21:11:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "It is here, Hamlet. Hamlet, thou art slain.", created_at:"1609-08-27T21:17:54-07:00", updated_at:"1609-08-27T21:17:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "No med’cine in the world can do thee good.", created_at:"1609-08-27T21:43:43-07:00", updated_at:"1609-08-27T21:43:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "In thee there is not half an hour’s life.", created_at:"1609-08-27T21:44:28-07:00", updated_at:"1609-08-27T21:44:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The treacherous instrument is in thy hand,", created_at:"1609-08-27T22:06:37-07:00", updated_at:"1609-08-27T22:06:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Unbated and envenomed. The foul practice", created_at:"1609-08-27T22:38:43-07:00", updated_at:"1609-08-27T22:38:43-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Hath turned itself on me. Lo, here I lie,", created_at:"1609-08-27T23:06:36-07:00", updated_at:"1609-08-27T23:06:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Never to rise again. Thy mother’s poisoned.", created_at:"1609-08-27T23:41:00-07:00", updated_at:"1609-08-27T23:41:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I can no more. The King, the King’s to blame.", created_at:"1609-08-28T00:18:26-07:00", updated_at:"1609-08-28T00:18:26-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The point envenomed too! Then, venom, to thy", created_at:"1609-08-28T00:53:10-07:00", updated_at:"1609-08-28T00:53:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "work.", created_at:"1609-08-28T01:28:37-07:00", updated_at:"1609-08-28T01:28:37-07:00"})
Message.create!({sender_id: User.find_by({display_name: "ATTENDANTS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Treason, treason!", created_at:"1609-08-28T01:59:00-07:00", updated_at:"1609-08-28T01:59:00-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Claudius"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "O, yet defend me, friends! I am but hurt.", created_at:"1609-08-28T02:11:21-07:00", updated_at:"1609-08-28T02:11:21-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Here, thou incestuous, murd’rous, damnèd Dane,", created_at:"1609-08-28T02:27:24-07:00", updated_at:"1609-08-28T02:27:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Drink off this potion. Is thy union here?", created_at:"1609-08-28T02:43:32-07:00", updated_at:"1609-08-28T02:43:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Follow my mother.", created_at:"1609-08-28T03:08:07-07:00", updated_at:"1609-08-28T03:08:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "He is justly served.", created_at:"1609-08-28T03:13:54-07:00", updated_at:"1609-08-28T03:13:54-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "It is a poison tempered by himself.", created_at:"1609-08-28T03:50:46-07:00", updated_at:"1609-08-28T03:50:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Exchange forgiveness with me, noble Hamlet.", created_at:"1609-08-28T04:04:16-07:00", updated_at:"1609-08-28T04:04:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Mine and my father’s death come not upon thee,", created_at:"1609-08-28T04:05:03-07:00", updated_at:"1609-08-28T04:05:03-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Laertes"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Nor thine on me.", created_at:"1609-08-28T04:18:31-07:00", updated_at:"1609-08-28T04:18:31-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Heaven make thee free of it. I follow thee.—", created_at:"1609-08-28T04:19:10-07:00", updated_at:"1609-08-28T04:19:10-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I am dead, Horatio.—Wretched queen, adieu.—", created_at:"1609-08-28T04:55:56-07:00", updated_at:"1609-08-28T04:55:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "You that look pale and tremble at this chance,", created_at:"1609-08-28T04:56:34-07:00", updated_at:"1609-08-28T04:56:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "That are but mutes or audience to this act,", created_at:"1609-08-28T05:36:06-07:00", updated_at:"1609-08-28T05:36:06-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Had I but time (as this fell sergeant, Death,", created_at:"1609-08-28T05:51:57-07:00", updated_at:"1609-08-28T05:51:57-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Is strict in his arrest), O, I could tell you—", created_at:"1609-08-28T05:53:18-07:00", updated_at:"1609-08-28T05:53:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "But let it be.—Horatio, I am dead.", created_at:"1609-08-28T06:15:34-07:00", updated_at:"1609-08-28T06:15:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Thou livest; report me and my cause aright", created_at:"1609-08-28T06:49:13-07:00", updated_at:"1609-08-28T06:49:13-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "To the unsatisfied.", created_at:"1609-08-28T07:18:42-07:00", updated_at:"1609-08-28T07:18:42-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Never believe it.", created_at:"1609-08-28T07:33:36-07:00", updated_at:"1609-08-28T07:33:36-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I am more an antique Roman than a Dane.", created_at:"1609-08-28T07:36:15-07:00", updated_at:"1609-08-28T07:36:15-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Here’s yet some liquor left.", created_at:"1609-08-28T08:14:27-07:00", updated_at:"1609-08-28T08:14:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "As thou ’rt a man,", created_at:"1609-08-28T08:31:53-07:00", updated_at:"1609-08-28T08:31:53-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Give me the cup. Let go! By heaven, I’ll ha ’t.", created_at:"1609-08-28T08:53:23-07:00", updated_at:"1609-08-28T08:53:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "O God, Horatio, what a wounded name,", created_at:"1609-08-28T09:01:25-07:00", updated_at:"1609-08-28T09:01:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Things standing thus unknown, shall I leave behind", created_at:"1609-08-28T09:17:49-07:00", updated_at:"1609-08-28T09:17:49-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "me!", created_at:"1609-08-28T09:45:39-07:00", updated_at:"1609-08-28T09:45:39-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "If thou didst ever hold me in thy heart,", created_at:"1609-08-28T09:58:14-07:00", updated_at:"1609-08-28T09:58:14-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Absent thee from felicity awhile", created_at:"1609-08-28T10:24:02-07:00", updated_at:"1609-08-28T10:24:02-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And in this harsh world draw thy breath in pain", created_at:"1609-08-28T10:35:28-07:00", updated_at:"1609-08-28T10:35:28-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "To tell my story.", created_at:"1609-08-28T11:06:44-07:00", updated_at:"1609-08-28T11:06:44-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "What warlike noise is this?", created_at:"1609-08-28T11:07:50-07:00", updated_at:"1609-08-28T11:07:50-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Young Fortinbras, with conquest come from Poland,", created_at:"1609-08-28T11:10:41-07:00", updated_at:"1609-08-28T11:10:41-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "To th’ ambassadors of England gives", created_at:"1609-08-28T11:45:32-07:00", updated_at:"1609-08-28T11:45:32-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Osric"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "This warlike volley.", created_at:"1609-08-28T12:11:07-07:00", updated_at:"1609-08-28T12:11:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "O, I die, Horatio!", created_at:"1609-08-28T12:31:34-07:00", updated_at:"1609-08-28T12:31:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "The potent poison quite o’ercrows my spirit.", created_at:"1609-08-28T13:09:11-07:00", updated_at:"1609-08-28T13:09:11-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "I cannot live to hear the news from England.", created_at:"1609-08-28T13:30:27-07:00", updated_at:"1609-08-28T13:30:27-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "But I do prophesy th’ election lights", created_at:"1609-08-28T13:38:35-07:00", updated_at:"1609-08-28T13:38:35-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "On Fortinbras; he has my dying voice.", created_at:"1609-08-28T13:49:55-07:00", updated_at:"1609-08-28T13:49:55-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "So tell him, with th’ occurrents, more and less,", created_at:"1609-08-28T14:05:25-07:00", updated_at:"1609-08-28T14:05:25-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Which have solicited—the rest is silence.", created_at:"1609-08-28T14:21:59-07:00", updated_at:"1609-08-28T14:21:59-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Hamlet"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "O, O, O, O!", created_at:"1609-08-28T14:49:46-07:00", updated_at:"1609-08-28T14:49:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Now cracks a noble heart. Good night, sweet prince,", created_at:"1609-08-28T15:17:18-07:00", updated_at:"1609-08-28T15:17:18-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "And flights of angels sing thee to thy rest.", created_at:"1609-08-28T15:53:24-07:00", updated_at:"1609-08-28T15:53:24-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "duel"}).id, body: "Why does the drum come hither?", created_at:"1609-08-28T16:14:05-07:00", updated_at:"1609-08-28T16:14:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "Where is this sight?", created_at:"1609-08-28T16:16:16-07:00", updated_at:"1609-08-28T16:16:16-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "What is it you would see?", created_at:"1609-08-28T16:41:34-07:00", updated_at:"1609-08-28T16:41:34-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Horatio"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "If aught of woe or wonder, cease your search.", created_at:"1609-08-28T17:13:40-07:00", updated_at:"1609-08-28T17:13:40-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "This quarry cries on havoc. O proud Death,", created_at:"1609-08-28T17:18:23-07:00", updated_at:"1609-08-28T17:18:23-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "What feast is toward in thine eternal cell", created_at:"1609-08-28T17:18:46-07:00", updated_at:"1609-08-28T17:18:46-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "That thou so many princes at a shot", created_at:"1609-08-28T17:44:56-07:00", updated_at:"1609-08-28T17:44:56-07:00"})
Message.create!({sender_id: User.find_by({display_name: "Fortinbras"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "So bloodily hast struck?", created_at:"1609-08-28T17:56:33-07:00", updated_at:"1609-08-28T17:56:33-07:00"})
User.create!({workspace_id: Workspace.find_by({name:"Hamlet_Shakespeare"}).id, display_name: "AMBASSADORS", email: "AMBASSADORS@hamlet.com", password: "password"})
Message.create!({sender_id: User.find_by({display_name: "AMBASSADORS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "The sight is dismal,", created_at:"1609-08-28T17:57:45-07:00", updated_at:"1609-08-28T17:57:45-07:00"})
Message.create!({sender_id: User.find_by({display_name: "AMBASSADORS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "And our affairs from England come too late.", created_at:"1609-08-28T18:32:05-07:00", updated_at:"1609-08-28T18:32:05-07:00"})
Message.create!({sender_id: User.find_by({display_name: "AMBASSADORS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "The ears are senseless that should give us hearing", created_at:"1609-08-28T18:53:07-07:00", updated_at:"1609-08-28T18:53:07-07:00"})
Message.create!({sender_id: User.find_by({display_name: "AMBASSADORS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "To tell him his commandment is fulfilled,", created_at:"1609-08-28T18:57:08-07:00", updated_at:"1609-08-28T18:57:08-07:00"})
Message.create!({sender_id: User.find_by({display_name: "AMBASSADORS"}).id, parent_type: "Channel", parent_id: Channel.find_by({name: "news from norway"}).id, body: "That Rosencrantz and Guildenstern are dead.", created_at:"1609-08-28T19:30:27-07:00", updated_at:"1609-08-28T19:30:27-07:00"})
